INSERT INTO `wced_entry` VALUES (4, "-a(←)", "1", "<entry page=""1"" id=""4""><form id=""x-alx"" lang=""ceb"">-a(←)</form>
<hom>
<sense n=""1""><number>1</number><trans> affix added to nouns forming words which refer to a specific one of several: </trans>
<eg><i lang=""ceb"">Kanang isdáa, dílì kadtu,</i><trans> That fish there, not that one further over. </trans></eg>
<eg><i lang=""ceb"">Háing baláya ang íla?</i><trans> Which house is theirs? </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> added to possessive pronouns: the particular one that belongs to [so-and-so]. </trans>
<eg><i lang=""ceb"">Dakù ang amúang balay, gamay tung iláha,</i><trans> Our house is large, and theirs is small. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> affix added to adjectives to form exclamation. </trans>
<eg><i lang=""ceb"">Dakúa uy!</i><trans> My! How big it is! </trans></eg>
<eg><i lang=""ceb"">Patyun tikaw, irúa ka!</i><trans> I’ll kill you, you dog you! </trans></eg>
<eg><i lang=""ceb"">Ngilngígang awtúha à!</i><trans> That’s some car!
</trans></eg>
</sense></hom></entry>");
