INSERT INTO `wced_entry` VALUES (5, "a", "1", "<entry page=""1"" id=""5""><form id=""ax"" lang=""ceb"">á</form>
<hom>
<sense n=""0""><trans> particle used as a pause word before starting to speak. </trans>
</sense>
<sense n=""1""><number>1</number><trans> as a filler. </trans>
<eg><i lang=""ceb"">Á, muanhi ka ugmà?</i><trans> Um, are you going to come here tomorrow? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> deprecating or showing unimportance of what just preceded. </trans>
<eg><i lang=""ceb"">Á, paríha ra nákù,</i><trans> Oh, it’s all the same to me. </trans></eg>
<eg><i lang=""ceb"">Á, nagkumidiya lang siya,</i><trans> Oh, he’s just joking. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> showing mild disapproval. </trans>
<eg><i lang=""ceb"">Á, dì nà mahímù,</i><trans> Oh, you can’t do that. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> recalling or conceding s.t. </trans>
<eg><i lang=""ceb"">Á, duha diay tu,</i><trans> Oh, yes. There were two of them, weren’t there. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number><trans> preceding s.t. just found out. </trans>
<eg><i lang=""ceb"">Á, Lítu diay ímung ngálan,</i><trans> Oh, so your name is Lito. </trans></eg>
<eg><i lang=""ceb"">Á, kanindut,</i><trans> Oh, how nice! </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> expressing relief. </trans>
<eg><i lang=""ceb"">Á, nahuwasan ku,</i><trans> Ah, what a relief!
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (5, "á", "a", "m", "");
INSERT INTO `wced_entry` VALUES (6, "a", "1", "<entry page=""1"" id=""6""><form id=""aq"" lang=""ceb"">à</form>
<hom>
<sense n=""0""><trans> particle preceding or following a sentence with an adjective predicate. </trans>
</sense>
<sense n=""1""><number>1</number><trans> dismissing s.t. as impractical, too easy, impossible, etc. </trans>
<eg><i lang=""ceb"">À, mu ra diay nà? Kasayun à!</i><trans> Oh, is that all there is to it? How easy it is! </trans></eg>
<eg><i lang=""ceb"">À, ása man ku mutúu nímu,</i><trans> Hm, you think I could believe you? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> showing disapproval. </trans>
<eg><i lang=""ceb"">À, hináya nímung mulíhuk,</i><trans> Hm! You sure work slowly! </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> showing surprise. </trans>
<eg><i lang=""ceb"">À, kanindut nímug sinínà,</i><trans> How come you have such a beautiful dress on!
</trans></eg>
</sense></hom></entry>");
