<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>chew</tr> to pieces. </trans>
<eg><i lang=""ceb"">Ab-ábun sa irù ang íyang hikut,</i><trans> The dog will chew up his rope. </trans></eg>
</sense>
