<eg><i lang=""ceb"">Ang pagluib ni Maríya nag-ab-ab sa íyang balatían,</i><trans> Maria’s infidelity ate away at his insides. </trans></eg>
<eg><i lang=""ceb"">Giab-ab ang íyang pinútì sa tayà,</i><trans> His sword was eaten away by rust. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>fester</tr>. </trans>
<eg><i lang=""ceb"">Ang nag-ab-ab kung núka,</i><trans> My festering wound.†
</trans></eg>
</sense></hom></entry>");
