<eg><i lang=""ceb"">Nag-abandunar na lang siya sa íyang kaugalíngun sukad mamatay ang íyang asáwa,</i><trans> He neglected himself entirely after his wife died. </trans></eg>
<eg><i lang=""ceb"">Ayaw abandunaha (iabandunar) ang ímung pamilya,</i><trans> Do not abandon your family. </trans></eg>
</sense></hom>
