INSERT INTO `wced_entry` VALUES (27, "abang", "2", "<entry page=""2"" id=""27""><form id=""axbang"" lang=""ceb"">ábang</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S; b]</itype><trans> <tr>rent</tr>. </trans>
<eg><i lang=""ceb"">Ang usa ka kwartu giabángan sa tigúlang,</i><trans> The old man rents one of the rooms. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b]</itype><trans> hire a prostitute. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; c]</itype><trans> make an <tr>offering</tr> to a supernatural being for the use of land which is thought to be in his possession. </trans>
<eg><i lang=""ceb"">Iábang ni nákung baktína álang sa uma,</i><trans> I will sacrifice this pig as rental for the land. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> rent paid. </trans>
<eg><i lang=""ceb"">Pilay ábang nímu sa libru?</i><trans> How much rent did you pay for the book? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> money paid a prostitute. </trans>
</sense>
<sense n=""3""><number>3</number><trans> toil taken by supernatural beings. </trans>
<eg><i lang=""ceb"">Kadtung nalumus dinhi ábang kunu tu sa ingkantu,</i><trans> The man who drowned here is said to have been the rent collected by the supernatural spirit. </trans></eg>
</sense></hom>
<entry><form id=""pangaxbang"" lang=""ceb""><abbr expan=""pangábang"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> <tr>patronize</tr> a prostitute. </trans>
</sense></hom></entry>
<entry><form id=""abangan"" lang=""ceb""><abbr expan=""abangan"" type=""lemma"">-an(→)</abbr><corr><sub>1</sub></corr></form>
<hom>
<sense n=""1, 2, 3""><number>1, 2, 3</number><trans> = <xr lang=""ceb"" target=""#axbang""><sc>ábang</sc></xr>, <ix>n</ix>. </trans>
</sense>
<sense n=""4""><number>4</number><trans> <tr>haunted</tr> place, place where departed spirits take a toll or rent. </trans>
<eg><i lang=""ceb"">Abangan kunu kanang baláya. Náa giyuy mamatay káda túig,</i><trans> That house is haunted (lit. has a rental on it). Each year s.o. dies there.
</trans></eg>
</sense></hom></entry></entry>");
