INSERT INTO `wced_entry` VALUES (29, "abanid", "2", "<entry page=""2"" id=""29""><form id=""abaxnid"" lang=""ceb"">abánid</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> do s.t. <tr>step by step</tr>, and in <tr>sequence</tr>. </trans>
<eg><i lang=""ceb"">Iabánid (abaníra) kini pagpintal arun dílì magkampat,</i><trans> Paint it one square at a time so it will come out even. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> done in <tr>succession</tr>, <tr>order</tr>. </trans>
