INSERT INTO `wced_entry` VALUES (30, "abaniku", "2", "<entry page=""2"" id=""30""><form id=""abanixku"" lang=""ceb"">abaníku</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> folding <tr>fan</tr>. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> <tr>fan</tr> of any sort for fanning oneself. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>blackberry lily</tr>, k.o. bulbous ornamental: <bio><corr sic=""Balamcanda"">Belamcanda</corr> chinensis</bio>. It is so called because the leaves are arranged like an opened fan. </trans>
</sense>
<sense n=""3""><number>3</number><trans> = <xr lang=""ceb"" target=""#banixku""><sc>baníku</sc></xr>. </trans>
</sense>
<sense n=""4""><number>4</number> <form id=""kurta_diabanixku"" lang=""ceb"">kurta <abbr expan=""diabaníku"" type=""lemma"">di-</abbr></form><trans> <ix>see</ix> <xr lang=""ceb"" target=""#kurta""><sc>kurta<sub>1</sub></sc></xr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[a12]</itype><trans> make into a fan. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> <tr>fan</tr> s.o. </trans>
</sense></hom>
<entry><form id=""pangabanixku"" lang=""ceb""><abbr expan=""pangabaníku"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> <tr>fan</tr> oneself. </trans>
</sense></hom></entry>
<entry><form id=""inabanixku"" lang=""ceb"">inabaníku</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. made in such a way that it can be folded for storage, e.g., a folding chair, jackknife.
</trans>
</sense></hom></entry></entry>");
