INSERT INTO `wced_entry` VALUES (31, "abansada", "2", "<entry page=""2"" id=""31""><form id=""abansaxda"" lang=""ceb"">abansáda</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>exposed</tr> to the wind. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; c1]</itype><trans> for s.t. to be directly open to the wind. </trans>
<eg><i lang=""ceb"">Naabansáda sa hángin ang ákung bukubuku, maung gisip-un ku,</i><trans> My back was directly exposed to the wind. That’s why I caught cold. </trans></eg>
<eg><i lang=""ceb"">Ayaw abansadáha (iabansáda) sa hángin ang inyung bintánà,</i><trans> Don’t put a window right where it catches the full breeze.
</trans></eg>
</sense></hom></entry>");
