INSERT INTO `wced_entry` VALUES (34, "abanti", "2", "<entry page=""2"" id=""34""><form id=""abanti"" lang=""ceb"">abanti</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>forward</tr>, <tr>ahead</tr>. </trans>
<eg><i lang=""ceb"">Abanti ka rang milingkud,</i><trans> You took a seat too far to the front. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>ahead</tr> in score. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1a""><number>1a</number> <itype>[A2; c]</itype><trans> move <tr>forward</tr>. </trans>
<eg><i lang=""ceb"">Muabanti kag diyútay, matambug ka sa bangag,</i><trans> If you move forward any more, you will fall into the hole. </trans></eg>
<eg><i lang=""ceb"">Iabanti nang ímung awtug diyútay,</i><trans> Move your car forward a bit. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A; a]</itype><trans> be ahead, have more points in a game. </trans>
<eg><i lang=""ceb"">Naabantíhan mu námug diyis puntus,</i><trans> We were ten points ahead of you. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a12]</itype><trans> <tr>keep up</tr> with s.t. </trans>
<eg><i lang=""ceb"">Dì ku makaabanti sa galastúhan sa iskuylahan,</i><trans> I cannot keep up with the school payments. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; a12]</itype><trans> <tr>endure</tr> work. </trans>
<eg><i lang=""ceb"">Dì ku makaabanti sa pagdáru kay dautun ku,</i><trans> I can’t keep up with the plowing because I’m sickly. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number> <itype>[A]</itype><trans> ask part payment in advance, especially in salary. </trans>
</sense>
<sense n=""4b""><number>4b</number> <itype>[c]</itype><trans> give s.o. a <tr>cash advance</tr> on his salary or other payment. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>front wheel(s)</tr>. </trans>
<eg><i lang=""ceb"">Nahiyus ang abanti sa mutur,</i><trans> The front tire of the motorcycle is flat. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>forward gear</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>front seat</tr> in a car. </trans>
</sense></hom>
<entry><form id=""atras_abanti"" lang=""ceb"">atras <abbr expan=""abanti"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> <ix>see</ix> <xr lang=""ceb"" target=""#atras""><sc>atras</sc></xr>.
</trans>
</sense></hom></entry></entry>");
