INSERT INTO `wced_entry` VALUES (36, "abat", "2", "<entry page=""2"" id=""36""><form id=""abat"" lang=""ceb"">abat</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> any <tr>supernatural being</tr> or human with supernatural powers which shows itself in an unexpected and startling way. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one who is ‘it’ in games. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; a2]</itype><trans> <tr>head off</tr> s.o. </trans>
<eg><i lang=""ceb"">Maapsan pa nímu siya ug ímung abatun sa iskína,</i><trans> You can still catch up with him if you head him off at the corner. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; a12]</itype><trans> <tr>frighten</tr> s.o. by appearing suddenly or otherwise startling him. </trans>
<eg><i lang=""ceb"">Ig-ági níya, abta siya,</i><trans> When he comes by, give him a scare. </trans></eg>
</sense></hom>
<entry><form id=""alabtan_abtanan"" lang=""ceb"">alabtan, abtanan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>haunted</tr>, place where things appear suddenly. </trans>
</sense></hom></entry>
<entry><form id=""alabtun"" lang=""ceb"">alabtun</form>
<hom>
<sense n=""0""><trans> s.o. to whom spirits tend to show themselves. </trans>
</sense></hom></entry>
<entry><form id=""abat-axbat"" lang=""ceb"">abat-ábat</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>game of tag</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> play tag. </trans>
</sense>
<sense n=""2""><number>2</number><trans> try to meet without succeeding. </trans>
<eg><i lang=""ceb"">Wà giyud mi magkítà, nag-abat-ábat lang,</i><trans> We just kept missing each other.
<pb n=""3""/>
</trans></eg>
</sense></hom></entry></entry>");
