INSERT INTO `wced_entry` VALUES (38, "abat2", "3", "<entry page=""3"" id=""38""><form id=""axbat2"" lang=""ceb"">ábat<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1]</itype><trans> <tr>feel</tr> with the hands, esp. to find s.t. out. </trans>
<eg><i lang=""ceb"">Nag-ábat siya sa yáwi sa íyang bulsa kung wà ba hibyai,</i><trans> He felt for the key in his pocket to see if he hadn’t left it behind. </trans></eg>
<eg><i lang=""ceb"">Abátun ku ang íyang agtang ug hilanatun ba,</i><trans> I’ll touch her forehead to see if she is feverish. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A123S; a12b2]</itype><trans> feel s.t. with the sense of touch. </trans>
<eg><i lang=""ceb"">Nakaabat ku sa kabugnaw sa sinihan,</i><trans> I felt the coolness of the movie house. </trans></eg>
<eg><i lang=""ceb"">Abátun gánì nímu ang kasakit, musamut giyud,</i><trans> If you think about the pain, it will get worse. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A123S; b2]</itype><trans> happen to <tr>notice</tr>, <tr>sense</tr> s.t. </trans>
<eg><i lang=""ceb"">Nakaabat kung mu rag may misaka sa ámung báy,</i><trans> I sensed that s.o. had entered our house.
</trans></eg>
</sense></hom></entry>");
