INSERT INTO `wced_entry` VALUES (39, "abay", "3", "<entry page=""3"" id=""39""><form id=""abay"" lang=""ceb"">abay</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; b6]</itype><trans> <tr>move along</tr> together with s.t. moving. </trans>
<eg><i lang=""ceb"">Lagmit hiligsan ang bátà kay nag-abay sa tartanilya,</i><trans> The child is likely to be run over because he is running alongside of the rig. </trans></eg>
<eg><i lang=""ceb"">Silang duha nag-ábay paglanguy,</i><trans> The two swam side by side. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <form id=""abay_ug_sawa"" lang=""ceb""><abbr expan=""abay"" type=""lemma"">—</abbr> ug sawa</form><trans> have a snake born at the same time one is born. The snake is called one’s twin (<ix>kalúha</ix>) and is supposed to bring him and his family luck. </trans>
<eg><i lang=""ceb"">Pagkatáwu sa ákung iyaan, giabayan (giabyan) ug sawa. Mau nang nadátù ang íyang inahan,</i><trans> When my aunt was born, a twin snake was born with her, and so her mother became rich. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; c]</itype><trans> go in with s.o. who buys or invests in s.t. </trans>
<eg><i lang=""ceb"">Ug mupalit kag usa ka sákung humay muabay kug lima ka gantang,</i><trans> If you buy a sack of rice, I will go in with you for five ganta’s worth. </trans></eg>
<eg><i lang=""ceb"">Giabyan níyag singku písus ang ákung pusta,</i><trans> He went in for five pesos on my bet. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AN]</itype><trans> go in together in a fishing operation which requires several hands. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[c1]</itype><trans> attach a gaff in the <ix>abay</ix> way (<ix>see</ix> <xr lang=""ceb"" target=""#abay""><sc>abay</sc></xr>, <ix>n</ix> <bx>4</bx>). </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> money paid as a <tr>share</tr> in a purchase or investment. </trans>
<eg><i lang=""ceb"">Ang ákung abay bálig dus písus ra,</i><trans> My share is two pesos’ worth. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>bridesmaid</tr> or <tr>best man</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> man’s male <tr>friend</tr>. </trans>
</sense>
<sense n=""3a""><number>3a</number><trans> title used by males of the same age to each other. <ix>short form:</ix> <bx>bay</bx>. </trans>
<eg><i lang=""ceb"">Ása man ning dyípa, bay?</i><trans> Where is this jeep headed for, driver? </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> manner of tying a gaff to a cock level with and parallel to the spur to offset any advantage it may have over its opponent. </trans>
</sense></hom>
<entry><form id=""mangalaxbay_mangaabay"" lang=""ceb""><abbr expan=""mangalábay"" type=""lemma"">maN-l-(←)</abbr>, <abbr expan=""mangaabay"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> persons who go in together in a fishing operation. </trans>
</sense></hom></entry>
<entry><form id=""abayan_abyanan"" lang=""ceb""><abbr expan=""abayan"" type=""lemma"">-an</abbr>, abyanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>life saver</tr>. </trans>
</sense></hom></entry>
<entry><form id=""abyan"" lang=""ceb"">abyan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>friend</tr>, <tr>companion</tr>. </trans>
<eg><i lang=""ceb"">Alang kaníya walà siyay láing abyan kun dílì álak,</i><trans> He has no other friend except liquor. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> supernatural being that provides a shaman or sorcerer with his power. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> be friends. </trans>
<eg><i lang=""ceb"">Kita lay mag-abyan,</i><trans> Let’s be friends. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> indulge in a bad habit. </trans>
<eg><i lang=""ceb"">Walà siya makig-abyan sa huguyhúguy,</i><trans> He did not indulge in roaming about.
</trans></eg>
</sense></hom></entry></entry>");
