INSERT INTO `wced_entry` VALUES (55, "abir", "4", "<entry page=""4"" id=""55""><form id=""abir"" lang=""ceb"">abir</form>
<hom>
<sense n=""1""><number>1</number><trans> particle used in calling attention to a point in contention. </trans>
<eg><i lang=""ceb"">Ang diyus makagagáhum. Abir, unsáun man nímu pagpangutána diin siya manukad,</i><trans> God is almighty. All right then, how can you ask where He comes from? </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> particle used in inciting a person to do s.t. </trans>
<eg><i lang=""ceb"">Abir, sulayi ug musalir ba nang paagíha,</i><trans> <asc>O.K.</asc> Just see if that procedure works out. </trans></eg>
<eg><i lang=""ceb"">Abir, sumbága kunu ku kay isumbung tikaw ni Pápa,</i><trans> All right, just try hitting me, and I’ll tell Daddy on you. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> pause word expressing hesitation when one doesn’t know how to do s.t. </trans>
<eg><i lang=""ceb"">Abir, lisúa nag hínay dúngan sa pagtulbuk ári,</i><trans> Let’s see now, turn that slowly and press this at the same time. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> = <xr lang=""ceb"" target=""#ambi""><sc>ambi</sc></xr>. <bx>4</bx> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; ac]</itype><trans> try one’s luck, take a stab at. </trans>
<eg><i lang=""ceb"">Nangabir (miabir) lang siyag panlútù. Dì hinúun siya kamau,</i><trans> He just took a try at cooking. He doesn’t really know how. </trans></eg>
<eg><i lang=""ceb"">Abirun unyà nákug hangyù si Maríya,</i><trans> I’ll just take a stab at asking Maria. </trans></eg>
<eg><i lang=""ceb"">Iabir kunu ni sa ahinsiya ug dawátun ba,</i><trans> Try taking this to the pawnshop and see if they will accept it.
</trans></eg>
</sense></hom></entry>");
