<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB; b5]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>open</tr> s.t., be open. </trans>
<eg><i lang=""ceb"">Ikaw bay nag-abli sa pultahan?</i><trans> Were you the one who opened the door? </trans></eg>
<eg><i lang=""ceb"">Sulud lang kay nag-abli ang pultahan,</i><trans> Just come right in. The door is open. </trans></eg>
