<sense n=""2""><number>2</number><trans> <tr>begin</tr>, <tr>start</tr> a class, business, etc. </trans>
<eg><i lang=""ceb"">Muabli ang klási sa Hunyu,</i><trans> Classes begin in June. </trans></eg>
<eg><i lang=""ceb"">Ablíhag (ablíhug) sayu ang klási sunud túig,</i><trans> Classes will open early next year. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>found</tr>, <tr>establish</tr> an enterprise. </trans>
<eg><i lang=""ceb"">Anus-a man ablíhi (ablíha) ang inyung iskuylahan sa panahì?</i><trans> When will you open your sewing school? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>opening</tr>. </trans>
<eg><i lang=""ceb"">Dakug abli nang tarúha,</i><trans> That can has a big opening. </trans></eg>
