<entry><form id=""hingabsin_palaabsin_absinixru_absinus"" lang=""ceb""><abbr expan=""hingabsin"" type=""lemma"">hiN-</abbr>, <abbr expan=""palaabsin"" type=""lemma"">pala-</abbr>, absiníru, absinus</form>
