INSERT INTO `wced_entry` VALUES (87, "abtik", "5", "<entry page=""5"" id=""87""><form id=""abtik"" lang=""ceb"">abtik</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>nimble</tr>, <tr>quick</tr> in reaction. </trans>
<eg><i lang=""ceb"">Ang musáyaw sa tinikling kinahanglang abtik ug tiil,</i><trans> Whoever dances the <ix>tinikling</ix> has to have nimble feet. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>fast</tr>, live in action. </trans>
<eg><i lang=""ceb"">Mahuman ni dáyug abtik lang mutrabáhu,</i><trans> It will get done right away if you work rapidly. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>cunning</tr>, <tr>sly</tr>. </trans>
<eg><i lang=""ceb"">Abtik giyud siya kay midáwat imbis mubáyad,</i><trans> He sure is sharp. Instead of paying as he should have, he got paid. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> get to be nimble. </trans>
</sense>
<sense n=""2""><number>2</number><trans> get to be fast in action. </trans>
<eg><i lang=""ceb"">Muabtik (maabtik) lagi ang íyang panglíhuk basta pakit-ug sápì,</i><trans> He’ll get moving fast as long as you show him money. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B12]</itype><trans> get to be <tr>cunning</tr>, sly. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[b4(1)]</itype><trans> <tr>outsmart</tr>. </trans>
<eg><i lang=""ceb"">Naabtikan sad ku sa bátà,</i><trans> The child put one over on me. </trans></eg>
</sense></hom>
<entry><form id=""pangabtik"" lang=""ceb""><abbr expan=""pangabtik"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> engage in <tr>chicanery</tr>. </trans>
<eg><i lang=""ceb"">Ayaw kug pangabtíki kay suhítu ku,</i><trans> Don’t try to put a fast one over on me, because I know my way around.
</trans></eg>
</sense></hom></entry></entry>");
