INSERT INTO `wced_entry` VALUES (89, "abu", "5", "<entry page=""5"" id=""89""><form id=""abu"" lang=""ceb"">abu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>ashes</tr>. </trans>
