INSERT INTO `wced_entry` VALUES (92, "abud, abud1", "6", "<entry page=""6"" id=""92""><form id=""abud_axbud"" lang=""ceb"">abud, ábud<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>throw</tr> grains, throw grains to. </trans>
<eg><i lang=""ceb"">Ang bukbukung mais mauy iábud sa manuk,</i><trans> Throw the beetle-infested corn to the chickens. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> drop grains into a hole in planting. </trans>
<eg><i lang=""ceb"">Mag-abud sila sa ílang baul,</i><trans> They will plant their field. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>feed</tr> grain into a mill. </trans>
<eg><i lang=""ceb"">Ímu síging abdan (abúran) ang galingan,</i><trans> Keep feeding grains into the mill. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <tr>supply</tr> a factory with raw materials. </trans>
<eg><i lang=""ceb"">Kanang kumpaniyáha mauy tig-abud sa mga papil sa imprinta,</i><trans> That company supplies paper to the printing press. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> feed news, gossip. Aha! </trans>
<eg><i lang=""ceb"">Ikaw diay nag-abud sa mga nutisya,</i><trans> So you were the one who spread the news! </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> feed for fowls. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one’s turn to throw grains. </trans>
<eg><i lang=""ceb"">Ákù na rung abud,</i><trans> It’s my turn to feed (the chickens). </trans></eg>
</sense></hom>
<entry><form id=""alabdan"" lang=""ceb"">alabdan</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#abud""><sc>abud</sc></xr>, <ix>n</ix> 2.
