INSERT INTO `wced_entry` VALUES (95, "abug1", "6", "<entry page=""6"" id=""95""><form id=""abug"" lang=""ceb"">abug<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>dust</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B46; a4b4(1)]</itype><trans> become <tr>dusty</tr>. </trans>
<eg><i lang=""ceb"">Muabug ang karsáda ug dúgayng uwanun,</i><trans> The road gets dusty if the rains come late. </trans></eg>
<eg><i lang=""ceb"">Giabug ang ámung balay kay dúgay na nga wà puy-i,</i><trans> Our house became all dusty because it hadn’t been lived in for a long time. </trans></eg>
<eg><i lang=""ceb"">Tabúni ang libru arun dílì maabugan,</i><trans> Cover the books so they won’t get dusty. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1256]</itype><trans> turn into dust. </trans>
