<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> tending to <tr>take advantage</tr>, <tr>infringe</tr> on rights. </trans>
<eg><i lang=""ceb"">Abusádu ang mga kutsíru dinhi. Basta muulan, pabayrun ta nílag dubli,</i><trans> The rig drivers are abusive. If it rains, they double the fare. </trans></eg>
<eg><i lang=""ceb"">Nagníwang lang nà siya kay abusádu man gud sa íyang láwas,</i><trans> He is thin because he neglects his body. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126]</itype><trans> become abusive.
</trans>
</sense></hom></entry>");
