INSERT INTO `wced_entry` VALUES (117, "abusar", "7", "<entry page=""7"" id=""117""><form id=""abusar"" lang=""ceb"">abusar</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3; b(1)]</itype><trans> a do s.t. one is not entitled to, take advantage of s.o. by infringing on his rights. </trans>
<eg><i lang=""ceb"">Nag-abusar siya paggáwì sa makinilya nga way pananghid,</i><trans> He took the liberty of using the typewriter without permission. </trans></eg>
<eg><i lang=""ceb"">Giabusahan sila sa magbabaligyà kay way kumpitinsiya,</i><trans> The storekeeper took advantage of them because there was no competition. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> mistreat one’s health. </trans>
<eg><i lang=""ceb"">Nag-abusar ka lang sa ímung láwas sa ímung pag-inum,</i><trans> You’re abusing your health with all your drinking. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> do s.t. to a superfluous degree. </trans>
<eg><i lang=""ceb"">Wà na nà magkaun; nag-abusar na nà,</i><trans> That is not eating; that is excessive indulgence.
</trans></eg>
</sense></hom></entry>");
