INSERT INTO `wced_entry` VALUES (119, "abut", "7", "<entry page=""7"" id=""119""><form id=""abut"" lang=""ceb"">abut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>arrive</tr>, reach a place. </trans>
<eg><i lang=""ceb"">Dì pa makaabut (maabut) ang suwat,</i><trans> The letter won’t have arrived yet. </trans></eg>
<eg><i lang=""ceb"">Duul ra. Maabut ug lud-an,</i><trans> It’s close by, within spitting distance (can be reached by spitting). </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; ac]</itype><trans> lead to and reach a place. </trans>
<eg><i lang=""ceb"">Muabut ba ning karsadáha sa subà?</i><trans> Does this road reach the river? </trans></eg>
<eg><i lang=""ceb"">Kining lugára dílì abutun sa táub,</i><trans> The tide doesn’t get as far as this place. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A; ac]</itype><trans> reach s.t. with the arms. </trans>
<eg><i lang=""ceb"">Maabut ba nímu ang sanga?</i><trans> Can you reach the branch? </trans></eg>
<eg><i lang=""ceb"">Iabut kunu nang ímung kamut sa bungbung,</i><trans> Reach your hands out to the wall. </trans></eg>
</sense>
<sense n=""1c""><number>1c</number> <itype>[B; b4]</itype><trans> reach an amount, last a certain length. </trans>
<eg><i lang=""ceb"">Ang ákung swildu dílì muabut ug dus mil,</i><trans> My salary doesn’t reach two thousand. </trans></eg>
<eg><i lang=""ceb"">Walà abtig duha ka adlaw ang bugas,</i><trans> The rice did not last two days. </trans></eg>
</sense>
<sense n=""1d""><number>1d</number> <form id=""abut_sa_hunaqhuxnaq"" lang=""ceb""><abbr expan=""abut"" type=""lemma"">—</abbr> sa hunàhúnà</form><trans> come to the mind. </trans>
</sense>
<sense n=""1e""><number>1e</number> <itype>[b4]</itype><trans> <tr>receive</tr> money. </trans>
<eg><i lang=""ceb"">Abtan (abutan) ku tingálig kwarta rung hápun,</i><trans> I’ll probably get my money this afternoon. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a4]</itype><trans> have a feeling come over one. </trans>
<eg><i lang=""ceb"">Giabut siyag kakulbà,</i><trans> A feeling of terror came over her. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A23; b4]</itype><trans> catch s.o. doing s.t. </trans>
<eg><i lang=""ceb"">Si Turyuy nakaabut nílang nagháluk,</i><trans> It was Torio who came upon them kissing. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number> <itype>[b4]</itype><trans> be <tr>overtaken</tr>. </trans>
<eg><i lang=""ceb"">Abtan kag gabíi sa dálan,</i><trans> You will be overtaken by night on the road. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A2; b4]</itype><trans> come to an <tr>orgasm</tr>. </trans>
<eg><i lang=""ceb"">Dílì giyud muabut ang lamì,</i><trans> She won’t have an orgasm. (The delicious feeling will not arrive.) </trans></eg>
<eg><i lang=""ceb"">Abtan ra gihápun síya basta maningkámut ang duruha,</i><trans> She will have an orgasm if both try their best. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A23]</itype><trans> for an event or season of the year to come around. </trans>
<eg><i lang=""ceb"">Dì na madúgay muabut na ang Pasku,</i><trans> It won’t be long before Christmas comes. </trans></eg>
</sense>
<sense n=""6""><number>6</number> <itype>[A12; b]</itype><trans> be on time for s.t. </trans>
<eg><i lang=""ceb"">Nakaabut ka ba sa panahun sa Katsílà?</i><trans> Do you go back as far as the Spanish times? </trans></eg>
<eg><i lang=""ceb"">Maabtan pa nímu ang barku,</i><trans> You can still catch the boat. </trans></eg>
</sense>
<sense n=""7a""><number>7a</number> <itype>[A12; a1]</itype><trans> afford to pay for s.t. </trans>
<eg><i lang=""ceb"">Dì ku makaabut ug palit niánà,</i><trans> I can’t afford to buy that. </trans></eg>
<eg><i lang=""ceb"">Wà siyay ikaabut sa báyad,</i><trans> He has no funds to meet the payments with. </trans></eg>
</sense>
<sense n=""7b""><number>7b</number> <itype>[a3]</itype><trans> can be done, reached. </trans>
<eg><i lang=""ceb"">Tabángan tikaw kútub sa ákung maabut,</i><trans> I’ll help you as much as I can. </trans></eg>
</sense>
<sense n=""8""><number>8</number> <itype>[A; b6]</itype><trans> stay temporarily some place. </trans>
<eg><i lang=""ceb"">Háin man ka mag-abut run?</i><trans> Where are you staying now? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. or s.o. that has arrived s.w. </trans>
<eg><i lang=""ceb"">Dílì ni karáan uy. Bag-u ning abut,</i><trans> This is not old stock. It just arrived. </trans></eg>
<eg><i lang=""ceb"">Bag-u kung abut dinhi. Wà pa ku kadumdum,</i><trans> I am a newcomer here. I don’t <pb n=""8""/>know how to get there. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>yield</tr>, <tr>proceeds</tr> from an effort, <tr>income</tr>, <tr>harvest</tr>. </trans>
<eg><i lang=""ceb"">Pilay abut sa yútà káda túig?</i><trans> How much does the land yield each year? </trans></eg>
<eg><i lang=""ceb"">Gamay rag abut ang munisipyu,</i><trans> The town has a small income. </trans></eg>
</sense></hom>
<entry><form id=""axbut"" lang=""ceb""><abbr expan=""ábut"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; ac]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>meet</tr> together. </trans>
<eg><i lang=""ceb"">Abútun nákù ang duha ka tumuy,</i><trans> I will make the two ends meet. </trans></eg>
<eg><i lang=""ceb"">Mau kadtung lugára ang ámung gikaabútan (gipanag-abútan),</i><trans> That is the place where we met. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>overlap</tr> in time. </trans>
<eg><i lang=""ceb"">Nag-ábut na man gánì ang sinanggì karun ug sa miáging túig,</i><trans> This year’s corn crop overlaps with last year’s. (I.e., this year’s crop was harvested before last year’s crop had been used up.) </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A13]</itype><trans> <form id=""abut_ang_ginhaxwa"" lang=""ceb""><abbr expan=""abut"" type=""lemma"">—</abbr> ang ginháwa</form> be <tr>panting for breath</tr> (gasps of breath overlap). </trans>
<eg><i lang=""ceb"">Giúyug siya sa ubu. Nag-ábut ang íyang pagginháwa,</i><trans> He was shaken by his coughing fit. He was panting for breath. </trans></eg>
</sense></hom></entry>
<entry><form id=""paaxbut"" lang=""ceb""><abbr expan=""paábut"" type=""lemma"">pa-(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> wait in expectation for. </trans>
<eg><i lang=""ceb"">Dì na ku mupaábut sa kumbira,</i><trans> I won’t wait for the party. </trans></eg>
<eg><i lang=""ceb"">Paabútun tikaw hangtud sa alas kwatru,</i><trans> I’ll wait for you until four o’clock. </trans></eg>
</sense></hom></entry>
<entry><form id=""abut-abut"" lang=""ceb"">abut-abut</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3; b6]</itype><trans> arrive in close succession. </trans>
<eg><i lang=""ceb"">Nag-abut-abut ang mga bisíta,</i><trans> Visitors came one after another. </trans></eg>
</sense></hom></entry>
<entry><form id=""abut-axbut"" lang=""ceb"">abut-ábut</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3; b6]</itype><trans> go every now and then. </trans>
<eg><i lang=""ceb"">Nag-abut-ábut nà siya sa Hungkung,</i><trans> She goes to Hong Kong often. </trans></eg>
</sense></hom></entry>
<entry><form id=""singabut"" lang=""ceb""><abbr expan=""singabut"" type=""lemma"">siN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for a time, event to <tr>approach</tr>. </trans>
<eg><i lang=""ceb"">Nagsingabut ang pista,</i><trans> The fiesta is approaching. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> for one’s time of the month to approach. </trans>
<eg><i lang=""ceb"">Nagsingabut na, maung saputun,</i><trans> She’s in a bad mood because her time of the month is approaching. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be in expectations of, look forward to. </trans>
<eg><i lang=""ceb"">Nagsingabut ku nga mahuman ang trabáhug sayu,</i><trans> I’m expecting to finish the work early. </trans></eg>
</sense></hom></entry>
<entry><form id=""alabuxtun"" lang=""ceb""><abbr expan=""alabútun"" type=""lemma"">-l-un(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> subject to periodic attacks of an illness. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.o. who has the fortune of getting a large yield from an effort. </trans>
</sense></hom></entry>
<entry><form id=""alabtan_abtanan"" lang=""ceb"">alabtan, abtanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place one usually stays temporarily. </trans>
</sense></hom></entry>
<entry><form id=""alabuxtan"" lang=""ceb""><abbr expan=""alabútan"" type=""lemma"">-l-an-(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#abtanan""><sc>abtanan</sc></xr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> place one meets s.o. else. </trans>
</sense></hom></entry>
<entry><form id=""umaaxbut_umalaxbut_taliabut_taliaxbut_saliabut_saliaxbut"" lang=""ceb""><abbr expan=""umaábut"" type=""lemma"">um-r-(←)</abbr>, <abbr expan=""umalábut"" type=""lemma"">um-l-(←)</abbr>, <abbr expan=""taliabut"" type=""lemma"">tali-</abbr>, <abbr expan=""taliábut"" type=""lemma"">tali-(←)</abbr>, <abbr expan=""saliabut"" type=""lemma"">sali-</abbr>, <abbr expan=""saliábut"" type=""lemma"">sali-(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> about to arrive. </trans>
<eg><i lang=""ceb"">May umaábut (umalábut, taliabut, taliábut, saliabut, saliábut) nga mga bisíta,</i><trans> There are some visitors about to arrive.†
</trans></eg>
</sense></hom></entry></entry>");
