INSERT INTO `wced_entry` VALUES (135, "adbans", "8", "<entry page=""8"" id=""135""><form id=""adbans"" lang=""ceb"">adbans</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>advance</tr> payment on a salary, debt, etc. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AP; cP]</itype><trans> give an advance. </trans>
<eg><i lang=""ceb"">Adbansan ka nákug singku,</i><trans> I’ll advance you five pesos. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> ask for an advance. </trans>
<eg><i lang=""ceb"">Muadbans akug singku pára sa kumpra,</i><trans> I would like to have five pesos in advance for shopping. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> for soldiers to advance. </trans>
<eg><i lang=""ceb"">Miadbans ang mga Hapun,</i><trans> The Japanese advanced. </trans></eg>
<eg><i lang=""ceb"">Ílang giadbans ang mga kanyun,</i><trans> They put the artillery on the front line. </trans></eg>
</sense></hom>
<entry><form id=""adbans_gard"" lang=""ceb""><abbr expan=""adbans"" type=""lemma"">—</abbr> gard</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a contingent sent ahead to the front. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. sent s.w. to prepare the way (humorous metaphor). </trans>
<eg><i lang=""ceb"">Nag-una ang mga adbans gard kay silay magpriparar,</i><trans> The advance guard has gone ahead because they will get things ready.
</trans></eg>
</sense></hom></entry></entry>");
