INSERT INTO `wced_entry` VALUES (152, "adlaw", "9", "<entry page=""9"" id=""152""><form id=""adlaw"" lang=""ceb"">adlaw</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>sun</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>day</tr>. </trans>
<eg><i lang=""ceb"">May adlaw nga magbásul ka,</i><trans> The day will come that you will be sorry. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> day, as opposed to night. </trans>
</sense></hom>
<entry><form id=""pila_ka_adlaw"" lang=""ceb"">pila ka <abbr expan=""adlaw"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> it won’t be long. </trans>
<eg><i lang=""ceb"">Pila ka adlaw makapánaw ta sa búwan,</i><trans> Soon we’ll be able to take trips to the moon. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> one’s day for winning. </trans>
<eg><i lang=""ceb"">Ímu tanang adlaw,</i><trans> You get all the breaks. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>birthday</tr>. </trans>
</sense>
<sense n=""4""><number>4</number><trans> amount earned in a day. </trans>
<eg><i lang=""ceb"">Singku ra may íyang adlaw niánà,</i><trans> He only gets five pesos a day from it. </trans></eg>
</sense></hom></entry>
<entry><form id=""adlaw_sa_minatay"" lang=""ceb""><abbr expan=""adlaw"" type=""lemma"">—</abbr> sa minatay</form>
<hom>
<sense n=""0""><trans> <tr>All Soul’s Day</tr>. </trans>
</sense></hom></entry>
<entry><form id=""Mahal_nga_adlaw"" lang=""ceb"">Mahal nga <abbr expan=""adlaw"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> <tr>Holy Week</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3; b6]</itype><trans> receive a certain amount daily. </trans>
<eg><i lang=""ceb"">Muadlaw kug tagduha ka líbu ka písus,</i><trans> I net two thousand pesos a day. </trans></eg>
<eg><i lang=""ceb"">Adláwi lang siyag tag-diyis,</i><trans> Pay him ten pesos per day. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> celebrate a birthday. </trans>
<eg><i lang=""ceb"">Adtu nyà sa ámù kay mag-adlaw ku,</i><trans> Come to my house for my birthday party. </trans></eg>
</sense></hom></entry>
<entry><form id=""adlaw-adlaw"" lang=""ceb"">adlaw-adlaw</form>
<hom>
<sense n=""0""><trans> every day. </trans>
</sense></hom></entry>
