INSERT INTO `wced_entry` VALUES (167, "adtu1", "10", "<entry page=""10"" id=""167""><form id=""adtu"" lang=""ceb"">adtu<sub>1</sub></form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>there</tr> (far away, future). </trans>
<eg><i lang=""ceb"">Adtu ku higdà sa íla,</i><trans> I will sleep there at their house. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> will go s.w. far. </trans>
<eg><i lang=""ceb"">Adtu ku sa Karbun,</i><trans> I’m going to the market. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> there he (she, etc.) goes doing it (although he shouldn’t be). </trans>
<eg><i lang=""ceb"">Adtu nanghambug na sad,</i><trans> There he goes again, showing off. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b3c]</itype><trans> go, bring to a place. </trans>
<eg><i lang=""ceb"">Nakaadtu na ku didtu kas-a,</i><trans> I went there once. </trans></eg>
<eg><i lang=""ceb"">Unsa mang lugára ang giadtúan ninyu?</i><trans> What place did you go to? </trans></eg>
<eg><i lang=""ceb"">Iadtu kini ngadtu sa íla,</i><trans> Go bring this to their house. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13; a2]</itype><trans> go get s.t. </trans>
<eg><i lang=""ceb"">Ikaw bay nag-adtu kang Pidru arun paanhíun siya?</i><trans> Were you the one who went to Pedro’s to tell him to come? </trans></eg>
<eg><i lang=""ceb"">Ug dì ka manáug ánang kahúya adtúun tika,</i><trans> If you do not come down from that tree, I’ll come up after you. </trans></eg>
</sense></hom>
<entry><form id=""hiadtu_haadtu"" lang=""ceb""><abbr expan=""hiadtu"" type=""lemma"">hi-</abbr>/<abbr expan=""haadtu"" type=""lemma"">ha-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256; b6]</itype><trans> happen to go. </trans>
<eg><i lang=""ceb"">Diyútay ra kaáyu ang mahiadtu sa mga táwu,</i><trans> A very small amount seeps down to the people. </trans></eg>
</sense></hom></entry>
<entry><form id=""adtuan"" lang=""ceb"">adtuan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> <tr>always go</tr> s.w. </trans>
<eg><i lang=""ceb"">Mag-adtuan ku sa íla káda buntag,</i><trans> I always go see them every morning. </trans></eg>
</sense></hom></entry>
<entry><form id=""adtuuxnun_aladtuxun"" lang=""ceb"">adtuúnun, aladtúun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> things one has to get. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> hard to get to. </trans>
<eg><i lang=""ceb"">Dì ku muadtu sa inyu kay aladtúun kaáyu,</i><trans> I won’t go to your place because it is hard to get to. </trans></eg>
</sense></hom></entry>
<entry><form id=""umaadtuxay_umaadtu"" lang=""ceb"">umaadtúay, umaadtu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> about to go. </trans>
</sense></hom></entry>
<entry><form id=""kaadtuun"" lang=""ceb"">kaadtuun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> feel very much like going s.w.
</trans>
</sense></hom></entry></entry>");
