INSERT INTO `wced_entry` VALUES (179, "aduna", "10", "<entry page=""10"" id=""179""><form id=""aduxna"" lang=""ceb"">adúna</form>
<hom>
<sense n=""0""> <ix>short form:</ix> <form id=""duxna"" lang=""ceb"">dúna</form><trans> there is, are, will be. </trans>
<eg><i lang=""ceb"">Dúnay libru sa lamísa,</i><trans> There is a book on the table. </trans></eg>
</sense></hom>
<entry><form id=""aduxnay_subject"" lang=""ceb""><abbr expan=""adúnay"" type=""lemma"">-y</abbr> <r>[<ix>subject</ix>]</r></form>
<hom>
<sense n=""0""><trans> [subject] has. </trans>
<eg><i lang=""ceb"">Dúnay libru si Huwan,</i><trans> John has a book. </trans></eg>
</sense></hom></entry>
<entry><form id=""pakaaduxna"" lang=""ceb""><abbr expan=""pakaadúna"" type=""lemma"">paka-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> strive to have s.t. </trans>
<eg><i lang=""ceb"">Bisag wà kuy kwarta, pakaadunáhun giyud aku nímu,</i><trans> Even though I have no money, you want to force me to get some. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#pakaadunaxhan""><sc>pakaadunáhan</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""adunaxhan"" lang=""ceb"">adunáhan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> wealthy. </trans>
<eg><i lang=""ceb"">Usa siya sa mga adunáhan sa ámung lungsud,</i><trans> He is one of the wealthy people in our town. </trans></eg>
</sense></hom></entry>
<entry><form id=""pakaadunaxhan"" lang=""ceb"">pakaadunáhan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> pretend to be wealthy, consider to be wealthy. </trans>
<eg><i lang=""ceb"">Nagpakaadunáhan siya bisag way nahut,</i><trans> He pretends to be rich even though he hasn’t got a penny. </trans></eg>
<eg><i lang=""ceb"">Gipakaadunáhan ba aku nímu?</i><trans> Do you think I’m rich?
</trans></eg>
</sense></hom></entry></entry>");
