INSERT INTO `wced_entry` VALUES (202, "agang", "11", "<entry page=""11"" id=""202""><form id=""agaxng"" lang=""ceb"">agáng</form>
<hom>
<sense n=""1""><number>1</number><trans> exclamation uttered upon experiencing pain. </trans>
<eg><i lang=""ceb"">Agáng sakíta!</i><trans> <tr>Ouch</tr>, how painful! </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> exclamation of disbelief or disgust. </trans>
<eg><i lang=""ceb"">Agáng, ikaw na lang nawnga ang manlangyaw? Tapulan!</i><trans> Humph! The likes of you immigrating? You’re too lazy.
