INSERT INTO `wced_entry` VALUES (204, "agap", "11", "<entry page=""11"" id=""204""><form id=""agap"" lang=""ceb"">agap</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> in a great <tr>hurry</tr> to do s.t. </trans>
<eg><i lang=""ceb"">Agap ka ra kaáyung misudyà níya,</i><trans> You were much too quick to remind him he was wrong. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> intensely interested in obtaining s.t. </trans>
<eg><i lang=""ceb"">Aku nga agap ug salapì mihátag sa ákung láwas,</i><trans> Greedy for money, I surrendered my body. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> make haste to. </trans>
<eg><i lang=""ceb"">Agapun nátù pagtabuk únà magbálud,</i><trans> Let’s make haste to cross before the waves rise. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be after s.t. </trans>
<eg><i lang=""ceb"">Nagpabulubuútan uruy nà siya kay nag-agap man ug dulsi,</i><trans> He is pretending to be well-behaved because he is interested in getting candy.
</trans></eg>
</sense></hom></entry>");
