INSERT INTO `wced_entry` VALUES (229, "agi", "12", "<entry page=""12"" id=""229""><form id=""agi"" lang=""ceb"">agi</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>oh my!</tr>, expression of surprise. </trans>
<eg><i lang=""ceb"">Agi, kadakù ánang isdáa!</i><trans> Oh my! How big that fish is! </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> expression of revulsion to s.t. perceived. </trans>
<eg><i lang=""ceb"">Agi, kangilngig naadtu!</i><trans> My! how terrible that was! </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> expression of objection to s.t. different from what is desired. </trans>
<eg><i lang=""ceb"">Agi! Dì man nà mau!</i><trans> My! That is not the one I asked for. </trans></eg>
</sense>
<sense n=""1c""><number>1c</number><trans> expression of happiness at s.t. found out. </trans>
<eg><i lang=""ceb"">Agi, kanindut, kun tinúud,</i><trans> My! How nice, if it’s true. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> expression of sudden pain. </trans>
<eg><i lang=""ceb"">Agi! Sakíta,</i><trans> Ow! That hurts.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (229, "agi", "agi", "m", "");
INSERT INTO `wced_translation` (entryid, translation) VALUES (229, "oh my!");
INSERT INTO `wced_entry` VALUES (230, "agi", "12", "<entry page=""12"" id=""230""><form id=""axgi"" lang=""ceb"">ági</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2S3S; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> go by, through a place. <pb n=""13""/></trans>
<eg><i lang=""ceb"">Dílì ku muági dihà kay náay irù,</i><trans> I won’t go that way because there’s a dog there. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A2S; c]</itype><trans> for food to be cooked in s.t. </trans>
<eg><i lang=""ceb"">Dì ku makakáug sud-an nga giági ug mantíkà,</i><trans> I can’t eat food that was cooked in fat. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for time to go by. </trans>
<eg><i lang=""ceb"">Nakadaug aku sa swipstik sa miáging simána,</i><trans> I won the sweepstakes last week. </trans></eg>
<eg><i lang=""ceb"">Sa nag-aging mga búlan, nagkaluya pud siya,</i><trans> As the months went by, he became steadily weaker. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> gone through one’s hands, had experience with one. </trans>
<eg><i lang=""ceb"">Pila na ka babáyi ang niági kaníya?</i><trans> How many women have gone through his hands? </trans></eg>
<eg><i lang=""ceb"">Daghan na ang ispisyalista nga miági kaníya,</i><trans> Many specialists have examined her. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> have experienced s.t. </trans>
<eg><i lang=""ceb"">Nakaagi na ku sa pagpamutsatsu,</i><trans> I have already experienced being a servant. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A23]</itype><trans> for a writing instrument to work. </trans>
<eg><i lang=""ceb"">Dì na muági ning bulpína,</i><trans> This ballpoint pen doesn’t write any more. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> path traversed. </trans>
<eg><i lang=""ceb"">Mibálik siya sa íyang ági,</i><trans> He retraced his steps. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> result of the action of some instrument. </trans>
<eg><i lang=""ceb"">Ági sa gabas,</i><trans> The kerf of the saw. </trans></eg>
<eg><i lang=""ceb"">Ági sa lápis,</i><trans> The imprint of the pencil. </trans></eg>
<eg><i lang=""ceb"">Ági sa makina,</i><trans> Stitches of the sewing machine. </trans></eg>
<eg><i lang=""ceb"">Ági sa bunal,</i><trans> Welts made by a whip. </trans></eg>
<eg><i lang=""ceb"">Ági sa dáru,</i><trans> Furrows. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> handwriting. </trans>
</sense>
<sense n=""4""><number>4</number><trans> <tr>output</tr>, work accomplished. </trans>
<eg><i lang=""ceb"">Gamay kaáyu siyag ági kay tapulan,</i><trans> He has little output because he’s lazy. </trans></eg>
</sense>
<sense n=""6""><number>6</number><trans> profits. </trans>
<eg><i lang=""ceb"">Dakù siyag ági sa pagpahulam,</i><trans> He made big profits from his usury. </trans></eg>
</sense>
<sense n=""7""><number>7</number><trans> transient. </trans>
<eg><i lang=""ceb"">Ági lang ang íyang kasukù,</i><trans> His anger will soon pass. </trans></eg>
</sense>
<sense n=""8""><number>8</number> <form id=""axgi_ug_axgi_sa"" lang=""ceb""><abbr expan=""ági"" type=""lemma"">—</abbr> ug, <abbr expan=""ági sa"" type=""lemma"">sa</abbr></form><trans> by way of, as an expression of. </trans>
<eg><i lang=""ceb"">Kining rilu ágig handumánan nátù,</i><trans> This watch is by way of remembrance. </trans></eg>
</sense></hom>
<entry><form id=""agi"" lang=""ceb""><abbr expan=""agi"" type=""lemma"">(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> pass by to pick up or leave s.t. on the way. </trans>
<eg><i lang=""ceb"">Agiun tika unyà,</i><trans> I’ll stop by to pick you up. </trans></eg>
<eg><i lang=""ceb"">Iagi ang karsunsilyu sa ka Pidru,</i><trans> Bring the shorts to Pedro’s on your way. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>leaky</tr>. </trans>
<eg><i lang=""ceb"">Tárung agi,</i><trans> A leaky can. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> become leaky. </trans>
</sense></hom></entry>
<entry><form id=""paaxgi"" lang=""ceb""><abbr expan=""paági"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> cause to go in a certain way. </trans>
<eg><i lang=""ceb"">Unsáun man nátù pagpaági nga dílì mailhan?</i><trans> How will we do it so it won’t be recognized? </trans></eg>
<eg><i lang=""ceb"">Ang íyang gugma gipaági níya sa suwat,</i><trans> He made his love known through letters. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>way</tr>. </trans>
<eg><i lang=""ceb"">Unsay maáyung paági sa paglútug bam-i?</i><trans> What is a good way to prepare noodles? </trans></eg>
</sense></hom></entry>
<entry><form id=""pinaaxgi"" lang=""ceb""><abbr expan=""pinaági"" type=""lemma"">pina-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>means</tr>. </trans>
<eg><i lang=""ceb"">Nabuksan ang kandádu pinaági sa yáwi,</i><trans> The lock was opened by means of a key. </trans></eg>
</sense></hom></entry>
<entry><form id=""pangaxgi"" lang=""ceb""><abbr expan=""pangági"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b4]</itype><trans> for an expectant mother to have her bag of waters break. </trans>
<eg><i lang=""ceb"">Gipangagían na siya piru wà pa magbatì,</i><trans> Her bag of waters has broken, but she is not in labor yet. </trans></eg>
</sense></hom></entry>
<entry><form id=""agiaxnan"" lang=""ceb"">agiánan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>passageway</tr>. </trans>
<eg><i lang=""ceb"">Makalapus ka ngadtu kay náa may agiánan,</i><trans> You can pass <corr sic=""thru"">through</corr> there because there is a passageway. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> a means to an end or accomplishment. </trans>
<eg><i lang=""ceb"">Kanang hulamhúlam ug libru mauy usa ka pasángil, agiánan sa panagsulátay níla,</i><trans> Borrowing each other’s books was a means for them to write each other. </trans></eg>
</sense></hom></entry>
<entry><form id=""alagixan"" lang=""ceb"">alagían</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#agiaxnan""><sc>agiánan</sc></xr>. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> near a place people pass. </trans>
<eg><i lang=""ceb"">Ang ílang balay alagían kanang paingun ta sa lungsud,</i><trans> Their house is right on the way when we go to town. </trans></eg>
</sense></hom></entry>
