INSERT INTO `wced_entry` VALUES (259, "agpas", "14", "<entry page=""14"" id=""259""><form id=""agpas"" lang=""ceb"">agpas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12b2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> go after s.o. to catch up with him. </trans>
<eg><i lang=""ceb"">Agpása, kay wà tu siya kabayad,</i><trans> Go after him. He hasn’t paid. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> meet a seller’s offer. </trans>
<eg><i lang=""ceb"">Dì pud ku muagpas ug baynti ánang sapatúsa,</i><trans> I would not even give you twenty for those shoes. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> catch up in time. </trans>
<eg><i lang=""ceb"">Dì na nákù maagpas ang trabáhu, taudtaud na kung naabsin,</i><trans> I can’t catch up with the work. I’ve been absent too long. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> be after, interested in obtaining s.t. </trans>
<eg><i lang=""ceb"">Kwarta lay íyang giagpas,</i><trans> All she’s after is money. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A12; b5]</itype><trans> </trans>
</sense>
<sense n=""a""><number>a</number><trans> catch a meaning. </trans>
<eg><i lang=""ceb"">Wà siya kaagpas sa lísu,</i><trans> He didn’t catch the joke. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> know the cause or defect. </trans>
<eg><i lang=""ceb"">Wà ku kaagpas unsay dipiktu íning mutúra,</i><trans> I can’t figure out what is wrong with this motorcycle. </trans></eg>
</sense>
<sense n=""6""><number>6</number> <itype>[AN; c]</itype><trans> think of s.t. to say. </trans>
<eg><i lang=""ceb"">Walà nay ikapangagpas (ikaagpas) ang dalága sa pagpamalíbad,</i><trans> The girl could think of no more excuses for refusing him. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> highest price offered in buying s.t. </trans>
<eg><i lang=""ceb"">Pila man giyuy agpas mu?</i><trans> What is the highest price you offer? </trans></eg>
</sense></hom>
<entry><form id=""paagpas"" lang=""ceb""><abbr expan=""paagpas"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> say s.t. additional as an afterthought. </trans>
<eg><i lang=""ceb"">Mipaagpas siyag túgun sa paglakaw nákù,</i><trans> He called after me to ask me to do s.t. for him as I was leaving. </trans></eg>
</sense></hom></entry>
<entry><form id=""pangagpas"" lang=""ceb""><abbr expan=""pangagpas"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> go after s.t. and take advantage of it in time. </trans>
<eg><i lang=""ceb"">Mangagpas ta sa higayun samtang barátu pa,</i><trans> Let’s take advantage of the opportunity while it is still cheap. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> figure s.t. out. </trans>
<eg><i lang=""ceb"">May nangagpas nga láin siyag túyù,</i><trans> S.o. figured out that he had evil intentions. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>interpretation</tr> of a situation. </trans>
</sense>
<sense n=""2""><number>2</number><trans> a second planting to replace seeds that did not do well. </trans>
<eg><i lang=""ceb"">Namatay ang ubang tanum. Pangagpas ning tanúma,</i><trans> Some of the plants died. This planting is to replace them.†
</trans></eg>
</sense></hom></entry></entry>");
