INSERT INTO `wced_entry` VALUES (326, "agwanta", "17", "<entry page=""17"" id=""326""><form id=""agwanta"" lang=""ceb"">agwanta</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>endure</tr>, put up with. </trans>
<eg><i lang=""ceb"">Walay pawntinping muagwanta ánang ímung ginawian,</i><trans> No pen can last the way you are using it. </trans></eg>
<eg><i lang=""ceb"">Dì kung kaagwanta níya,</i><trans> I cannot stand her. </trans></eg>
<eg><i lang=""ceb"">Agwantahun lang nátù ang kagútum,</i><trans> We’ll just endure our hunger. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b5]</itype><trans> put up with. </trans>
<eg><i lang=""ceb"">Bisag bagìbian ang asáwa, agwantahan (agwantahun) ku na lang,</i><trans> My wife is a shrew, but I’ll just put up with her. </trans></eg>
