INSERT INTO `wced_entry` VALUES (338, "ahat", "17", "<entry page=""17"" id=""338""><form id=""ahat"" lang=""ceb"">ahat</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> done before the proper time. </trans>
<eg><i lang=""ceb"">Ahat nga kamatáyun,</i><trans> <tr>Premature</tr> death. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>forced</tr>. </trans>
<eg><i lang=""ceb"">Ahat nga pahiyum,</i><trans> A forced smile. </trans></eg>
<eg><i lang=""ceb"">Ahat nga pagkaminyù,</i><trans> Forced marriage. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A23]</itype><trans> do s.t. suddenly and unexpectedly. </trans>
<eg><i lang=""ceb"">Giunsa man nímu tung bátà nga miahat <corr sic=""mag hílak"">maghílak</corr>?</i><trans> What did you do to the child that it cried suddenly? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B3(1); a12]</itype><trans> </trans>
</sense>
<sense n=""a""><number>a</number><trans> do s.t. before the proper time. </trans>
<eg><i lang=""ceb"">Kinsa may nag-ahat ug pùpù sa mangga?</i><trans> Who picked the mango prematurely? </trans></eg>
<eg><i lang=""ceb"">Naahat siyag pagkabut-an pagkamatay sa íyang amahan,</i><trans> He had to become a grown-up before his time, when his father died. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> do s.t. at an inopportune time. </trans>
<eg><i lang=""ceb"">Nakaahat lang kug katáwa. Nangutut man gud ka!</i><trans> I couldn’t help laughing. You broke wind! </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> be forced into doing s.t. by circumstances. </trans>
<eg><i lang=""ceb"">Miahat kug huwam ug kwarta,</i><trans> I was forced to borrow money. </trans></eg>
</sense></hom>
<entry><form id=""athanay"" lang=""ceb"">athanay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C3]</itype><trans> force each other to do s.t.
</trans>
</sense></hom></entry></entry>");
