INSERT INTO `wced_entry` VALUES (381, "aktu", "19", "<entry page=""19"" id=""381""><form id=""aktu"" lang=""ceb"">aktu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the <tr>act</tr> of doing s.t. </trans>
<eg><i lang=""ceb"">Ang tanang mga aktu sa simbahan pagabayran na,</i><trans> You have to pay for every church ceremony now. </trans></eg>
<eg><i lang=""ceb"">Nasakpan siya sa aktu,</i><trans> He was caught in the act. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> acts in the church. </trans>
<eg><i lang=""ceb"">Aktu sa pagbásul, kuntrisiyun,</i><trans> Act of Contrition. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> the time that s.t. happens. </trans>
<eg><i lang=""ceb"">Sa aksidinti tulu ang namatay sa aktu,</i><trans> In the accident three died on the spot. </trans></eg>
<eg><i lang=""ceb"">Ang táwu nga náa sa aktu sa kamatáyun dílì mamakak,</i><trans> A man does not lie when he is at the point of death. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> acts of a legislative body. </trans>
</sense>
<sense n=""4""><number>4</number><trans> acts of a drama. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[b4(1)]</itype><trans> be caught in doing an act. </trans>
<eg><i lang=""ceb"">Hiaktuhan siyang nangáwat,</i><trans> He was caught in the act of stealing. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> a engage in some action. </trans>
<eg><i lang=""ceb"">Ug muaktu siyag dautan, singgit,</i><trans> If he acts suspiciously, scream. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> show signs of dying. </trans>
<eg><i lang=""ceb"">Ug muaktu na, ipatawag ku,</i><trans> If he shows signs of dying, send for me.
</trans></eg>
</sense></hom></entry>");
