INSERT INTO `wced_entry` VALUES (384, "aku", "19", "<entry page=""19"" id=""384""><form id=""aku"" lang=""ceb"">aku</form>
<hom>
<sense n=""0""><trans> <tr>I, me</tr>. </trans>
<eg><i lang=""ceb"">Aku lang,</i> Let me do it. <ix>Short form:</ix> <form id=""ku"" lang=""ceb"">ku</form><trans>. </trans></eg>
<eg><i lang=""ceb"">Adtu na ku (aku),</i><trans> I’m going now. </trans></eg>
</sense></hom>
<entry><form id=""ay_ku_nixmu"" lang=""ceb"">ay <abbr expan=""ku"" type=""lemma"">—</abbr> nímu</form>
<hom>
<sense n=""0""><trans> expression of helpless frustration at s.o.’s incompetence. </trans>
<eg><i lang=""ceb"">Ay ku nímu, undù. Mag-unsa man lang ka ug wà na ku,</i><trans> My God, son. What will you do when I am not around any more! </trans></eg>
</sense></hom></entry>
<entry><form id=""tig-akuaku"" lang=""ceb"">tig-akuaku</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> always say ‘<ix>aku</ix>’. </trans>
<eg><i lang=""ceb"">Tig-akuaku ka man bisag dílì ka kamau,</i><trans> You don’t know how, but you keep saying ‘lemme’. </trans></eg>
</sense></hom></entry>
<entry><form id=""axkuq"" lang=""ceb"">ákù</form>
<hom>
<sense n=""1""><number>1</number><trans> <ix>preposed gen.:</ix> <tr>me</tr>, <tr>my</tr>. </trans>
<eg><i lang=""ceb"">Ákung anak,</i><trans> My child. </trans></eg>
<eg><i lang=""ceb"">Ákung gibása,</i><trans> I read it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be mine. </trans>
<eg><i lang=""ceb"">Ákù nà,</i><trans> That is mine. </trans></eg>
<eg><i lang=""ceb"">Unsa may ákù niánà?</i><trans> What do I get out of that? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> become mine. </trans>
<eg><i lang=""ceb"">Maákù ka na giyud,</i><trans> At last you will be mine. </trans></eg>
</sense></hom></entry>
<entry><form id=""axkuq_na"" lang=""ceb""><abbr expan=""ákù"" type=""lemma"">—</abbr> na</form>
<hom>
<sense n=""0""><trans> May I have to keep? </trans>
<eg><i lang=""ceb"">Ákù na nang kindi, ha?</i><trans> May I have that candy? </trans></eg>
</sense></hom></entry>
<entry><form id=""Ang_axkuq_gud"" lang=""ceb"">Ang <abbr expan=""ákù"" type=""lemma"">—</abbr> gud</form>
<hom>
<sense n=""1""><number>1</number><trans> what worries me. </trans>
<eg><i lang=""ceb"">Ang ákù gud ug dì siya kaanhi,</i><trans> What worries me is if he can’t come. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> all I am concerned with, interested in. </trans>
<eg><i lang=""ceb"">Ang ákù gud nga makatinir kug pruyba,</i><trans> All I care about is that I can have proof. </trans></eg>
</sense></hom></entry>
<entry><form id=""maakuakuun"" lang=""ceb"">maakuakuun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> tending to want things for oneself. </trans>
</sense></hom></entry>
<entry><form id=""akuxa"" lang=""ceb"">akúa</form>
<hom>
<sense n=""0""><trans> mine as opposed to other things that are not. </trans>
<eg><i lang=""ceb"">Akúa nà,</i><trans> That one (as opposed to the others) is mine. </trans></eg>
</sense></hom></entry>
<entry><form id=""kanaxkuq"" lang=""ceb"">kanákù</form>
<hom>
<sense n=""0""><trans> <ix>dat.:</ix> <tr>me</tr>. </trans>
<eg><i lang=""ceb"">Ihátag kanákù,</i><trans> Give it to me. </trans></eg>
<eg><i lang=""ceb"">Nagtan-aw siya kanákù,</i><trans> He was looking at me. </trans></eg>
</sense></hom></entry>
<entry><form id=""ku"" lang=""ceb"">ku</form>
<hom>
<sense n=""1""><number>1</number> <ix>nom.</ix> (<ix>short for</ix> <form id=""aku"" lang=""ceb"">aku</form><trans>). </trans>
</sense>
<sense n=""2""><number>2</number><trans> <ix>gen.:</ix> = <xr lang=""ceb"" target=""#naxkuq""><sc>nákù</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""naxkuq"" lang=""ceb"">nákù</form>
<hom>
<sense n=""1""><number>1</number><trans> <ix>gen.:</ix> <tr>my</tr>, by me. </trans>
<eg><i lang=""ceb"">Anak nákù,</i><trans> My son. </trans></eg>
<eg><i lang=""ceb"">Gibása nákù,</i><trans> I read it. </trans></eg>
</sense></hom></entry>
<entry><form id=""naxkuq_ug"" lang=""ceb""><abbr expan=""nákù"" type=""lemma"">—</abbr> ug</form>
<hom>
<sense n=""0""> (<ix>short for</ix> <form id=""gipakaingun_naxkuq"" lang=""ceb"">gipakaingun nákù</form><trans>) I thought. </trans>
<eg><i lang=""ceb"">Nákug muadtu ka,</i><trans> I thought you would go. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> short for <xr lang=""ceb"" target=""#kanaxkuq""><sc>kanákù</sc></xr>.
</trans>
</sense></hom></entry></entry>");
