INSERT INTO `wced_entry` VALUES (385, "aku", "19", "<entry page=""19"" id=""385""><form id=""axku"" lang=""ceb"">áku</form>
<hom>
<sense n=""0""><trans> (from <ix>aku</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> stand to do s.t. </trans>
<eg><i lang=""ceb"">Dì ku kaákug tan-aw nímu,</i><trans> I cannot stand to look at you. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#pangaxku""><sc><abbr expan=""pangáku"" type=""lemma"">paN-</abbr></sc></xr>. </trans>
</sense></hom>
<entry><form id=""pangaxku"" lang=""ceb""><abbr expan=""pangáku"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2]</itype><trans> have nerve to do s.t. </trans>
<eg><i lang=""ceb"">Walà giyud ku makapangáku (makaáku) sa pagbuyag kang Maríya,</i><trans> I couldn’t gather the nerve to admonish Maria. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b5]</itype><trans> do s.t. on one’s own responsibility. </trans>
<eg><i lang=""ceb"">Dílì ku mangáku sa pagpaandar sa makina,</i><trans> I will not take it on myself to start the engine. </trans></eg>
<eg><i lang=""ceb"">Ngánung gipangakúhan (gipangáku) man nímu <corr sic=""nag istrungkar"">nag-istrungkar</corr>?</i><trans> Why did you take it on yourself to take that apart? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> particular <tr>responsibility</tr> or <tr>task</tr>. </trans>
<eg><i lang=""ceb"">Dakù kaáyung pangáku sa lungsud ang pagtúkud sa simbahan,</i><trans> It was a great responsibility which the town undertook to build the church. </trans></eg>
</sense></hom></entry>
<entry><form id=""kaakuxhan_kapangakuxhan"" lang=""ceb"">kaakúhan, kapangakúhan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>responsibility</tr>. </trans>
<eg><i lang=""ceb"">Kaakúhan (kapangakúhan) sa usa ka amahan,</i><trans> A father’s responsibility. </trans></eg>
</sense></hom></entry>
<entry><form id=""akuakuhan_maakuakuhan_manggiakuakuhan"" lang=""ceb"">akuakuhan, maakuakuhan, manggiakuakuhan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> tending to take things on oneself one should not. </trans>
<eg><i lang=""ceb"">Akuakuhan kaáyu siya manlísù sa twirka,</i><trans> He likes to take it on himself to mess around with the screws. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> get to be so that one takes on things one should not.
</trans>
</sense></hom></entry></entry>");
