INSERT INTO `wced_entry` VALUES (386, "akub", "19", "<entry page=""19"" id=""386""><form id=""akub"" lang=""ceb"">akub</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC; ac]</itype><trans> fit s.t. over s.t. else face to face so that the edges meet, or the edge of the cover overlaps the edges of the thing covered. </trans>
<eg><i lang=""ceb"">Kinsa may nag-akub sa nígu sa tabig?</i><trans> Who covered the clothes basket with a winnowing tray? </trans></eg>
<eg><i lang=""ceb"">Ang duha ka bagaw sa imbaw nag-ákub,</i><trans> The two shells of the clam fit together precisely. </trans></eg>
<eg><i lang=""ceb"">Akúba ang duha <pb n=""20""/>ka papil,</i><trans> Lay the two papers face to face with the edges even. </trans></eg>
<eg><i lang=""ceb"">Akbi ang pawntinpin,</i><trans> Put the top on the fountain pen. </trans></eg>
</sense></hom>
<entry><form id=""axkub"" lang=""ceb""><abbr expan=""ákub"" type=""lemma"">(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> things that fit against each other with the outer edges matching. </trans>
<eg><i lang=""ceb"">Duha ka ákub ang ílang kík,</i><trans> Their cake has two layers.
</trans></eg>
</sense></hom></entry></entry>");
