INSERT INTO `wced_entry` VALUES (411, "alagad", "20", "<entry page=""20"" id=""411""><form id=""alagad"" lang=""ceb"">alagad</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> wait for s.o. to do s.t. </trans>
<eg><i lang=""ceb"">Muagad lang ku sa inyung hukum,</i><trans> I am guided by your decision. </trans></eg>
<eg><i lang=""ceb"">Panahun ray ákung <pb n=""21""/>agdun,</i><trans> I will let time decide. </trans></eg>
</sense></hom>
<entry><form id=""ulualaxgad_agad-axgad"" lang=""ceb"">ulualágad, agad-ágad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; c1]</itype><trans> put off doing s.t. temporarily until s.t. else happens. </trans>
<eg><i lang=""ceb"">Mag-agad-ágad ku sa pag-abut ni Tátay úsà ku mulakaw,</i><trans> I am waiting for Dad to get here before I go. </trans></eg>
<eg><i lang=""ceb"">Iagad-ágad (agad-agára) lang úsà ang báyad,</i><trans> Put the payment off awhile. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a12]</itype><trans> put off doing s.t. to wait for s.o. </trans>
<eg><i lang=""ceb"">Agad-agára ku kadiyut arun magkúyug ta,</i><trans> Wait a second for me, so we can go together.
</trans></eg>
</sense></hom></entry></entry>");
