INSERT INTO `wced_entry` VALUES (412, "alagad", "21", "<entry page=""21"" id=""412""><form id=""alaxgad"" lang=""ceb"">alágad</form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number> <tr>servant</tr>, <tr>employee</tr>. <form id=""alaxgad_sa_balaxud"" lang=""ceb""><abbr expan=""alágad"" type=""lemma"">—</abbr> sa baláud</form><trans> <tr>law officer</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>service</tr> rendered. </trans>
<eg><i lang=""ceb"">Mapasalamátun kami sa alágad sa Krus nga Pula,</i><trans> We are grateful for the services of the Red Cross. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> serve, be a servant or employee. </trans>
<eg><i lang=""ceb"">Dílì siya layhang mualágad sa pamilya nga daghag kasíra,</i><trans> She doesn’t like to serve in a household with lots of boarders. </trans></eg>
<eg><i lang=""ceb"">Nag-alágad siya sa gubyirnu,</i><trans> He works for the government. </trans></eg>
<eg><i lang=""ceb"">Dúgay ku níyang gialagáran, ningbíyà na lang ku sa tindáhan,</i><trans> It took her a long time to wait on me, so I just left the store. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> attend to, care for. </trans>
<eg><i lang=""ceb"">Aku ang mualágad sa bátà samtang túa pa sa huspital ang inahan,</i><trans> I will take care of the child while the mother is in the hospital. </trans></eg>
</sense></hom>
<entry><form id=""kaalagaxran"" lang=""ceb"">kaalagáran</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>duty</tr>. </trans>
</sense></hom></entry>
<entry><form id=""maalagaxrun"" lang=""ceb"">maalagárun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> serving conscientiously. </trans>
<eg><i lang=""ceb"">Kanímu maalagárun,</i><trans> Your faithful servant. </trans></eg>
</sense></hom></entry>
<entry><form id=""alagdun"" lang=""ceb"">alagdun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> requiring intensive care. </trans>
<eg><i lang=""ceb"">Alagdung masakitun,</i><trans> Patients who require intensive care.
</trans></eg>
</sense></hom></entry></entry>");
