INSERT INTO `wced_entry` VALUES (442, "alangaang", "22", "<entry page=""22"" id=""442""><form id=""alangaxang"" lang=""ceb"">alangáang</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> for weather to be oppressively <tr>hot</tr> and moist with no wind. </trans>
<eg><i lang=""ceb"">Alangáang kaáyu; tingáli muulan,</i><trans> It is very hot and muggy; maybe it’s going to rain. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2S]</itype><trans> be <tr>muggy</tr>. </trans>
</sense>
