<eg><i lang=""ceb"">Mualangáang (maalangáang) ang ímung kamut ug makahikap kag dugà sa síli,</i><trans> Your fingers will hurt if you let hot pepper juice get on them.
</trans></eg>
</sense></hom></entry>");
