INSERT INTO `wced_entry` VALUES (443, "alang-alang", "22", "<entry page=""22"" id=""443""><form id=""alang-axlang"" lang=""ceb"">alang-álang</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> not quite time, unseasonable. </trans>
<eg><i lang=""ceb"">Ang-ā́ng na run igikan. Dì na ka kaabut,</i><trans> It’s no use going now. You’ll never make it. </trans></eg>
<eg><i lang=""ceb"">Ang-ā́ng iadtu run kay sayu pa,</i><trans> No use going so early. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> not quite the right amount. </trans>
<eg><i lang=""ceb"">Alang-álang pa ning kwartang ilukat sa prinda,</i><trans> This money is insufficient to pay off the mortgage. </trans></eg>
<eg><i lang=""ceb"">Ang-ā́ng ning panaptúna pára karsúnis,</i><trans> This is not enough cloth for a pair of pants. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> not up to a certain level. </trans>
<eg><i lang=""ceb"">Ang-ā́ng pagkapanday,</i><trans> It was poorly done. </trans></eg>
<eg><i lang=""ceb"">Sumbágun ta untà ka, apan ang-ā́ng ka ra nákù,</i><trans> I would love to fight you, but you’re too small for me. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <tr>somewhat</tr>, but not quite. </trans>
<eg><i lang=""ceb"">Ang lamì alang-álang nangkà, alang-álang pinya,</i><trans> The taste is somewhat like jackfruit, somewhat like pineapple. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> it would be silly if, it would be the wrong thing to do if. </trans>
<eg><i lang=""ceb"">Ang-ā́ng dílì dawátun. Gihátag man,</i><trans> It would be silly not to accept it. It was given to you, wasn’t it? </trans></eg>
<eg><i lang=""ceb"">Ang-ā́ng akuy manghúgas nga náa may masúgù,</i><trans> Why should I do the dishes when there’s s.o. I can tell to do them. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> of course. </trans>
<eg><i lang=""ceb"">‘Malígù ka?’—‘Ang-ā́ng. Mau bitaw nay átung gianhi,’</i><trans> ‘Are you going to swim?’—‘Of course, that’s what we came here for, isn’t it?’ </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b5c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> do s.t. poorly, halfway. </trans>
<eg><i lang=""ceb"">Ug alang-alángun (alang-alángan, ialang-álang) nà nímug búhat, ay na lang,</i><trans> If you’re going to do a poor job, never mind. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> do s.t. at an inopportune time. </trans>
<eg><i lang=""ceb"">Dílì pa ku run mualang-álang ug minyù nga walà kuy salapì,</i><trans> I’m not going to go and get married at this time when I don’t have any money. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B256N; b4(1)]</itype><trans> arrive a little too late or early for s.t. </trans>
<eg><i lang=""ceb"">Mangang-ā́ng kug larga,</i><trans> I’ll leave a bit ahead. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[b4]</itype><trans> lacking s.t. </trans>
<eg><i lang=""ceb"">Naang-ángan ku sa kwarta,</i><trans> I am short of money. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[ab2]</itype><trans> be put in a difficult situation by s.t. inopportune. </trans>
<eg><i lang=""ceb"">Ímu kung alang-alángug pangutána nga náa may láing namátì,</i><trans> You put me in a difficult situation asking that question when s.o. else is listening. </trans></eg>
</sense>
<sense n=""6""><number>6</number> <itype>[A23]</itype><trans> have hesitations about doing s.t. </trans>
<eg><i lang=""ceb"">Dílì giyud aku mualang-álang nímug pangutánag dílì pa tinúud,</i><trans> I wouldn’t have reservations about asking you if it weren’t true. </trans></eg>
</sense>
<sense n=""7""><number>7</number> <itype>[b6]</itype><trans> consider s.t. <ix>alang-álang.</ix> </trans>
<eg><i lang=""ceb"">Giang-ā́ngan aku sa íyang hitsúra,</i><trans> I consider his looks not up to par. </trans></eg>
<eg><i lang=""ceb"">Giang-ā́ngan akug hangyù níya,</i><trans> It’s a bad time for me to ask him. </trans></eg>
</sense></hom>
<entry><form id=""alang-alang"" lang=""ceb""><abbr expan=""alang-alang"" type=""lemma"">(→)</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#alang-axlang""><sc>alang-álang</sc></xr>, <ix>v</ix>, <ix>a3.</ix> </trans>
</sense></hom></entry>
<entry><form id=""pangalang-axlang"" lang=""ceb""><abbr expan=""pangalang-álang"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c6]</itype><trans> eat a single heavy meal in between mealtimes to make one do for two. </trans>
<eg><i lang=""ceb"">Mangalang-álang lang ta kay kúlang tag bugas,</i><trans> Let’s eat two meals in one because we don’t have enough rice. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> single <pb n=""23""/>meal eaten in place of two.
</trans>
</sense></hom></entry></entry>");
