<sense n=""0""> <itype>[A; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>watch</tr> s.o. from hiding unobserved. </trans>
<eg><i lang=""ceb"">Iring nga nag-alaw sa pisù,</i><trans> The cat that is stalking the chick. </trans></eg>
<eg><i lang=""ceb"">Alawa ag bátà ug unsay buhátun,</i><trans> Spy on the child and see what he does. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>watch</tr> for, <tr>wait</tr> for. </trans>
<eg><i lang=""ceb"">Pag-alaw didtu ug taksi,</i><trans> Watch for a taxi. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A3; a12]</itype><trans> be after s.t. with a hidden motive. </trans>
<eg><i lang=""ceb"">Ang íyang kadátù ray alawun sa mangulitáwu,</i><trans> Her suitors are only after her wealth. </trans></eg>
</sense></hom>
<entry><form id=""alaw-axlaw"" lang=""ceb"">alaw-álaw</form>
