INSERT INTO `wced_entry` VALUES (473, "alayun", "24", "<entry page=""24"" id=""473""><form id=""alaxyun"" lang=""ceb"">aláyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> group of people who work together on jobs on a more or less permanent basis. The person for whom the job is done has an obligation to repay each worker with an equal amount of time. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2C; b5c4]</itype><trans> work on the <ix>aláyun</ix> basis. </trans>
<eg><i lang=""ceb"">Alayúnun (alayúnan) nátù ang pagpananggì,</i><trans> We’ll harvest on the mutual help basis. </trans></eg>
<eg><i lang=""ceb"">Alayúnan tika karun, ug impas na,</i><trans> I’ll work for you now, and we’re all square. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3; b6(1)]</itype><trans> do s.t. as a favor. </trans>
<eg><i lang=""ceb"">Nag-aláyun siya nákug hatud ngadtu,</i><trans> He did me the favor of taking me there. </trans></eg>
<eg><i lang=""ceb"">Alayúni siyag panghúgas,</i><trans> Do him the favor of helping him wash the dishes. </trans></eg>
<eg><i lang=""ceb"">Ialáyun kug kúhag túbig,</i><trans> Please get me some water. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> <tr>please</tr>. </trans>
<eg><i lang=""ceb"">Aláyun, ambi ra nang libru,</i><trans> Please, give me that book. </trans></eg>
</sense></hom>
<entry><form id=""kaalaxyun"" lang=""ceb""><abbr expan=""kaaláyun"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one with whom one has an <ix>aláyun</ix> arrangement. </trans>
</sense></hom></entry>
<entry><form id=""alaxyunan"" lang=""ceb""><abbr expan=""aláyunan"" type=""lemma"">-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> work obligation one has.
</trans>
</sense></hom></entry></entry>");
