INSERT INTO `wced_entry` VALUES (502, "alig-ig", "25", "<entry page=""25"" id=""502""><form id=""alig-ig"" lang=""ceb"">alig-ig</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>separate</tr> coarse and fine grains by <tr>shaking</tr> them on a tray. A jerking motion is made in one direction so that the heavier grains collect at one end of the tray. </trans>
<eg><i lang=""ceb"">Alig-íga ang ginaling,</i><trans> Shake out the ground corn. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>rock</tr> vigorously from side to side. </trans>
<eg><i lang=""ceb"">Makusug nga línug nga mialig-ig sa Manílà,</i><trans> A strong earthquake that rocked Manila. </trans></eg>
<eg><i lang=""ceb"">Pastilan níyang nakaalig-ig sa samput dihang hápit na,</i><trans> My, how she moved her buttocks from side to side when she was about to come. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>shake</tr> up personnel. </trans>
<eg><i lang=""ceb"">Kinsay gialig-ig ni Markus?</i><trans> Who did Marcos dismiss (from his cabinet)? </trans></eg>
</sense></hom>
<entry><form id=""inalig-ixgay"" lang=""ceb""><abbr expan=""inalig-ígay"" type=""lemma"">-in-ay</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>shake-up</tr> of personnel. </trans>
<eg><i lang=""ceb"">Human sa iliksiyun, dakù giyung inalig-ígay,</i><trans> After the election, there will be a big shake-up. </trans></eg>
</sense></hom></entry>
<entry><form id=""alig-igun_alig-igunun"" lang=""ceb""><abbr expan=""alig-igun"" type=""lemma"">-un(→)</abbr>, <abbr expan=""alig-igunun"" type=""lemma"">-unun</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> ground cereal to be winnowed.
