<sense n=""1""><number>1</number><trans> state of <tr>semiconsciousness</tr> just before falling asleep or awakening. </trans>
<eg><i lang=""ceb"">Ang íyang gisulti búnga lang sa íyang alimúkaw,</i><trans> What he said was the product of his semiconsciousness. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> action of the sort performed by fully conscious persons performed in one’s sleep. </trans>
<eg><i lang=""ceb"">Wà ka nákù tuyúag igù. Alimúkaw lang kadtu,</i><trans> I didn’t mean to strike you. I did it in my sleep. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b4]</itype><trans> do s.t. in one’s sleep of the sort one normally does awake. </trans>
<eg><i lang=""ceb"">Nanáug siya tungang gabíi. Gialimukáwan diay,</i><trans> He went downstairs in the middle of his sleep.
</trans></eg>
</sense></hom></entry>");
