INSERT INTO `wced_entry` VALUES (546, "alimungawung", "26", "<entry page=""26"" id=""546""><form id=""alimungaxwung"" lang=""ceb"">alimungáwung</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. faintly <tr>similar</tr> to s.t. else in appearance. </trans>
<eg><i lang=""ceb"">Alimungáwung ang hitsúra sa plurdilis sa ahítu,</i><trans> The zinnia is faintly like a marigold in appearance. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[BC13; b6]</itype><trans> come to resemble faintly. </trans>
<eg><i lang=""ceb"">Mialimungáwung (naalimungáwung) ang bátang sinagup kaníla,</i><trans> The adopted child came to look like them. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; b8]</itype><trans> faintly discern a resemblance. </trans>
<eg><i lang=""ceb"">Nakaalimungáwung ku nímu kay may-ungmay-ung ka sa ímung igsúun,</i><trans> I recognized you because you look like your brother. </trans></eg>
<eg><i lang=""ceb"">Hing-alimungawúngan siya sa bantay <pb n=""27""/>nga mauy nangáwat sa kwarta,</i><trans> The guard faintly recognized him as the one who stole the money.
</trans></eg>
</sense></hom></entry>");
