INSERT INTO `wced_entry` VALUES (548, "alimuut", "27", "<entry page=""27"" id=""548""><form id=""alimuxut"" lang=""ceb"">alimúut</form>
<hom>
<sense n=""0""><trans> (from <ix>púut</ix>) </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> confining, <tr>oppressive</tr> so as to make people feel uncomfortably hot. </trans>
<eg><i lang=""ceb"">Alimúut nang naylung isul-ub,</i><trans> Nylon is <tr>oppressively hot</tr> to wear. </trans></eg>
<eg><i lang=""ceb"">Alimúut sa Magalyánis, way hángin,</i><trans> It’s oppressively hot downtown. There’s no wind. </trans></eg>
</sense></hom>
<entry><form id=""alimuxut_ug_nawung"" lang=""ceb""><abbr expan=""alimúut"" type=""lemma"">—</abbr> ug nawung</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>sour-faced</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> be so ugly as not to have one redeeming feature in one’s face. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b3]</itype><trans> be oppressively warm. </trans>
<eg><i lang=""ceb"">Mualimúut (maalimúut) ang kwartu ug mahápun,</i><trans> It gets hot (might get hot) in the room in the afternoon. </trans></eg>
<eg><i lang=""ceb"">Gialimuútan (gialimut-an) ka?</i><trans> Do you feel hot?
</trans></eg>
</sense></hom></entry></entry>");
