INSERT INTO `wced_entry` VALUES (575, "alinupung", "28", "<entry page=""28"" id=""575""><form id=""alinupung"" lang=""ceb"">alinupung</form>
<hom>
<sense n=""0""><trans> (from <ix>túpung</ix>) </trans>
