INSERT INTO `wced_entry` VALUES (577, "alipadsay", "28", "<entry page=""28"" id=""577""><form id=""alipadsay"" lang=""ceb"">alipadsay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for good-sized things <tr>to be scattered</tr>. </trans>
<eg><i lang=""ceb"">Ang ímung mga butang nagkaalipadsay lang sa kwartu,</i><trans> Your things are scattered all over the room. </trans></eg>
<eg><i lang=""ceb"">Alipadsáyun (ialipadsay) ang mga papílis sa hángin,</i><trans> The papers will be scattered by the wind. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for s.t. to be consumed rapidly as if scattered. </trans>
<eg><i lang=""ceb"">Kadalì rang mualipadsay ang kwarta karun,</i><trans> How quickly money vanishes these days. </trans></eg>
<eg><i lang=""ceb"">Gialipadsay lag kausa ang mga pagkáung giaray sa lamísa,</i><trans> The food that was heaped on the table vanished in one fell swoop.
