<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB3(1); c]</itype><trans> <tr>gather</tr> around s.t. </trans>
<eg><i lang=""ceb"">Nag-alírung ang mga táwu sa sugálan,</i><trans> The people stood around the gambling table. </trans></eg>
<eg><i lang=""ceb"">Nag-alírung siya sa silya sa lamísa,</i><trans> He put the chairs around the table. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
