INSERT INTO `wced_entry` VALUES (597, "alisngaw", "29", "<entry page=""29"" id=""597""><form id=""alisngaw"" lang=""ceb"">alisngaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>evaporate</tr>, give off steam. </trans>
<eg><i lang=""ceb"">Mualisngaw ang alkuhul,</i><trans> The alcohol will evaporate. </trans></eg>
<eg><i lang=""ceb"">Ínit pa diay ang túbig kay nag-alisngaw man,</i><trans> The water is still hot, then, because it’s giving off steam. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for anger to vent itself. </trans>
<eg><i lang=""ceb"">Mualisngaw na ning ákung kasukù,</i><trans> I’m going to blow up in a minute. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> steam or evaporation given off. </trans>
</sense></hom>
<entry><form id=""pangalisngaw"" lang=""ceb""><abbr expan=""pangalisngaw"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> give off a smell. </trans>
<eg><i lang=""ceb"">Nangalisngaw ang tanglad,</i><trans> The lemon grass gave off a pleasant smell. </trans></eg>
</sense></hom></entry>
<entry><form id=""inalisngaw"" lang=""ceb""><abbr expan=""inalisngaw"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> thing given off as steam or evaporation. </trans>
</sense>
<sense n=""2""><number>2</number><trans> shadow, small portion of a character trait which is exuded. </trans>
<eg><i lang=""ceb"">Ug daghan may natuntu níya, inalisngaw lang tu sa íyang kamaldítu,</i><trans> He cheated lots of people, but that was just a fraction of his mischief. </trans></eg>
<eg><i lang=""ceb"">Kadtung kasábà inalisngaw lang tu sa ákung kasukù,</i><trans> The scolding was just a faint shadow of what I really felt.
</trans></eg>
</sense></hom></entry></entry>");
