INSERT INTO `wced_entry` VALUES (598, "alistu", "29", "<entry page=""29"" id=""598""><form id=""alistu"" lang=""ceb"">alistu</form>
<hom role=""a""><pos>a</pos>
<sense n=""1a""><number>1a</number><trans> <tr>energetic</tr>. </trans>
<eg><i lang=""ceb"">Alistu siyang mutrabáhu,</i><trans> He works energetically. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> <tr>agile</tr>. </trans>
<eg><i lang=""ceb"">Alistu siyang milikay,</i><trans> He dodged agily. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>shrewd</tr>, <tr>clever</tr>. </trans>
<eg><i lang=""ceb"">Alistu siyang musabut,</i><trans> He understands things readily. </trans></eg>
<eg><i lang=""ceb"">Alistu, apuntin, puygu<corr sic="","">!</corr></i><trans> <tr>Ready</tr>, aim, fire! </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> do s.t. well. </trans>
<eg><i lang=""ceb"">Alistu siyang mulútù,</i><trans> She cooks well. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2]</itype><trans> be energetic, agile. </trans>
<eg><i lang=""ceb"">Mualistu (maalistu) ka man lang ug makakità ug kwarta,</i><trans> You only move if you see money. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1]</itype><trans> be clever, smart. </trans>
<eg><i lang=""ceb"">Ug makig-úban ka sa mga abtik maalistu ka giyud,</i><trans> If you go around with shrewd people, you’ll become shrewd, too. </trans></eg>
<eg><i lang=""ceb"">Alistu ka lang kay itug-an tikang Pápa,</i><trans> Better watch out because I’ll tell Father on you. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b4(1)]</itype><trans> be outsmarted. </trans>
<eg><i lang=""ceb"">Naglágut ku kay naalistuhan kung Husi,</i><trans> I’m mad because Jose put one over on me.
</trans></eg>
</sense></hom></entry>");
