INSERT INTO `wced_entry` VALUES (610, "alkansi", "29", "<entry page=""29"" id=""610""><form id=""alkansi"" lang=""ceb"">alkansi</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>losing</tr>, without gain or advantage. </trans>
<eg><i lang=""ceb"">Alkansi kaáyu kug singkwintay ibáyad mu,</i><trans> I lose a lot if you pay fifty. </trans></eg>
<eg><i lang=""ceb"">Alkansi aku niya sa pagkáun,</i><trans> I lose on his food. </trans></eg>
<eg><i lang=""ceb"">Alkansi aku níya sa báhin,</i><trans> I lose out the way it is divided. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>loss</tr>. </trans>
<eg><i lang=""ceb"">Dakù silag alkansi sa ílang nigusyu,</i><trans> They incurred a big loss in their business. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>lacking</tr> in amount. </trans>
<eg><i lang=""ceb"">Dus mitrus alkansi sa sukud pára sa usa ka páris karsúnis,</i><trans> Two meters is not enough material for a pair of pants. </trans></eg>
<eg><i lang=""ceb"">Alkansi ning ímung gihátag sa pagpangumpra,</i><trans> You haven’t given me enough shopping money. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> incur a loss. </trans>
<eg><i lang=""ceb"">Alkansíhan aku nímug diyútay,</i><trans> You will take a small loss on me. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> cause to take a loss. </trans>
<eg><i lang=""ceb"">Alkansíhun aku nímug singkwinta <pb n=""30""/>ray ímung ihátag,</i><trans> You will make me take a loss if you only give me fifty pesos. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AP; a]</itype><trans> cause to get insufficient return from an investment. </trans>
<eg><i lang=""ceb"">Ug siyay ímung suluguun, mag-alkansi lang siya sa káun,</i><trans> If he is your servant, you lose out on his food. </trans></eg>
</sense></hom>
<entry><form id=""alkansi_sa_lutaw"" lang=""ceb""><abbr expan=""alkansi"" type=""lemma"">—</abbr> sa lutaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[APB]</itype><trans> cause to have a small amount of freeboard, have less freeboard. </trans>
<eg><i lang=""ceb"">Ang karga mualkansi sa lutaw sa sakayan,</i><trans> The cargo lessens the amount of freeboard which the boat has.
</trans></eg>
</sense></hom></entry></entry>");
