INSERT INTO `wced_entry` VALUES (667, "alum-um", "32", "<entry page=""32"" id=""667""><form id=""alum-um"" lang=""ceb"">alum-um</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for the sky to be <tr>overcast</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B]</itype><trans> become overcast. </trans>
<eg><i lang=""ceb"">Mialum-um ang búwan,</i><trans> The moon became covered with a thin veil of clouds. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b7c1]</itype><trans> dim s.t. </trans>
<eg><i lang=""ceb"">Alum-úmi (alum-uma, ialum-um) ang síga sa pulawan,</i><trans> Turn the night lamp down. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b]</itype><trans> be surpassed, put into the shadow by s.t. better. </trans>
<eg><i lang=""ceb"">Gwápa siya apan naalum-uman siya ni Tidang,</i><trans> She is beautiful, but she is overshadowed by Tidang.
