INSERT INTO `wced_entry` VALUES (704, "amakan", "33", "<entry page=""33"" id=""704""><form id=""amaxkan"" lang=""ceb"">amákan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>bamboo matting</tr> woven with a k.o. twill weave, commonly used for walling. The weft is passed over two and under two warp pieces. The successive weft is passed over two and under two warp pieces again, but such that the second weft passes over one and under one of the warp pieces that the first weft had passed over, and over one and under one of the warp pieces that the first weft had passed under. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> weave <ix>amákan.</ix> </trans>
</sense></hom>
