INSERT INTO `wced_entry` VALUES (743, "ambi", "34", "<entry page=""34"" id=""743""><form id=""ambi"" lang=""ceb"">ambi</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>give</tr> it to me. </trans>
<eg><i lang=""ceb"">Ambi ra gud ang butilya,</i><trans> Let me have the bottle. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> particle used in making a request or asking permission. </trans>
<eg><i lang=""ceb"">Ambi, tugtúga kunu tung ‘Sa Kabukíran’,</i><trans> Here, play ‘In the Mountains’. </trans></eg>
<eg><i lang=""ceb"">Ambi, pasimhúta kunu ta,</i><trans> Here, let me take a whiff. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> here, let’s give it a try. </trans>
<eg><i lang=""ceb"">Ambi, átung basáhun áring pahináha. Día tingáli,</i><trans> Here, let me take a look at this page. It’s probably here. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> particle expressing a concession for the sake of argument. </trans>
<eg><i lang=""ceb"">Ambi, ug walà pa ka dinhi, dì tà ka hikit-an,</i><trans> All right, if you were not here, nobody could have seen you, right?
</trans></eg>
</sense></hom></entry>");
