INSERT INTO `wced_entry` VALUES (745, "ambihas, ambihas", "34", "<entry page=""34"" id=""745""><form id=""ambihas_ambixhas"" lang=""ceb"">ambihas, ambíhas</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> two things <tr>parallel</tr> or <tr>face to face</tr> but one slightly behind or to the side. </trans>
<eg><i lang=""ceb"">Ambíhas ang duha ka gawang,</i><trans> The two doors are opposite but not face to face. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B56; a12]</itype><trans> for things to be parallel but not face to face or in line. </trans>
<eg><i lang=""ceb"">Ug muambíhas ang paglátid muhíwì ang bungbung,</i><trans> If the measurements are out of line, <pb n=""35""/>the wall will turn out crooked. </trans></eg>
<eg><i lang=""ceb"">Ambihása pagbutang ang duha ka silya arun makakità ang maglingkud sa luyu,</i><trans> Stagger the two chairs so that whoever is at the back can see. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C]</itype><trans> pass each other while travelling in opposite directions along the parallel routes. </trans>
<eg><i lang=""ceb"">Ang duha ka trín nagkaambíhas,</i><trans> The two trains passed each other.
