INSERT INTO `wced_entry` VALUES (752, "ambug", "35", "<entry page=""35"" id=""752""><form id=""ambug"" lang=""ceb"">ambug</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[<sic>Ab2</sic>; ac]</itype><trans> go, bring down from the mountains to the lowlands. </trans>
<eg><i lang=""ceb"">Unsay ímung ambúgun?</i><trans> What are you going down to get? </trans></eg>
<eg><i lang=""ceb"">Iambug ning kamúti arun ibaligyà,</i><trans> Bring these sweet potatoes down to sell them. </trans></eg>
