<sense n=""2""><number>2</number> <itype>[A13]</itype><trans> looking over. </trans>
<eg><i lang=""ceb"">Ang káhuy nag-ambug sa ngilit sa pangpang,</i><trans> The tree is overlooking the edge of the cliff. </trans></eg>
