INSERT INTO `wced_entry` VALUES (757, "ambus", "35", "<entry page=""35"" id=""757""><form id=""ambus"" lang=""ceb"">ambus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN; b(1)]</itype><trans> <tr>ambush</tr>, <tr>waylay</tr>. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A2]</itype><trans> go meet a girl at her place of work or study to accompany her home. </trans>
<eg><i lang=""ceb"">Nía na pud si Pidru nangambus sa íyang giulitawhan,</i><trans> Here comes Pedro to meet his girl friend and take her home. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> join a group with food or other provisions to avail oneself of them (colloquial). </trans>
<eg><i lang=""ceb"">Nangambus lang ku sa ílang bálun,</i><trans> I just joined them and got some of their picnic food. </trans></eg>
<eg><i lang=""ceb"">Makaambus ku sa ímung hábul?</i><trans> Can I use part of your blanket?
</trans></eg>
</sense></hom></entry>");
