INSERT INTO `wced_entry` VALUES (759, "ambuy1", "35", "<entry page=""35"" id=""759""><form id=""ambuy"" lang=""ceb"">ambuy<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a nickname of Pablo. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> a <tr>slow-witted</tr> person. </trans>
<eg><i lang=""ceb"">Ambuy ka man diay, ngánung ímu nang gikaun?</i><trans> What did you eat that for, you fool? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>penniless</tr>. </trans>
<eg><i lang=""ceb"">Ayaw nà sugta, ambuy nà,</i><trans> Don’t marry him. He doesn’t have a penny. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB; a]</itype><trans> be, become slow-witted, make a fool of s.o. </trans>
<eg><i lang=""ceb"">Ang gugma mauy nakaambuy (nakapaambuy) sa ákung anak,</i><trans> Love has dulled my son’s wits. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B12; a1]</itype><trans> be short of cash, penniless.
</trans>
</sense></hom></entry>");
