INSERT INTO `wced_entry` VALUES (761, "amgid", "35", "<entry page=""35"" id=""761""><form id=""amgid"" lang=""ceb"">amgid</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>similar</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[BC; ac1c3]</itype><trans> be similar. <pb n=""36""/></trans>
<eg><i lang=""ceb"">Miamgid (naamgid) ang istatuwa sa mudílu,</i><trans> The statue grew to be more and more like the model. </trans></eg>
<eg><i lang=""ceb"">Ngánung nagkaamgid ang inyung tubag?</i><trans> Why were your answers similar? </trans></eg>
<eg><i lang=""ceb"">Iamgid (amgíra) lang ang ímung sinulat sa ákù,</i><trans> Make your composition like mine. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b]</itype><trans> <tr>imitate</tr>. </trans>
<eg><i lang=""ceb"">Ang mga Insik maáyung muamgid sa mga búhat sa Hapun,</i><trans> The Chinese imitate the Japanese products well. </trans></eg>
<eg><i lang=""ceb"">Giamgiran (giamgíran) sa arkitiktu ang dibúhu sa katidral,</i><trans> The architect imitated the sketch of the cathedral. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; ac]</itype><trans> <tr>compare</tr>. </trans>
<eg><i lang=""ceb"">Amgíra sila kung háin ang maanyag,</i><trans> Compare them to judge which one is most beautiful. </trans></eg>
<eg><i lang=""ceb"">Ang íyang kaanyag ikaamgid sa bitúun,</i><trans> Her beauty can be compared to the stars. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one’s double. </trans>
<eg><i lang=""ceb"">Ákung kalúha nang ákung amgid,</i><trans> The fellow that looks just like me is my twin brother. </trans></eg>
</sense></hom>
<entry><form id=""ig-amgid_kaamgid"" lang=""ceb""><abbr expan=""ig-amgid"" type=""lemma"">ig-</abbr>, <abbr expan=""kaamgid"" type=""lemma"">ka-</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#amgid""><sc>amgid</sc></xr>, <ix>n</ix>.
</trans>
</sense></hom></entry></entry>");
