INSERT INTO `wced_entry` VALUES (770, "amin", "36", "<entry page=""36"" id=""770""><form id=""amin"" lang=""ceb"">amin</form>
<hom>
<sense n=""0""><trans> amen. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b(1)]</itype><trans> kiss the hand or take a hand to the forehead. </trans>
<eg><i lang=""ceb"">Amini si Tiyù mu,</i><trans> Kiss your uncle’s hand. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3; b(1)]</itype><trans> <tr>give in</tr>, <tr>concede</tr>, <tr>surrender</tr>. </trans>
<eg><i lang=""ceb"">Human sa ámung panagbúngul miamin siya kanákù,</i><trans> After we had not been on speaking terms, he gave in to me. </trans></eg>
<eg><i lang=""ceb"">Ang mayur lang kunuy íyang aminan,</i><trans> He says he will surrender only to the mayor. </trans></eg>
</sense></hom>
<entry><form id=""amin-axmin"" lang=""ceb"">amin-ámin</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>food</tr> prepared for the last day of the novena (slang). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; b]</itype><trans> prepare some food for the guests on the last day of a novena. </trans>
<eg><i lang=""ceb"">Mutambung ta sa katapúsan ug mag-amin-ámin sila,</i><trans> We will attend the last day of the novena if they prepare s.t. </trans></eg>
</sense></hom></entry>
<entry><form id=""paamin"" lang=""ceb""><abbr expan=""paamin"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> have s.o. kiss the hand. </trans>
<eg><i lang=""ceb"">Paaminun tikaw áring kinúmù!</i><trans> I’ll let you kiss my fist (i.e. smack you one).†
</trans></eg>
</sense></hom></entry></entry>");
