<eg><i lang=""ceb"">Ang mga latang kamátis makaamung sa uban,</i><trans> The rotten tomatoes can ruin the others that are packed together with them. </trans></eg>
<eg><i lang=""ceb"">Ayaw ku iamung (amunga) sa inyung kabúang,</i><trans> Do not involve me in your foolishness. </trans></eg>
<eg><i lang=""ceb"">Sa pinusílay naamung ang inusinting bátà,</i><trans> During the gunfight an innocent child was hit in the crossfire. </trans></eg>
</sense></hom>
<entry><form id=""pangamung"" lang=""ceb""><abbr expan=""pangamung"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> exert bad influence. </trans>
</sense>
<sense n=""2""><number>2</number><trans> try <pb n=""38""/>s.t. on a long shot. </trans>
<eg><i lang=""ceb"">Nangamung siyag pangulitáwu, básig sugtun,</i><trans> He tried his luck at courting her in hopes of succeeding. </trans></eg>
</sense></hom></entry>
<entry><form id=""amung-axmung"" lang=""ceb"">amung-ámung</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> inflict malicious, needless harm. </trans>
<eg><i lang=""ceb"">Ang mga tulisan nag-amung-ámung pa giyud níya,</i><trans> The bandits raped her as well. </trans></eg>
<eg><i lang=""ceb"">Giamung-amungan tingáli ang masitíra sa irù kay nangabúak man,</i><trans> The dogs probably messed up the flower pots, because they are broken. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>tease</tr> maliciously. </trans>
<eg><i lang=""ceb"">Giamung-amúngan níla ang irù paghikut ug láta,</i><trans> They teased the dog by tying a can to it. </trans></eg>
</sense></hom></entry>
<entry><form id=""amung-amungan_maamung-amungun"" lang=""ceb"">amung-amungan, maamung-amungun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> maliciously destructive.
</trans>
</sense></hom></entry></entry>");
