INSERT INTO `wced_entry` VALUES (821, "-an1", "38", "<entry page=""38"" id=""821""><form id=""x-an"" lang=""ceb"">-an<sub>1</sub></form>
<hom>
<sense n=""0""><trans> local passive verb affix, future. (<ix>past</ix> <bx>gi-an</bx>; <ix>subjunctive</ix> <bx>-i</bx>. <ix>Potential forms: past</ix> <bx>na-an</bx>; <ix>future</ix> <bx>ma-an</bx> or, alternatively, <bx>ka-an</bx>; <ix>subjunctive</ix> <bx>ma-i</bx> or, alternatively, <bx>ka-i</bx>.) Not all verbs occur with this affix, and those that do may occur with only one or two or all of the meanings. </trans>
</sense>
<sense n=""1""><number>1</number><trans> [do] for, at, on, in. </trans>
<eg><i lang=""ceb"">Palitan ku siyag kík,</i><trans> I will buy him cake (or buy cake from him). </trans></eg>
<eg><i lang=""ceb"">Gipalitan ku siya,</i><trans> I bought some for (from) him. </trans></eg>
<eg><i lang=""ceb"">Wà ku siya paliti,</i><trans> I didn’t buy any for (from) him. </trans></eg>
<eg><i lang=""ceb"">Mapalitan (kapalitan) ku siya,</i><trans> I can buy some for (from) him. </trans></eg>
<eg><i lang=""ceb"">Napalitan ku siya,</i><trans> I managed to buy some for (from) him. </trans></eg>
<eg><i lang=""ceb"">Wà ku siya mapaliti (kapaliti),</i><trans> I couldn’t buy any for (from) him. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> <ix>with noun bases:</ix> give, provide s.o. [noun]. </trans>
<eg><i lang=""ceb"">Sirúhan ka nákù,</i><trans> I will give you a zero. </trans></eg>
<eg><i lang=""ceb"">Sapatúsan ku ang bátà,</i><trans> I will put shoes on the child. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> [do] directly to s.o. or s.t. </trans>
<eg><i lang=""ceb"">Hagkan ku ikaw,</i><trans> I will kiss you. </trans></eg>
<eg><i lang=""ceb"">Bantayan ninyu ang prísu,</i><trans> Watch the prisoner. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> [do] to part of s.t. </trans>
<eg><i lang=""ceb"">Kuháan ku ang ímung kík ug gamay,</i><trans> I will take a little of your cake. </trans></eg>
<eg><i lang=""ceb"">Kunhúran ku ang prisyu,</i><trans> I will take a little off the price. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <ix>with verbs from adjectives:</ix> consider s.t. as. </trans>
<eg><i lang=""ceb"">Lisdan siya sa átung sinultihan,</i><trans> He will find our language difficult. </trans></eg>
<eg><i lang=""ceb"">Gipilahan ka lang uruy niánà?</i><trans> Do you consider that a small amount? </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> have [verb] happen to one. </trans>
<eg><i lang=""ceb"">Naulanan aku,</i><trans> I was caught in the rain. </trans></eg>
<eg><i lang=""ceb"">Labdan ka sa úlu,</i><trans> You will get a headache. (It will happen to you that your head will ache.) </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> <pb n=""39""/>[do] because of, due to. </trans>
<eg><i lang=""ceb"">Unsay gihilákan mu?</i><trans> What is it you are crying about? </trans></eg>
<eg><i lang=""ceb"">Dílì nà ángayng kabalak-an,</i><trans> That is not worth getting worried over. </trans></eg>
</sense>
<sense n=""6""><number>6</number><trans> do in [such-and-such a manner]. </trans>
<eg><i lang=""ceb"">Usaan nà nákug alsa,</i><trans> I will lift that with one (hand). </trans></eg>
<eg><i lang=""ceb"">Datadatáhan ku nag báyad,</i><trans> I will pay for that in installments. </trans></eg>
</sense>
<sense n=""7""><number>7</number><trans> work off a debt, pay for by [do]ing. </trans>
<eg><i lang=""ceb"">Mahímù nímung trabahúan ang ímung útang nákù,</i><trans> You may work off your debt to me. </trans></eg>
<eg><i lang=""ceb"">Buk-an kug lubi kining bugas,</i><trans> I’ll pay for this rice by splitting coconuts.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (821, "-an", "-an", "s", "");
INSERT INTO `wced_entry` VALUES (822, "-an2", "39", "<entry page=""39"" id=""822""><form id=""x-an2"" lang=""ceb"">-an<sub>2</sub></form>
<hom>
<sense n=""0""><trans> suffix forming verb bases to which the prefixes <ix>mag-, tig-</ix> and <ix>pag-</ix> may be added. The verb with these affixes always has stress on the final syllable and means ‘[do] s.t. at a certain place habitually’. </trans>
<eg><i lang=""ceb"">Mag-anhian siya dinhig maduminggu,</i><trans> He comes here on Sundays. </trans></eg>
<eg><i lang=""ceb"">Siyay tig-anhian dinhi,</i><trans> He comes here often. </trans></eg>
<eg><i lang=""ceb"">Sa ímung pag-adtuan didtu, nakailaíla kag usa ka Mang Tiryu?</i><trans> In the times you’ve been going to that place, did you ever meet a certain Mang Terio?
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (822, "-an", "-an", "s", "");
INSERT INTO `wced_entry` VALUES (823, "-an3", "39", "<entry page=""39"" id=""823""><form id=""x-an3"" lang=""ceb"">-an<sub>3</sub></form>
<hom>
<sense n=""0""><trans> noun forming affix. </trans>
</sense>
<sense n=""1""><number>1</number><trans> forming nouns which refer to a place where s.t. is found, done, held, located. </trans>
<eg><i lang=""ceb"">Humayan,</i><trans> Rice field. </trans></eg>
<eg><i lang=""ceb"">Tubaan,</i><trans> Place where toddy is sold. </trans></eg>
<eg><i lang=""ceb"">Baskitbulan,</i><trans> Place basketball is played. </trans></eg>
<eg><i lang=""ceb"">Habagatan,</i><trans> West (place from which the <ix>habágat</ix> ‘west wind’ blows). </trans></eg>
<eg><i lang=""ceb"">Bairan,</i><trans> Sharpener (thing on which one sharpens). </trans></eg>
<eg><i lang=""ceb"">Tindáhan,</i><trans> Store (place one sells). </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> forming nouns which refer to a person possessed of a certain power. Nouns of this sort always have long penults. </trans>
<eg><i lang=""ceb"">Tambálan,</i><trans> Folk doctor. </trans></eg>
<eg><i lang=""ceb"">Hilútan,</i><trans> Doctor specializing in massage. </trans></eg>
<eg><i lang=""ceb"">Barángan,</i><trans> A sorcerer with magic insects at his disposal.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (823, "-an", "-an", "s", "");
INSERT INTO `wced_entry` VALUES (824, "-an4", "39", "<entry page=""39"" id=""824""><form id=""x-an4"" lang=""ceb"">-an<sub>4</sub></form>
<hom>
<sense n=""0""><trans> adjective forming affix. </trans>
</sense>
<sense n=""1""><number>1</number><trans> forming adjectives which mean ‘characterized by being [so-and-so]’. Words of this sort have the stress on the final syllable. </trans>
<eg><i lang=""ceb"">Langasan,</i><trans> Of a noisy type. </trans></eg>
<eg><i lang=""ceb"">Talawan,</i><trans> Cowardly. </trans></eg>
<eg><i lang=""ceb"">Gahian,</i><trans> Of a hard sort. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> added to nouns to form adjectives which mean ‘having [so-and-so]’. </trans>
<eg><i lang=""ceb"">Utúkan,</i><trans> Brainy. </trans></eg>
<eg><i lang=""ceb"">Kwartáhan,</i><trans> Moneyed.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (824, "-an", "-an", "s", "");
INSERT INTO `wced_entry` VALUES (825, "-an(→)", "39", "<entry page=""39"" id=""825""><form id=""x-anrx"" lang=""ceb"">-an(→)</form>
<hom>
