INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (825, "-an(→)", "-an(→)", "m", "");
INSERT INTO `wced_entry` VALUES (826, "-an-", "39", "<entry page=""39"" id=""826""><form id=""x-an-"" lang=""ceb"">-an-</form>
<hom>
<sense n=""0""><trans> infix optionally added to all forms with the prefixes <ix>nag-, mag-, pag-,</ix> indicating that affixed forms refer to more than one person. </trans>
<eg><i lang=""ceb"">Nanagsábut sila,</i><trans> They made (plurally) an agreement. </trans></eg>
<eg><i lang=""ceb"">Duha ka managsúun,</i><trans> Two brothers. </trans></eg>
<eg><i lang=""ceb"">Ang ílang panagsábut,</i><trans> Their (plural) agreement with each other.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (826, "-an-", "-an-", "m", "");
INSERT INTO `wced_entry` VALUES (827, "ana", "39", "<entry page=""39"" id=""827""><form id=""ana6"" lang=""ceb"">anā̀</form>
<hom>
<sense n=""1""><number>1</number><trans> expression of surprise. </trans>
</sense>
<sense n=""a""><number>a</number><trans> at s.t. pleasant. </trans>
<eg><i lang=""ceb"">Anā̀, kanindut sa ímung ariyus,</i><trans> Oh what beautiful earrings you have! </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> at s.t. which causes worry. </trans>
<eg><i lang=""ceb"">Anā̀! Nabuak,</i><trans> Oh-Oh! It broke. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> expression chiding s.o. </trans>
<eg><i lang=""ceb"">Anā̀! Nagpabuyag man ka!</i><trans> My! You’re making a nuisance of yourself.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (827, "anā̀", "ana", "m", "");
INSERT INTO `wced_entry` VALUES (828, "ana", "39", "<entry page=""39"" id=""828""><form id=""axnaq"" lang=""ceb"">ánà</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#niaxnaq""><sc>niánà</sc></xr>. <ix>see</ix> <xr lang=""ceb"" target=""#kanaq""><sc>kanà</sc></xr>.

</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (828, "ánà", "ana", "m", "");
INSERT INTO `wced_entry` VALUES (829, "anaa", "39", "<entry page=""39"" id=""829""><form id=""anaxa"" lang=""ceb"">anáa</form>
<hom>
<sense n=""0""> <ix>short form:</ix> <form id=""naxa"" lang=""ceb"">náa</form><trans>. </trans>
</sense>
<sense n=""1""><number>1</number><trans> be <tr>there</tr> (near you). </trans>
<eg><i lang=""ceb"">Náa ba dihà ang yáwi?</i><trans> Do you have (is there) the key? </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> be employed at, work at. </trans>
<eg><i lang=""ceb"">Náa siya sa Atlas,</i><trans> He works for Atlas. </trans></eg>
<eg><i lang=""ceb"">Náa ra siya sa báy,</i><trans> He is always at home. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> there is. </trans>
<eg><i lang=""ceb"">Náay suwat pára nímu,</i><trans> There is a letter for you. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <form id=""anaxa_dat."" lang=""ceb""><abbr expan=""anáa"" type=""lemma"">—</abbr> <r><ix>dat.</ix></r></form><trans> [dat.] <tr>has</tr>. </trans>
<eg><i lang=""ceb"">Náa kaníya ang yáwi,</i><trans> He has the key. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number><trans> it depends upon [dat.]. </trans>
<eg><i lang=""ceb"">Náa ra nímug muadtu ta,</i><trans> It’s up to you if we should go. </trans></eg>
</sense>
<sense n=""3c""><number>3c</number><trans> be menstruating. </trans>
<eg><i lang=""ceb"">Dílì mudúul ang bána ug náa sa asáwa,</i><trans> A husband cannot have intercourse with his wife when she is menstruating. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <form id=""unsa_may_anaxa_niaxnaq_sa_noun?"" lang=""ceb"">unsa may <abbr expan=""anáa"" type=""lemma"">—</abbr> niánà, sa <r>[<ix>noun</ix>]</r>?</form><trans> what does that, [noun] have to do with it? </trans>
<eg><i lang=""ceb"">Unsa ba guy náa sa idad?</i><trans> And what does age have to do with it? </trans></eg>
</sense></hom>
<entry><form id=""pagkaanaxa"" lang=""ceb""><abbr expan=""pagkaanáa"" type=""lemma"">pagka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the state of being there. </trans>
<eg><i lang=""ceb"">Ang íyang pagkaanáa sa balay,</i><trans> His presence in the house. </trans></eg>
</sense></hom></entry>
<entry><form id=""pakaanaxa"" lang=""ceb""><abbr expan=""pakaanáa"" type=""lemma"">paka-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> strive to have s.t. </trans>
<eg><i lang=""ceb"">Ímu kung pakaanaáhun bisan wà kuy nahut,</i><trans> You try to get s.t. from me even though I haven’t anything. </trans></eg>
</sense></hom></entry>
<entry><form id=""anaaxhun"" lang=""ceb"">anaáhun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> well-to-do.
</trans>
</sense></hom></entry></entry>");
