INSERT INTO `wced_entry` VALUES (833, "anad", "39", "<entry page=""39"" id=""833""><form id=""axnad"" lang=""ceb"">ánad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B23(1); b(1)]</itype><trans> take to, become fond of. </trans>
<eg><i lang=""ceb"">Pakúgus ang bátà nga nakaánad na nímu,</i><trans> A child that has become fond of you will want you to carry him. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B2S; b8]</itype><trans> get accustomed, get in the habit of doing s.t. </trans>
<eg><i lang=""ceb"">Muánad (maánad) siyag panghilabut sa ákung butang,</i><trans> He will (might) get used to touching my things. </trans></eg>
<eg><i lang=""ceb"">Naandan na níya ang pamakak,</i><trans> She is accustomed to lying. </trans></eg>
<eg><i lang=""ceb"">Ang naandan nga paági,</i><trans> The usual way. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[b8]</itype><trans> treat s.o. too familiarly. </trans>
<eg><i lang=""ceb"">Hiandan ka lang; ábi níla maáyu ka man,</i><trans> They’re just abusing you; they think you’re nice. </trans></eg>
<eg><i lang=""ceb"">Naandan ka níya ug kumidiya,</i><trans> He has gotten in the habit of joking with you (when he should not have). </trans></eg>
</sense></hom>
<entry><form id=""anad"" lang=""ceb""><abbr expan=""anad"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>accustomed to</tr>, familiar with s.t. </trans>
<eg><i lang=""ceb"">Anad kaáyu ku ug byáhi,</i><trans> I am accustomed to travelling. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>tame</tr>. </trans>
<eg><i lang=""ceb"">Anad ang langgam,</i><trans> The bird is tame. </trans></eg>
<eg><i lang=""ceb"">Kaanad nga batáa bísan kinsa makakúgus níya,</i><trans> That child is not afraid of people. Anybody can hold him. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> become accustomed. </trans>
<eg><i lang=""ceb"">Ug maanad ka na ánang trabahúa, dì ka na lisdan,</i><trans> When you get used to the work, you won’t find it hard. </trans></eg>
</sense></hom></entry>
<entry><form id=""anaran"" lang=""ceb"">anaran</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having a special appeal to animals, children, etc. so that they feel immediately at home.
<pb n=""40""/>
</trans>
</sense></hom></entry></entry>");
