INSERT INTO `wced_entry` VALUES (836, "anagu, anagu", "40", "<entry page=""40"" id=""836""><form id=""anagu_anaxgu"" lang=""ceb"">anagu, anágu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> hazy, <tr>unclear image</tr>. </trans>
<eg><i lang=""ceb"">Ang anágu sa dálan gibantayan pag-áyu sa draybir,</i><trans> The driver paid close attention to the blurred outline of the road. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2S]</itype><trans> appear hazily. </trans>
<eg><i lang=""ceb"">Nag-anagu ang balay sa bungtud tungud sa gábun,</i><trans> The house on the hill was hazy because of the mist.
