INSERT INTO `wced_entry` VALUES (837, "anaha", "40", "<entry page=""40"" id=""837""><form id=""anahaq"" lang=""ceb"">anahà</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. small ant with a light tan color and with a black spot on the body and which takes to sugar. It inflicts a mild bite. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B125; a4]</itype><trans> be infested with <ix>anahà</ix> ants. </trans>
<eg><i lang=""ceb"">Sus, nagkaanahà (gianahà) ang asúkar!</i><trans> Heavens! The sugar is swarming with ants.
</trans></eg>
</sense></hom></entry>");
