INSERT INTO `wced_entry` VALUES (839, "anak", "40", "<entry page=""40"" id=""839""><form id=""anak"" lang=""ceb"">anak</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> son, daughter. </trans>
</sense></hom>
<entry><form id=""anak_sa_buxhat"" lang=""ceb""><abbr expan=""anak"" type=""lemma"">—</abbr> sa búhat</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>laborer</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> accustomed to hard work. </trans>
<eg><i lang=""ceb"">Way báli kanà, kay anak man aku sa búhat,</i><trans> I don’t mind that, because I’m used to hard work. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>poor people</tr>. </trans>
<eg><i lang=""ceb"">Lisud ang panginabúhì sa mga anak sa búhat,</i><trans> Life for the poor is very difficult nowadays. </trans></eg>
</sense></hom></entry>
<entry><form id=""anak_sa_bunyag"" lang=""ceb""><abbr expan=""anak"" type=""lemma"">—</abbr> sa bunyag</form>
<hom>
<sense n=""0""><trans> <tr>godson</tr> or daughter at baptism. </trans>
</sense></hom></entry>
<entry><form id=""anak_sa_gawas"" lang=""ceb""><abbr expan=""anak"" type=""lemma"">—</abbr> sa gawas</form>
<hom>
<sense n=""0""><trans> illegitimate child. </trans>
</sense></hom></entry>
<entry><form id=""anak_sa_huxlaw"" lang=""ceb""><abbr expan=""anak"" type=""lemma"">—</abbr> sa húlaw</form>
<hom>
<sense n=""0""><trans> short person (son of the dry, lean times). </trans>
</sense></hom></entry>
<entry><form id=""anak_sa_kaxgang"" lang=""ceb""><abbr expan=""anak"" type=""lemma"">—</abbr> sa kágang</form>
<hom>
<sense n=""0""><trans> <ix>exclamation of discomfiture:</ix> My! </trans>
<eg><i lang=""ceb"">Anak sa kágang! Ngánu nga naílad ka man!</i><trans> My heavens! Why did you let them cheat you! </trans></eg>
</sense></hom></entry>
<entry><form id=""anak_sa_saxpiq"" lang=""ceb""><abbr expan=""anak"" type=""lemma"">—</abbr> sa sápì</form>
<hom>
<sense n=""0""><trans> child that has been adopted by purchase. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; cN]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>give birth</tr>. </trans>
<eg><i lang=""ceb"">Dì na muanak (manganak) nà si Kurdapya kay gúlang na,</i><trans> Cordapia will not have any more children because she’s old. </trans></eg>
<eg><i lang=""ceb"">Nag-anak siyag kalúha,</i><trans> She had twins. </trans></eg>
<eg><i lang=""ceb"">Ang banig nga gianakan (giangkan, gipanganakan),</i><trans> The mat she gave birth on. </trans></eg>
<eg><i lang=""ceb"">Diin ka ianak (ipanganak)?</i><trans> Where were you born? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12]</itype><trans> happen to have for a child. </trans>
<eg><i lang=""ceb"">Nakaanak si Pidru ug abilidaran,</i><trans> Pedro had a genius for a son. </trans></eg>
</sense></hom></entry>
<entry><form id=""Ának"" lang=""ceb""><abbr expan=""Ának"" type=""lemma"">(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <ix>in prayers:</ix> Son of God. </trans>
<eg><i lang=""ceb"">Sa ngálan sa Amahan, sa Ának, sa Ispiritu Santu ...<corr>,</corr></i><trans> In the name of the Father, of the Son, and of the Holy Ghost ... </trans></eg>
</sense></hom></entry>
<entry><form id=""paanak"" lang=""ceb""><abbr expan=""paanak"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> assist in childbirth, cause s.t. to be born. </trans>
<eg><i lang=""ceb"">Mananabang ang nagpaanak kanákù,</i><trans> A folk-midwife assisted me in childbirth. </trans></eg>
<eg><i lang=""ceb"">Paangka siya sa matirniti,</i><trans> Let her have her baby in the clinic. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b(1)]</itype><trans> make <tr>pregnant</tr>. </trans>
<eg><i lang=""ceb"">Ang mutsatsa gipaangkan sa kutsíru,</i><trans> The rig driver got the maid pregnant. </trans></eg>
</sense></hom></entry>
<entry><form id=""palaangkanan"" lang=""ceb"">palaangkanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>delivery table</tr>. </trans>
</sense></hom></entry>
<entry><form id=""pinaangkan"" lang=""ceb"">pinaangkan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>illegitimate child</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one who gave birth out of wedlock. (Cf. <bx>paangkan</bx> <ix>v 1,</ix> below.) </trans>
</sense></hom></entry>
<entry><form id=""panganak"" lang=""ceb""><abbr expan=""panganak"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> = <xr lang=""ceb"" target=""#anak""><sc>anak</sc></xr>, <ix>v</ix>. <bx>2</bx> <itype>[A]</itype><trans> sponsor in a baptism. </trans>
<eg><i lang=""ceb"">Aku ang nanganak ni Bíbi sa bunyag,</i><trans> I was Baby’s godfather in her baptism. </trans></eg>
</sense></hom></entry>
<entry><form id=""pangaxnak"" lang=""ceb""><abbr expan=""pangának"" type=""lemma"">paN-(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>pebble</tr> in game of <ix>pungga.</ix> </trans>
</sense></hom></entry>
<entry><form id=""pinanganak"" lang=""ceb"">pinanganak</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>godson</tr> or daughter. </trans>
</sense></hom></entry>
<entry><form id=""anak-axnak"" lang=""ceb"">anak-ának</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>adopted child</tr>. </trans>
<eg><i lang=""ceb"">Anak-ának ra man nà si Kadyu kay walay bátà ang magtiáyun,</i><trans> Cadio is just an adopted child because the couple is childless. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> in a child’s game, the pretend child. </trans>
</sense></hom></entry>
<entry><form id=""angkan"" lang=""ceb"">angkan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having given birth. </trans>
<eg><i lang=""ceb"">Yàyà ug láwas ni si Kurdapya mu rag angkan,</i><trans> Cordapia’s body is flabby like a woman that has just given birth. </trans></eg>
<eg><i lang=""ceb"">Angkan na siyang dakù pagkaminyù níla,</i><trans> It was well known that she had had a child before they got married. </trans></eg>
</sense></hom></entry>
<entry><form id=""paangkan"" lang=""ceb"">paangkan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> make s.o. pregnant. </trans>
<eg><i lang=""ceb"">Kinsa may nagpaangkan sa labandíra?</i><trans> Who made the laundry woman pregnant? </trans></eg>
</sense></hom></entry>
<entry><form id=""pinaangkan"" lang=""ceb"">pinaangkan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who gave birth to an illegitimate child. </trans>
</sense></hom></entry>
<entry><form id=""angkaxnun"" lang=""ceb"">angkánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for people to be prolific in childbirth. </trans>
<eg><i lang=""ceb"">Angkánun (palaának) kaáyu si Maríya. Manganak káda túig,</i><trans> Maria is prolific. She gives birth every year. </trans></eg>
</sense></hom></entry>
<entry><form id=""alangkan"" lang=""ceb"">alangkan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>delivery room</tr>. </trans>
</sense></hom></entry>
<entry><form id=""hinangkan_hingangkan"" lang=""ceb"">hinangkan, hingangkan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> hen that has raised a brood. </trans>
</sense></hom></entry>
<entry><form id=""ig-axnak"" lang=""ceb""><abbr expan=""ig-ának"" type=""lemma"">ig-(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>relative</tr> of any sort. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12; c1]</itype><trans> be <tr>related</tr>. </trans>
<eg><i lang=""ceb"">Naig-ának siya sa mga Blangku kay naasáwa man níya ang anak,</i><trans> He became related to the Blancos because he married the daughter. </trans></eg>
</sense></hom></entry>
<entry><form id=""ig-alaxnak"" lang=""ceb"">ig-alának</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> child in the womb. </trans>
</sense>
<sense n=""2""><number>2</number><trans> in a condition about to give birth. </trans>
<eg><i lang=""ceb"">Ig-alának na kaáyu ang íyang tiyan,</i><trans> Her stomach looks as though she’s about to give birth. </trans></eg>
</sense></hom></entry>
<entry><form id=""inanak"" lang=""ceb""><abbr expan=""inanak"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>godson</tr>, daughter in any ceremony. </trans>
<eg><i lang=""ceb"">Inanak ku siya sa kasal,</i><trans> He is my godson because I sponsored his wedding. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> child born. </trans>
<eg><i lang=""ceb"">Bag-ung inanak,</i><trans> Newly born child. </trans></eg>
</sense></hom></entry>
<entry><form id=""mag-alaxnak_taliaxnak_umaaxnak"" lang=""ceb"">mag-alának, taliának, umaának</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> about to give birth. </trans>
</sense></hom></entry>
<entry><form id=""axnakun"" lang=""ceb""><abbr expan=""ánakun"" type=""lemma"">-un(←)</abbr></form>
<hom>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#inanak""><sc>inanak</sc></xr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#pag-umangkun""><sc>pag-umangkun</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""palaaxnak"" lang=""ceb""><abbr expan=""palaának"" type=""lemma"">pala-(←)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for people or animals to be <tr>prolific</tr> in childbirth. </trans>
<eg><i lang=""ceb"">Palaának ang ákung anay,</i><trans> My pig is very prolific. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> prolific in output. <ix>see also</ix> <xr lang=""ceb"" target=""#pag-umangkun""><sc>pag-umangkun</sc></xr>, <xr lang=""ceb"" target=""#mantiaxnak""><sc>mantiának</sc></xr>, <xr lang=""ceb"" target=""#taguangkan""><sc>taguangkan</sc></xr>.†
</trans>
</sense></hom></entry></entry>");
