INSERT INTO `wced_entry` VALUES (874, "andir", "42", "<entry page=""42"" id=""874""><form id=""andir"" lang=""ceb"">andir</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> short for <bx>andir dibúnal, bakyà, sáya</bx> be <tr>dominated</tr>, <tr>subjugated</tr> to one’s wife. </trans>
</sense>
<sense n=""2""><number>2</number><trans> subordinate to. </trans>
<eg><i lang=""ceb"">Andir ku ni Kapitan Santus,</i><trans> Captain Santos is my superior. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> be a student of. </trans>
<eg><i lang=""ceb"">Andir ku ni Lúpis sa mat,</i><trans> I studied math with Lopez. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> under the net in tennis, volleyball, etc. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>dominate</tr>. </trans>
<eg><i lang=""ceb"">Dì giyud ku maandir,</i><trans> I will not be <tr>henpecked</tr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1256]</itype><trans> get to be under s.o., student of s.o. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B1256]</itype><trans> for the ball to be under the net. </trans>
</sense>
<sense n=""4""><number>4</number><trans> <ix>in phrases:</ix> <bx><abbr expan=""andir"" type=""lemma"">—</abbr> dibakyà, búnal, sáya</bx> = <xr lang=""ceb"" target=""#andir""><sc>andir</sc></xr>, <i lang=""ceb"">1.</i> </trans>
</sense></hom>
<entry><form id=""andir_ditixbul"" lang=""ceb""><abbr expan=""andir"" type=""lemma"">—</abbr> ditíbul</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. given under the table. </trans>
<eg><i lang=""ceb"">Ug way andir ditíbul dì mulusut ang ímung papílis,</i><trans> Your papers won’t get through without s.t. given under the table. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> <tr>bribe</tr>. </trans>
</sense></hom></entry>
<entry><form id=""andir_grawun"" lang=""ceb""><abbr expan=""andir"" type=""lemma"">—</abbr> grawun</form>
