INSERT INTO `wced_entry` VALUES (880, "ang", "42", "<entry page=""42"" id=""880""><form id=""ang"" lang=""ceb"">ang</form>
<hom>
<sense n=""0""><trans> <ix>short form:</ix> <bx>ng</bx> </trans>
