<sense n=""1""><number>1</number><trans> subject marker. </trans>
<eg><i lang=""ceb"">Nawálà ang libru,</i><trans> The book is lost. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> marker for definite predicate. </trans>
<eg><i lang=""ceb"">Ang íyang libru mauy nawálà,</i><trans> It was his book that was lost. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> following a form meaning including, together with. </trans>
<eg><i lang=""ceb"">Sitinta ang ábang, apil ang túbig,</i><trans> The rent is seventy pesos including the water. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <ix>preceding forms referring to quantity or measurement:</ix> each. </trans>
<eg><i lang=""ceb"">Ang ábang, sitinta ang <pb n=""43""/>búlan,</i><trans> The rent is seventy a month.
</trans></eg>
</sense></hom></entry>");
