INSERT INTO `wced_entry` VALUES (891, "angay", "43", "<entry page=""43"" id=""891""><form id=""axngay"" lang=""ceb"">ángay</form>
<hom>
<sense n=""0""><trans> <tr>ought</tr> to. </trans>
<eg><i lang=""ceb"">Ángay kang magtuun arun makapasar ka,</i><trans> You ought to study if you want to pass. </trans></eg>
<eg><i lang=""ceb"">Dì nà ángay nímu ikabaláka,</i><trans> You should not worry about that. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> fitting, <tr>proper</tr>, right time or situation. </trans>
<eg><i lang=""ceb"">Ángay ni nímung kulúra,</i><trans> This color suits you. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> evenly cut, equally spaced. </trans>
<eg><i lang=""ceb"">Ángayng pagkaputul ang mga pánid,</i><trans> The pages are evenly cut. </trans></eg>
<eg><i lang=""ceb"">Ángayng pagkatisuk ang mga pásuk,</i><trans> The stakes are evenly spaced. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1a""><number>1a</number> <itype>[B3S6; b8]</itype><trans> be appropriate. </trans>
<eg><i lang=""ceb"">Miángay ang ímung ilung sa ímung nawung,</i><trans> Your nose goes well with your face. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A23S]</itype><trans> like s.t., consider s.t. suitable to one’s taste. </trans>
<eg><i lang=""ceb"">Dílì ku muángay ánang tubà nga initlugan,</i><trans> I don’t like toddy mixed with eggs. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; a]</itype><trans> make s.t. equal, even. </trans>
<eg><i lang=""ceb"">Angáya ang káyu,</i><trans> Make the flame even. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A; a12]</itype><trans> tune a musical instrument. </trans>
<eg><i lang=""ceb"">Angáyun ta ning pyánu,</i><trans> Let’s tune this piano. </trans></eg>
</sense>
<sense n=""2c""><number>2c</number> <itype>[C; a12]</itype><trans> treat each other equally, do s.t. equally to several people. </trans>
<eg><i lang=""ceb"">Mag-ángay mig káun sa ámù. Way pinihig,</i><trans> We all eat the same food at home. Nobody gets anything special. </trans></eg>
<eg><i lang=""ceb"">Angáyun ta mug dukduk sa úlu,</i><trans> I will knock you all on your heads. </trans></eg>
</sense>
<sense n=""2d""><number>2d</number> <itype>[C; b]</itype><trans> be in agreement. </trans>
<eg><i lang=""ceb"">Nag-ángay ang ílang mga disisyun,</i><trans> They were in agreement in their decisions. </trans></eg>
</sense></hom>
<entry><form id=""angay"" lang=""ceb""><abbr expan=""angay"" type=""lemma"">(→)</abbr></form>
<hom>
<sense n=""0""> <form id=""walay_angay"" lang=""ceb"">walay <abbr expan=""angay"" type=""lemma"">—(→)</abbr></form><trans> </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>unbecoming</tr>, <tr>ugly</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> be unbecoming, ugly. </trans>
<eg><i lang=""ceb"">Mawalà kay angay ug itum isul-ub,</i><trans> It will not become you if you wear black. </trans></eg>
</sense></hom></entry>
<entry><form id=""paaxngay_pahiaxngay"" lang=""ceb""><abbr expan=""paángay"" type=""lemma"">pa-</abbr>, <abbr expan=""pahiángay"" type=""lemma"">pahi-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>put, place carefully in order</tr>. </trans>
<eg><i lang=""ceb"">Gipaángay (gipahiángay) níya ang búlak sa bukag,</i><trans> He placed the flowers carefully in the basket. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>furnish</tr>. </trans>
<eg><i lang=""ceb"">Gipaangáyan mig pridyidir,</i><trans> We were furnished a refrigerator. </trans></eg>
</sense></hom></entry>
<entry><form id=""paangay"" lang=""ceb""><abbr expan=""paangay"" type=""lemma"">pa-(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> make s.t. <tr>even</tr>. </trans>
<eg><i lang=""ceb"">Paangayi ang linung-ag,</i><trans> Let the food get cooked evenly. </trans></eg>
</sense></hom></entry>
<entry><form id=""paangayan"" lang=""ceb""><abbr expan=""paangayan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for a person to be becoming, proper. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> get to be becoming. </trans>
<eg><i lang=""ceb"">Nagkaangayan ka sa ímung úban,</i><trans> Your grey hairs become you more and more. </trans></eg>
</sense></hom></entry>
<entry><form id=""kaangaxyan"" lang=""ceb""><abbr expan=""kaangáyan"" type=""lemma"">ka-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>just, equal treatment</tr>. </trans>
</sense></hom></entry>
<entry><form id=""maangaxyun"" lang=""ceb""><abbr expan=""maangáyun"" type=""lemma"">ma-un</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>just</tr>, <tr>equal</tr>. </trans>
<eg><i lang=""ceb"">Maangáyung pagbáhin sa kabílin,</i><trans> A just division of the inheritance. </trans></eg>
</sense></hom></entry>
<entry><form id=""makiangaxyun"" lang=""ceb""><abbr expan=""makiangáyun"" type=""lemma"">maki-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> tending to be on equal terms with everyone.
</trans>
</sense></hom></entry></entry>");
