INSERT INTO `wced_entry` VALUES (907, "angka", "44", "<entry page=""44"" id=""907""><form id=""angka"" lang=""ceb"">angka</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B4]</itype><trans> for s.t. to get <tr>loose</tr>, <tr>give way</tr>. </trans>
<eg><i lang=""ceb"">Muangka dáyun ang tikud sa sapátus,</i><trans> The heels of the shoes will come off right away. </trans></eg>
<eg><i lang=""ceb"">Miangka ang silya tungud sa íyang kabug-at,</i><trans> The chair gave way because she was too heavy. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c1]</itype><trans> <tr>remove</tr> s.t. to leave a gap. </trans>
<eg><i lang=""ceb"">Ayaw iangka (angkáha) ang tabun sa kaldíru,</i><trans> Do not lift the cover off the pot. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A23; b3]</itype><trans> <tr>quit</tr> doing s.t., a job. </trans>
<eg><i lang=""ceb"">Muangka ka na nga wà pay úras?</i><trans> You’re quitting now, when it hasn’t even been an hour? </trans></eg>
<eg><i lang=""ceb"">Hápit na mamatay, piru wà gihápun muangka ang ugis,</i><trans> The white cock was nearly dead, but he didn’t desist.†
</trans></eg>
</sense></hom></entry>");
