INSERT INTO `wced_entry` VALUES (910, "angkat", "44", "<entry page=""44"" id=""910""><form id=""angkat"" lang=""ceb"">angkat</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> take s.t. for resale on credit. </trans>
<eg><i lang=""ceb"">Angkátun sà run nákù ang isdà kay walà kuy puhúnan,</i><trans> I’ll take the fish on credit this time because I have no capital. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> amount for which s.t. is taken on credit. </trans>
<eg><i lang=""ceb"">Dì ni ikabaligyà ug tris kay kwatru ang angkat áni,</i><trans> I can’t let you have it for three because I had to pay four for it. </trans></eg>
</sense></hom>
