INSERT INTO `wced_entry` VALUES (912, "angkub", "44", "<entry page=""44"" id=""912""><form id=""angkub"" lang=""ceb"">angkub</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a <tr>covering</tr> over the opening of a small boat, the analogue of a deck on large boats. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN; b5]</itype><trans> make, put a cover for a boat. </trans>
<eg><i lang=""ceb"">Ílang angkubun (angkuban) ang sakayan ug playwud,</i><trans> They will make a plywood cover for the boat. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; ac]</itype><trans> <tr>fill</tr> s.t. in to cover up a deficiency. </trans>
<eg><i lang=""ceb"">Angkúba ra ang lab-ang sa ímung pinintálan,</i><trans> Fill in the spots you missed painting. </trans></eg>
<eg><i lang=""ceb"">Angkúbi ang kúwang sa ákung twisyun,</i><trans> Make up the balance of my tuition fees. </trans></eg>
<eg><i lang=""ceb"">Iangkub kining usa ka gantang humay arun mahustung usa ka bákid,</i><trans> Add this one ganta of rice to make it one cavan. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for boats to be covered, having an <ix>angkub.</ix> </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>complete</tr>, nothing lacking. </trans>
<eg><i lang=""ceb"">Angkub ang ímung paghátag kanámù sa diriksiyun,</i><trans> You gave complete directions.
</trans></eg>
</sense></hom></entry>");
