INSERT INTO `wced_entry` VALUES (913, "angkun", "44", "<entry page=""44"" id=""913""><form id=""angkun"" lang=""ceb"">angkun</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> claim as one’s own, <tr>admit</tr> authorship of an act. </trans>
<eg><i lang=""ceb"">Dì siya muangkun nga siyay may salà,</i><trans> He will not admit that he is wrong. </trans></eg>
<eg><i lang=""ceb"">Kinsay nag-angkun nga iyáha ning libru?</i><trans> Who is claiming that this book is his? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a12]</itype><trans> <tr>acquire</tr>, <tr>get</tr> as one’s portion, share or luck. </trans>
<eg><i lang=""ceb"">Mau niy pálad ákung naangkun,</i><trans> This is my lot in life. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A23]</itype><trans> be in a certain situation. </trans>
<eg><i lang=""ceb"">Dílì siya gustung muangkun sa kinabúhing pinubri,</i><trans> He does not want to lead the life of a poor man. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A3; a12]</itype><trans> take as one’s share of contributions or responsibility. </trans>
<eg><i lang=""ceb"">Akuy muangkun sa ilimnun,</i><trans> I’ll take care of the drinks. </trans></eg>
<eg><i lang=""ceb"">Angkúnun ku ang panghúgas sa plátu,</i><trans> I’ll take care of washing the plates. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> share claimed, turn being claimed. </trans>
<eg><i lang=""ceb"">Ákung angkun ning lutíha,</i><trans> This lot is my share. </trans></eg>
<eg><i lang=""ceb"">Ákung angkun sa pag-adurnu sa simbahan ugmà,</i><trans> It’s my turn to decorate the church tomorrow. </trans></eg>
</sense></hom>
<entry><form id=""mangaangkun"" lang=""ceb""><abbr expan=""mangaangkun"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who lays claim to things that are not his. </trans>
</sense></hom></entry>
<entry><form id=""hingangkun_angkunixru"" lang=""ceb""><abbr expan=""hingangkun"" type=""lemma"">hiN-</abbr>, <abbr expan=""angkuníru"" type=""lemma"">-íru</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> fond of claiming as one’s own.
</trans>
</sense></hom></entry></entry>");
