INSERT INTO `wced_entry` VALUES (926, "anhi", "45", "<entry page=""45"" id=""926""><form id=""anhi"" lang=""ceb"">anhi</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>here</tr>, in this place. </trans>
<eg><i lang=""ceb"">Anhi ibutang ang síya,</i><trans> Put the chair here. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> let’s get to [such-and-such] a matter. </trans>
<eg><i lang=""ceb"">Karun anhi kita báhin sa túbig nga gawíun sa panimalay,</i><trans> Now let’s get to the matter of water for household use. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b3c]</itype><trans> come, bring here. </trans>
<eg><i lang=""ceb"">Muanhi ka ba ugmà?</i><trans> Will you come here tomorrow? </trans></eg>
<eg><i lang=""ceb"">Ianhi nà dinhi,</i><trans> Bring it here. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13; a2]</itype><trans> come to get s.t. </trans>
<eg><i lang=""ceb"">Nag-anhi ku sa libru,</i><trans> I came for the book. </trans></eg>
<eg><i lang=""ceb"">Anhíun ta ka rung hápun,</i><trans> I’ll come here to get you this afternoon. </trans></eg>
</sense></hom>
<entry><form id=""anhian"" lang=""ceb"">anhian</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> habitually go s.w. </trans>
</sense></hom></entry>
<entry><form id=""hianhi_haanhi"" lang=""ceb""><abbr expan=""hianhi"" type=""lemma"">hi-</abbr>/<abbr expan=""haanhi"" type=""lemma"">ha-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256; b8]</itype><trans> happen to come, be brought here. </trans>
<eg><i lang=""ceb"">Nahianhi lang mi dinhi sa ámung libutlíbut,</i><trans> In our wandering, we wound up here. </trans></eg>
</sense></hom></entry>
<entry><form id=""kaanhiun"" lang=""ceb"">kaanhiun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> feel like coming here.
</trans>
</sense></hom></entry></entry>");
