INSERT INTO `wced_entry` VALUES (938, "anihag", "46", "<entry page=""46"" id=""938""><form id=""anixhag"" lang=""ceb"">aníhag</form>
<hom>
<sense n=""0""><trans> (from <ix>síhag</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> <tr>peer</tr> or <tr>look</tr> through s.t. transparent. </trans>
<eg><i lang=""ceb"">Dihay mianihag (nag-anihag) sa bildung takup,</i><trans> S.o. peered through the glass shutter. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B26]</itype><trans> be clearly visible through s.t. transparent. </trans>
<eg><i lang=""ceb"">Muanihag ang mga isdà kun tin-aw ang túbig,</i><trans> You can see the fish clearly when the water is clear. </trans></eg>
<eg><i lang=""ceb"">Maanihag ang íyang láwas sa nipis nga sinínà,</i><trans> Her body showed through her flimsy dress. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B]</itype><trans> become clear or transparent. </trans>
<eg><i lang=""ceb"">Muanihag (maanihag) ang bildu kun trapúhan,</i><trans> The glass will become transparent if you wipe it. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B4N]</itype><trans> become <tr>bright</tr> and <tr>clear</tr>. </trans>
<eg><i lang=""ceb"">Mianihag (nanganihag) na ang kadaúgan sa kandidátu,</i><trans> The candidate’s victory is already clear. </trans></eg>
<eg><i lang=""ceb"">Nagkaanihag na ang lángit,</i><trans> The sky is getting clearer. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>crystal ball</tr>.
</trans>
</sense></hom></entry>");
