INSERT INTO `wced_entry` VALUES (951, "aninaw", "46", "<entry page=""46"" id=""951""><form id=""anixnaw"" lang=""ceb"">anínaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>observe</tr> carefully. </trans>
<eg><i lang=""ceb"">Gianínaw níya kun natúlug na ba ang tanan únà manáug,</i><trans> She looked carefully to see, listened carefully to hear, if everybody was asleep before going out. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; a3]</itype><trans> come to sense s.t. </trans>
<eg><i lang=""ceb"">Samtang natagpilaw siya, nakaanínaw siyag kasíkas sa píkas lawak,</i><trans> As he was dozing off to sleep, he noticed a rustling sound in the next room. </trans></eg>
<eg><i lang=""ceb"">Naanínaw ku nga buntag na diay,</i><trans> I became aware that it was already morning. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>observation</tr>. </trans>
<eg><i lang=""ceb"">Sa ákung anínaw wà siyay gustu nímu,</i><trans> I notice that she doesn’t like you.

