INSERT INTO `wced_entry` VALUES (975, "antaw", "47", "<entry page=""47"" id=""975""><form id=""antaw"" lang=""ceb"">antaw</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for things at a distance to be <tr>visible</tr>. </trans>
<eg><i lang=""ceb"">Ang Buhul antaw sa Talísay,</i><trans> Bohol is visible from Talisay. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B156]</itype><trans> be <tr>visible</tr>. </trans>
<eg><i lang=""ceb"">Sa unáhan ang íyang balay nag-antaw,</i><trans> His house is visible in the distance. </trans></eg>
</sense></hom>
<entry><form id=""paantaw"" lang=""ceb""><abbr expan=""paantaw"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> be at a distance. </trans>
<eg><i lang=""ceb"">Gipaantáwan níla ang namúhì ug dinamíta,</i><trans> They kept their distance from the dynamiters. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13]</itype><trans> look at s.t. from a distant, detached point of view. </trans>
<eg><i lang=""ceb"">Magpaantaw lang siya sa mga katarúngan ug dílì muapil sa lantúgì,</i><trans> He just takes a detached view of the reasons and doesn’t get into the argument. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A13]</itype><trans> be <tr>aloof</tr>. </trans>
<eg><i lang=""ceb"">Sa mga tígum si Lúlit magpaantaw ug dílì muapil sa kulukabildu,</i><trans> At parties Lolette would keep to herself and not join in any of the conversations.
</trans></eg>
</sense></hom></entry></entry>");
