<eg><i lang=""ceb"">Muantimánu kug lakaw arun dílì hiabtan sa ulan,</i><trans> I will leave early before I get caught in the rain. </trans></eg>
<eg><i lang=""ceb"">Antimanúhun (antimanúhan) ta sila ug sulti arun dílì hiunhan,</i><trans> Let’s tell them early before s.o. else does. </trans></eg>
