<eg><i lang=""ceb"">Wà nímu maantimánug patay ang bábuy,</i><trans> You didn’t kill the pig at the first blow. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A3P; b5c1]</itype><trans> do s.t. <tr>immediately</tr> with finality. </trans>
<eg><i lang=""ceb"">Iantimánu (antimanúhun, antimanúhan) giyud ang pagbalíbad arun dílì na magbalikbálik,</i><trans> You should refuse him with finality then and there so that he will not keep coming back. </trans></eg>
