</sense>
<sense n=""1""><number>1</number><trans> <tr>toss</tr> the coin in a coin-tossing game (<ix>hantak</ix>). </trans>
<eg><i lang=""ceb"">Ayaw ug antúgi ning batúha,</i><trans> Don’t toss coins on this stone. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>slam</tr> s.t. down as a coin is slammed down. </trans>
<eg><i lang=""ceb"">Iantug ta ka run,</i><trans> I’ll throw you on the ground (said to a child one is holding in his arms). </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>shoot</tr> the ball in a basketball game. </trans>
<eg><i lang=""ceb"">Inigkagunit níyag búla muantug dáyun,</i><trans> The moment he gets hold of the ball, he shoots it right away. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> turn to toss the coin. </trans>
</sense></hom>
