INSERT INTO `wced_entry` VALUES (1021, "-anun", "49", "<entry page=""49"" id=""1021""><form id=""x-anun"" lang=""ceb"">-anun</form>
<hom>
<sense n=""0""><trans> adjective forming affix added to roots which are nouns and which usually occur in the alternant <ix>-nun,</ix> with the a of the penult dropped. </trans>
</sense>
<sense n=""1""><number>1</number><trans> having the characteristics of [noun]. </trans>
<eg><i lang=""ceb"">Hariánun nga balay,</i><trans> A palatial (lit. kingly) house. </trans></eg>
<eg><i lang=""ceb"">Yawan-ung hunàhúnà,</i><trans> Devilish thoughts. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> being from [such-and-such] a place or like s.t. from that place. </trans>
<eg><i lang=""ceb"">Dagatnun nga mga binúhat,</i><trans> Creatures of the sea. </trans></eg>
<eg><i lang=""ceb"">Bul-ánun,</i><trans> One from Bohol. </trans></eg>
<eg><i lang=""ceb"">Bukidnun,</i><trans> A mountaineer.
</trans></eg>
</sense></hom></entry>");
