INSERT INTO `wced_entry` VALUES (1049, "ap-andawun", "50", "<entry page=""50"" id=""1049""><form id=""ap-andawun"" lang=""ceb"">ap-andawun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the situation in a game of mahjong where to obtain mahjong (go out) the player needs to complete only a single straight (sequences of three pieces in numerical order) such that either the lower number of the higher number will complete the sequence. E.g., if a player is complete for mahjong except for one straight for which he has only the pieces five and six, he needs either seven or four to make the straight complete and get mahjong, and thus he is in the <ix>ap-andawun</ix> situation.
</trans>
</sense></hom></entry>");
