INSERT INTO `wced_entry` VALUES (1056, "apas", "50", "<entry page=""50"" id=""1056""><form id=""axpas"" lang=""ceb"">ápas</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; a12b2]</itype><trans> follow and catch up with. </trans>
<eg><i lang=""ceb"">Muápas níya ang íyang asáwa sa Rúma,</i><trans> His wife will join him in Rome. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> go after s.o. to bring him home. </trans>
<eg><i lang=""ceb"">Apása siya sa iskuyláhan,</i><trans> Go get him at school. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> go as high as [such-and-such] an amount in buying s.t. </trans>
<eg><i lang=""ceb"">Dílì ku muápas (muapas) ug bayinti sa ímung bábuy,</i><trans> I will not go as high as twenty for your pig. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> amount offered in bargaining after an original offer was made. </trans>
<eg><i lang=""ceb"">Kwatru ni. Dì mahímug tris. Pilay ímung ápas?</i><trans> This costs four pesos. Three is not enough. How high will you offer? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> s.t. uttered to s.o. leaving as a reminder. </trans>
<eg><i lang=""ceb"">Ápas pahinumdum,</i><trans> A reminder as he is leaving. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <form id=""axpas_sumpay"" lang=""ceb""><abbr expan=""ápas"" type=""lemma"">—</abbr> sumpay</form><trans> </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>sequel</tr>. </trans>
<eg><i lang=""ceb"">Ang ‘Fili’ ni Risal ápas sumpay sa íyang ‘Noli’,</i><trans> Rizal’s ‘Fili’ is a sequel to his ‘Noli’. </trans></eg>
</sense></hom>
<entry><form id=""apas"" lang=""ceb""><abbr expan=""apas"" type=""lemma"">(→)</abbr></form>
<hom>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#axpas""><sc>ápas</sc></xr>, <bx>3</bx>. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; b(1)]</itype><trans> <tr>catch up</tr>, <tr>overtake</tr>. </trans>
<eg><i lang=""ceb"">Dì ku makaapas nímu sa lumbà,</i><trans> I can not overtake you in a foot race. </trans></eg>
<eg><i lang=""ceb"">Hiapsan ku sa ulan,</i><trans> I will be caught in the rain. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A12; a3]</itype><trans> get meaning of. </trans>
<eg><i lang=""ceb"">Dílì nákù maapas ang íyang gisulti,</i><trans> I cannot get what he’s talking about. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A12; a2]</itype><trans> <tr>keep up</tr> with work. </trans>
<eg><i lang=""ceb"">Dílì siya makaapas ug utaw sa ákung paglaba,</i><trans> He cannot keep ironing as fast as I wash. </trans></eg>
<eg><i lang=""ceb"">Apasun ku ning trabáhu,</i><trans> I will keep up with the work. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> <tr>effect</tr> s.t. </trans>
<eg><i lang=""ceb"">Dílì maapas sa tambal,</i><trans> The medicine cannot help. </trans></eg>
</sense>
<sense n=""6""><number>6</number> <itype>[A13; a12]</itype><trans> be after s.t. </trans>
<eg><i lang=""ceb"">Nag-apas ka lang sa íyang sápì,</i><trans> You’re only after her money. </trans></eg>
</sense></hom></entry>
<entry><form id=""apas-apas"" lang=""ceb"">apas-apas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> keep doing one after another. </trans>
<eg><i lang=""ceb"">Nag-apas-apas ug abut ang mga bisíta,</i><trans> The <pb n=""51""/>visitors kept coming, one after another. </trans></eg>
</sense></hom></entry>
<entry><form id=""apas-axpas"" lang=""ceb"">apas-ápas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> <tr>run</tr> after. </trans>
<eg><i lang=""ceb"">Giapas-ápas siya sa íyang trátu,</i><trans> Her boyfriend ran after her. </trans></eg>
</sense></hom></entry>
<entry><form id=""paaxpas"" lang=""ceb""><abbr expan=""paápas"" type=""lemma"">pa-</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#paagpas""><sc>paagpas</sc></xr>. <ix>see</ix> <xr lang=""ceb"" target=""#agpas""><sc>agpas</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""apsunun_alapsunun"" lang=""ceb"">apsunun, alapsunun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> requiring instant attention. </trans>
<eg><i lang=""ceb"">Ayaw kug langána kay apsunun ning trabáhu,</i><trans> Don’t delay me because this work needs instant attention.

</trans></eg>
</sense></hom></entry></entry>");
