INSERT INTO `wced_entry` VALUES (1063, "apid", "51", "<entry page=""51"" id=""1063""><form id=""axpid"" lang=""ceb"">ápid</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> arrange things of approximately the same size in a neat <tr>stack</tr>. </trans>
<eg><i lang=""ceb"">Akuy muápid sa mga pinalantsa arun dì malum-it,</i><trans> I will stack the ironed clothes neatly so that they do not get crumpled. </trans></eg>
</sense></hom>
<entry><form id=""apid-apid"" lang=""ceb"">apid-apid</form>
<hom>
<sense n=""1""><number>1</number><trans> be stacked. </trans>
</sense>
<sense n=""2""><number>2</number><trans> numerous. </trans>
<eg><i lang=""ceb"">Apid-apid na ang íyang útang,</i><trans> He has debts to the ceiling. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>stack</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> be numerous. </trans>
<eg><i lang=""ceb"">Giapid-apid man gud níya ang íyang trátu,</i><trans> He has numerous sweethearts (lit. stacked them up).
