INSERT INTO `wced_entry` VALUES (1065, "apiki", "51", "<entry page=""51"" id=""1065""><form id=""apixki"" lang=""ceb"">apíki</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>inadequate</tr> in space. </trans>
<eg><i lang=""ceb"">Apíki ang gamayng balay pára kanámung tanan,</i><trans> A small house is inadequate for all of us. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be in a <tr>tight</tr> financial position. </trans>
</sense>
<sense n=""3""><number>3</number><trans> having little time. </trans>
<eg><i lang=""ceb"">Apíki ang panahung itiwas sa trabáhu,</i><trans> There wasn’t enough time to finish the job. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <tr>homely</tr> to the point that one is hard put to find any redeeming feature. </trans>
<eg><i lang=""ceb"">Apíkig nawung tanan íyang mga bátà,</i><trans> His children are all homely. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> too near s.t. </trans>
<eg><i lang=""ceb"">Apíki sa karsáda ang balay,</i><trans> The house is too near the street. </trans></eg>
</sense>
<sense n=""6""><number>6</number><trans> <tr>near</tr>. </trans>
<eg><i lang=""ceb"">Apíki sa simbahan ang ámù,</i><trans> We live near the church. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B12; b(1)]</itype><trans> get to be <tr>short of</tr> space, money, time. </trans>
<eg><i lang=""ceb"">Ang pyánu nakaapíki (nakapaapíki) sa sála,</i><trans> The piano took up too much space in the living room. </trans></eg>
<eg><i lang=""ceb"">Hing-apikihan ku sa kwarta karun,</i><trans> I happen to be short of money now. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12b2]</itype><trans> press s.o. by not giving him time or room for maneuver. </trans>
<eg><i lang=""ceb"">Ayaw ku apikíha, dì lagi ku,</i><trans> Don’t try to force me. I told you I won’t. </trans></eg>
<eg><i lang=""ceb"">Dílì sila mubáyad ug dílì apikíhun,</i><trans> They won’t pay if you don’t press them. </trans></eg>
<eg><i lang=""ceb"">Naapikhan ku sa ahinti, mipalit na lang ku,</i><trans> The agent cornered me, so I just bought one.
</trans></eg>
</sense></hom></entry>");
