INSERT INTO `wced_entry` VALUES (1068, "apil", "51", "<entry page=""51"" id=""1068""><form id=""apil"" lang=""ceb"">apil</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> be <tr>included</tr>. </trans>
<eg><i lang=""ceb"">Ang ábang sitinta apil ang sugà,</i><trans> The rent is seventy including light. </trans></eg>
</sense></hom>
<entry><form id=""walay_apil_subject"" lang=""ceb"">walay <abbr expan=""apil"" type=""lemma"">—</abbr> <r>[<ix>subject</ix>]</r></form>
<hom>
<sense n=""0""><trans> [subject] is not included. </trans>
<eg><i lang=""ceb"">Wà kay apil sa dúlà,</i><trans> You are not included in the game. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; c1]</itype><trans> <tr>include</tr>, <tr>put</tr> s.t. with s.t. else. </trans>
<eg><i lang=""ceb"">Kinsay nag-apil sa ákung bulpin didtu sa sagbut?</i><trans> Who threw my ballpoint pen out with the trash? </trans></eg>
<eg><i lang=""ceb"">Apilun (iapil) ku ni ug lútù karung gabíi,</i><trans> I will include this in our dinner tonight. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B26; b6]</itype><trans> <tr>participate</tr>, <tr>take part</tr> in. </trans>
<eg><i lang=""ceb"">Muapil ka sa ámung dúlà?</i><trans> Will you take part in our game? </trans></eg>
<eg><i lang=""ceb"">Maapil ka unyà sa kasábà,</i><trans> You might get scolded as well. </trans></eg>
</sense></hom></entry>
<entry><form id=""apil-apil"" lang=""ceb"">apil-apil</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> include oneself when one shouldn’t. </trans>
