INSERT INTO `wced_entry` VALUES (1097, "apud", "52", "<entry page=""52"" id=""1097""><form id=""axpud"" lang=""ceb"">ápud</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b5c]</itype><trans> <tr>give each</tr>. </trans>
<eg><i lang=""ceb"">Apúrun (apúran) <pb n=""53""/>ta mu ug tagurha ka libru,</i><trans> I will give each of you two books. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B15]</itype><trans> to have [so-and-so-many] each. </trans>
<eg><i lang=""ceb"">Nag-ápud silag pusil,</i><trans> They each have a rifle. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A12]</itype><trans> be enough for each to have a share. </trans>
<eg><i lang=""ceb"">Kining prútas dílì makaápud kanátù,</i><trans> These fruits are not enough for all of us. </trans></eg>
</sense></hom>
<entry><form id=""mangaxpud"" lang=""ceb""><abbr expan=""mangápud"" type=""lemma"">maN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> cost one centavo each. </trans>
<eg><i lang=""ceb"">Ang dulsi mangápud,</i><trans> The candies are one centavo each. </trans></eg>
</sense></hom></entry>
<entry><form id=""pang-axpud"" lang=""ceb""><abbr expan=""pang-ápud"" type=""lemma"">pang-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>distribution</tr>. </trans>
<eg><i lang=""ceb"">Gipadayúnan ang pang-ápud sa humstid,</i><trans> They continued giving out homestead sites. </trans></eg>
</sense></hom></entry>
<entry><form id=""apud-apud"" lang=""ceb"">apud-apud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; c]</itype><trans> <tr>distribute</tr>, <tr>divide</tr> among. </trans>
<eg><i lang=""ceb"">Ang pusta giapud-apud sa daghang táwu,</i><trans> The bet was divided up among many people.
