INSERT INTO `wced_entry` VALUES (1108, "apupa", "53", "<entry page=""53"" id=""1108""><form id=""apuxpa"" lang=""ceb"">apúpa</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> in the <tr>path</tr> of s.t. that comes from a general direction: rain, wind, smell, etc. </trans>
<eg><i lang=""ceb"">Ang Sibu apúpa sa bagyu,</i><trans> Cebu is in the path of the storm. </trans></eg>
<eg><i lang=""ceb"">Apúpa ang ákung gilingkúran sa báhù,</i><trans> The place I’m sitting is right in the path of the smell. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B1256]</itype><trans> get into the path of. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[cP]</itype><trans> put in the path of. </trans>
<eg><i lang=""ceb"">Ayaw iapúpa (ipaapúpa) ang bátà dihà. Banlásan námù ang salug,</i><trans> Don’t put the child in the way of the water we are going to splash over the floor. </trans></eg>
</sense></hom>
<entry><form id=""paapuxpa"" lang=""ceb""><abbr expan=""paapúpa"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1c]</itype><trans> go into the path of. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> place oneself in full view of s.o. </trans>
<eg><i lang=""ceb"">Nagpaapúpa si Kurdaping sa mga laláki samtang nalígù,</i><trans> The fairy stood where the boys could look at him while he was bathing.
</trans></eg>
</sense></hom></entry></entry>");
