INSERT INTO `wced_entry` VALUES (1141, "*arasti", "54", "<entry page=""54"" id=""1141""><form id=""xxarasti"" lang=""ceb"">*arasti</form>
<entry><form id=""pangarasti"" lang=""ceb""><abbr expan=""pangarasti"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> venture to do s.t. which one is incapable of doing satisfactorily. </trans>
<eg><i lang=""ceb"">Nangarasti kag gubà niánà, ug karun unsa, dì na ka makaúlì?</i><trans> You took it on yourself to take that thing apart, and now you can’t get it back together again? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> take a long chance on s.t. </trans>
<eg><i lang=""ceb"">Pangarastíhi lang siyag hangyù. Básig musugut,</i><trans> Try and ask her. <pb n=""55""/>She might just agree.
