INSERT INTO `wced_entry` VALUES (1156, "argulya", "55", "<entry page=""55"" id=""1156""><form id=""argulya"" lang=""ceb"">argulya</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>metal ring</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> k.o. merry-go-round consisting of a wheel mounted on a pole from which metal chains with rings at the end dangle. To operate this contrivance the child holds on to a ring and runs around generating momentum until he can swing around holding on to the ring. Other children can ride by holding rings suspended from the other chains.
</trans>
</sense></hom></entry>");
