INSERT INTO `wced_entry` VALUES (1157, "argumintu", "55", "<entry page=""55"" id=""1157""><form id=""argumintu"" lang=""ceb"">argumintu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> arguments for or against s.t. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>argument</tr>, discussion. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; a12]</itype><trans> <tr>argue</tr> with s.o. about s.t. </trans>
<eg><i lang=""ceb"">Nagkaargumintu mi mahitungud sa báyad,</i><trans> We had an argument about the payment. </trans></eg>
<eg><i lang=""ceb"">Argumintúhun nátù ni ug dílì ta magkaúyun,</i><trans> We will argue this out if we can’t make each other see eye to eye.
</trans></eg>
</sense></hom></entry>");
