INSERT INTO `wced_entry` VALUES (1158, "ari", "55", "<entry page=""55"" id=""1158""><form id=""ari"" lang=""ceb"">ari</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>here</tr> (near speaker but not near person spoken to). </trans>
<eg><i lang=""ceb"">Ari ibutang ang lamísa,</i><trans> Put the table over here. </trans></eg>
<eg><i lang=""ceb"">Ari na mi,</i><trans> We’re on our way (lit. will be over here) now. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> let’s go over to the following point. </trans>
<eg><i lang=""ceb"">Karun ari ta sa ikaduhang ánib sa libru,</i><trans> Now, let’s turn to the second chapter of the book. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; c]</itype><trans> come over here, bring here. </trans>
<eg><i lang=""ceb"">Makaari ka sa Lúnis?</i><trans> Can you come over on Monday? </trans></eg>
<eg><i lang=""ceb"">Iari nákù ang bátà kay akuy bantay,</i><trans> Bring the child over here and I’ll watch (him). </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13; a2]</itype><trans> come to get. </trans>
<eg><i lang=""ceb"">Kinsa may mag-ari diri sa libru?</i><trans> Who is going to come here to get the book? </trans></eg>
<eg><i lang=""ceb"">Aria diri ang libru, kay dì ku makahatud,</i><trans> Come here to get the book, because I have no time to deliver it. </trans></eg>
</sense></hom>
<entry><form id=""umari_ka_marika"" lang=""ceb"">umari ka, marika</form>
<hom>
<sense n=""0""><trans> <tr>come here</tr> (said by superiors to inferiors). </trans>
<eg><i lang=""ceb"">Marika ra gud Pidung,</i><trans> Come here, Pedong. </trans></eg>
</sense></hom></entry>
<entry><form id=""axri"" lang=""ceb""><abbr expan=""ári"" type=""lemma"">(←)</abbr><sub>1</sub></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#ari""><sc>ari</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""hiari_haari"" lang=""ceb""><abbr expan=""hiari"" type=""lemma"">hi-</abbr>/<abbr expan=""haari"" type=""lemma"">ha-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256; b6]</itype><trans> wind up here. </trans>
</sense></hom></entry>
<entry><form id=""arian"" lang=""ceb"">arian</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> always come here. </trans>
</sense></hom></entry>
<entry><form id=""ariuxnun_alarixun"" lang=""ceb"">ariúnun, alaríun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> things one has to come here to get.
</trans>
</sense></hom></entry></entry>");
