INSERT INTO `wced_entry` VALUES (1160, "ariba1", "55", "<entry page=""55"" id=""1160""><form id=""arixba"" lang=""ceb"">aríba<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a percentage deducted by the operator of a gambling game from the proceeds of the winner. </trans>
<eg><i lang=""ceb"">Bayri úsà ang aríba arun makítag pilay limpiyu,</i><trans> Pay the <tr>rake-off</tr> first so we can determine the net winnings. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6(1)]</itype><trans> pay the owner his rake-off. </trans>
<eg><i lang=""ceb"">Aribáhan úsà nátù ang bulangan únà bahína ang daug,</i><trans> We’ll pay the arena’s percentage first before we divide the winnings. </trans></eg>
