INSERT INTO `wced_entry` VALUES (1165, "arigladu", "56", "<entry page=""56"" id=""1165""><form id=""ariglaxdu"" lang=""ceb"">arigládu</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>neat</tr>, orderly. </trans>
<eg><i lang=""ceb"">Arigládu siyang mamisti,</i><trans> She dresses neatly. </trans></eg>
<eg><i lang=""ceb"">Arigládu na ang ímung kwartu,</i><trans> Your room is in order now. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>prepared</tr>, ready. </trans>
<eg><i lang=""ceb"">Arigládu na ang papílis pára sa ímung byáhi,</i><trans> The papers for your trip are all in order. </trans></eg>
<eg><i lang=""ceb"">Arigládu na ang panihápun,</i><trans> Dinner is ready now. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> in agreement. </trans>
<eg><i lang=""ceb"">Arigládu na. Adtu ta ugmà,</i><trans> It’s all arranged. We’ll go tomorrow. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> for a quarrel to be settled. </trans>
<eg><i lang=""ceb"">Arigládu na ang ílang áway,</i><trans> Their fight is settled now. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number><trans> <tr>surely</tr>; it’s all right. </trans>
<eg><i lang=""ceb"">Makagáwì ku sa ímung tilipunu? Arigládu,</i><trans> May I use your phone? Surely. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> get neat, in order, reconciled.
</trans>
</sense></hom></entry>");
