INSERT INTO `wced_entry` VALUES (1166, "ariglar", "56", "<entry page=""56"" id=""1166""><form id=""arigla4r"" lang=""ceb"">ariglǎr</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>arrange</tr>, put in good order. </trans>
<eg><i lang=""ceb"">Tabángi ku pag-ariglǎr sa ákung buhuk,</i><trans> Help me fix my hair. </trans></eg>
<eg><i lang=""ceb"">Nakaariglǎr ka na ba sa ákung katri?</i><trans> Have you made my bed yet? </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> attend to, take care of. </trans>
<eg><i lang=""ceb"">Wà ku kapanglaba kay nag-ariglǎr ku sa mga bátà,</i><trans> I wasn’t able to do the washing because I was looking after the children. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A3; a12]</itype><trans> take charge of, <tr>assume responsibility for</tr>. </trans>
<eg><i lang=""ceb"">Ariglahun ku ang mga gastus sa ímung pag-iskuyla,</i><trans> I will take charge of your school expenses. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> <tr>settle</tr> a case, quarrel. </trans>
<eg><i lang=""ceb"">Ariglaha na lang ang inyung áway,</i><trans> Settle your dispute. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number> <itype>[a12]</itype><trans> beat s.o. up (lit. put him in order). </trans>
<eg><i lang=""ceb"">Ariglahun ta ning limbungan,</i><trans> Let’s beat this cheater up. </trans></eg>
</sense>
<sense n=""4b""><number>4b</number><trans> do away with s.o. </trans>
<eg><i lang=""ceb"">Giingun nga ariglahun si Bituy sa mga buguy,</i><trans> The thugs said they would liquidate Bitoy. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[AN; a12]</itype><trans> treat an illness with <ix>ariglǎr</ix>. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> treatment in folk medicine with special water made magic by having had a piece of paper with a magic formula (<ix>urasiyun</ix>) put into it. The water is either drunk or applied directly over the diseased part, and the person under this treatment is prohibited from uttering curse words. </trans>
</sense></hom>
<entry><form id=""pangarigla4r"" lang=""ceb""><abbr expan=""pangariglǎr"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> groom oneself nicely. </trans>
<eg><i lang=""ceb"">Nangariglǎr na siya kay mamisíta man ni Tíba,</i><trans> He is grooming himself carefully because he is going to visit Tiba.
</trans></eg>
</sense></hom></entry></entry>");
