INSERT INTO `wced_entry` VALUES (1184, "ariya1", "56", "<entry page=""56"" id=""1184""><form id=""arixya"" lang=""ceb"">aríya<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b7c1]</itype><trans> <tr>lower</tr>. </trans>
<eg><i lang=""ceb"">Ariyáhi ang písì ug dupa,</i><trans> Pay out a fathom of rope. </trans></eg>
<eg><i lang=""ceb"">Iaríya <pb n=""57""/>(ariyáha) na ang láyag,</i><trans> Lower the sail. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> <tr>unload cargo</tr>. </trans>
<eg><i lang=""ceb"">Iaríya na ang mga kargang humay,</i><trans> The rice cargo will be unloaded now. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> <tr>throw overboard</tr>. </trans>
<eg><i lang=""ceb"">Iaríya tanang mga karga arun masalbar ta,</i><trans> Throw the cargo overboard so that we may be saved. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[a2]</itype><trans> <tr>come out</tr>, be released. </trans>
<eg><i lang=""ceb"">Miaríya na ang tumatub,</i><trans> The bag of waters has broken. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; c]</itype><trans> <tr>dispose</tr> of s.t. by sale. </trans>
<eg><i lang=""ceb"">Iaríya dáyun ang abut inigprisyu,</i><trans> Sell the produce at once when the price rises. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A; c]</itype><trans> <tr>move</tr> from one place to another. </trans>
<eg><i lang=""ceb"">Muaríya mi íning baláya kay mahal ug ábang,</i><trans> We will move from this house because the rent is too high.†
</trans></eg>
</sense></hom></entry>");
