INSERT INTO `wced_entry` VALUES (1223, "artipisyal", "58", "<entry page=""58"" id=""1223""><form id=""artipisyal"" lang=""ceb"">artipisyal</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>artificial</tr>, affected and not natural. </trans>
<eg><i lang=""ceb"">Dalágang syudadnun nga púlus artipisyal ang panglihuk,</i><trans> City girls that always put on. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> not naturally occurring, <tr>contrived</tr>. </trans>
<eg><i lang=""ceb"">Ang kangihit sa humay artipisyal dílì tungud sa húlaw,</i><trans> The scarcity of rice is artificial and not due to the drought. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; a12]</itype><trans> become, make artificial.
