<sense n=""0""><trans> spiny shrub or small tree similar to <ix>ipil-ipil,</ix> used for firewood. Said to be the plant from which Christ’s crown of thorns was made: <bio>Acacia farnesiana</bio>.
</trans>
</sense></hom></entry>");
