INSERT INTO `wced_entry` VALUES (1231, "arun2", "58", "<entry page=""58"" id=""1231""><form id=""arun2"" lang=""ceb"">arun<sub>2</sub></form>
<hom>
<sense n=""0""><trans> (from <ix>karun</ix>) </trans>
</sense>
