INSERT INTO `wced_entry` VALUES (1233, "arunsa", "58", "<entry page=""58"" id=""1233""><form id=""arunsa"" lang=""ceb"">arunsa</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> <tr>move</tr>, move s.t. over. </trans>
<eg><i lang=""ceb"">Iarunsa ngari ang kahun,</i><trans> Move the box this way. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B]</itype><trans> <tr>advance</tr>, <tr>progress</tr>. </trans>
<eg><i lang=""ceb"">Muarunsa ang táwu ug magkúgi,</i><trans> A person who works hard will prosper. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b7c1]</itype><trans> <tr>advance</tr>, <tr>move</tr> s.t. ahead in time. </trans>
<eg><i lang=""ceb"">Arunsáhun (iarunsa, arunsáhan) nátù ang adlaw sa kasal,</i><trans> Let us advance the date of the marriage. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B]</itype><trans> become more and more. </trans>
<eg><i lang=""ceb"">Nag-arunsa siya pagkaabusáda,</i><trans> She is getting more and more abusive. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[APB; b7c1]</itype><trans> <tr>raise</tr>, <tr>rise</tr>. </trans>
<eg><i lang=""ceb"">Muabut na ang bag-u nátung isták, mag-arunsa (magpaarunsa) ta sa prisyu,</i><trans> When the new stock arrives, let’s raise the price. </trans></eg>
<eg><i lang=""ceb"">Muarunsa ang prisyu sa humay,</i><trans> The price of rice will rise. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>progress</tr>, <tr>advancement</tr>. </trans>
<eg><i lang=""ceb"">Gamay ang arunsa sa íyang swildu,</i><trans> He received a very small increase in pay.
</trans></eg>
</sense></hom></entry>");
