<entry><form id=""igpangaasawa"" lang=""ceb""><abbr expan=""igpangaasawa"" type=""lemma"">igpaN-r-(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. used for marriage. </trans>
<eg><i lang=""ceb"">Ang kang Lúlit ang gugma igpapangasawa,</i><trans> As far as Lolet was concerned love (i.e. sex) was s.t. reserved for marriage. </trans></eg>
<eg><i lang=""ceb"">Igpapangasawa ning bábuy,</i><trans> This pig is to be slaughtered at his wedding. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> desirous of getting married. </trans>
<eg><i lang=""ceb"">Igpapangasawa na kaáyu ang ákung ginháwa,</i><trans> I am very ready to get married. </trans></eg>
</sense></hom></entry>
<entry><form id=""pangasaw-unun_pangalasaw-un"" lang=""ceb"">pangasaw-unun, pangalasaw-un</form>
<hom>
<sense n=""0""><trans> <tr>wife-to-be</tr>.†
