INSERT INTO `wced_entry` VALUES (1255, "asi", "59", "<entry page=""59"" id=""1255""><form id=""axsi"" lang=""ceb"">ási</form>
<hom>
<sense n=""1""><number>1</number><trans> expression needling a person for pretending. </trans>
<eg><i lang=""ceb"">Ási, patulugtúlug. Bákun na dihà,</i><trans> <pb n=""60""/>Ha, pretending to sleep, are you? Get up! </trans></eg>
<eg><i lang=""ceb"">Ási, padilìdílì, apan gustu uruy,</i><trans> Ha, you pretend you don’t want any, but you do. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> chiding a person jokingly for s.t. one notices for the first time. </trans>
<eg><i lang=""ceb"">Ási, bag-u ta run ug sapátus,</i><trans> My! I see we have new shoes today. </trans></eg>
<eg><i lang=""ceb"">Ási, kúyug man lagi ka,</i><trans> Ah, I see you are going out with him! </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> chiding a person for acting beyond his station. </trans>
<eg><i lang=""ceb"">Ási, pasugùsúgù pa man siya nákù!</i><trans> Hey! Where do you get off ordering me around! </trans></eg>
</sense></hom>
<entry><form id=""asiasi"" lang=""ceb"">asiasi</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b5]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> rush in to do s.t. without thought. </trans>
<eg><i lang=""ceb"">Dì ni maáyung asiasihung (asiasihang) trabahúa,</i><trans> This isn’t the sort of thing you should rush in to do without thinking. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> presume to do s.t., taking a person for granted. </trans>
<eg><i lang=""ceb"">Nag-asiasi ka lang ug kúhà sa ákung mangga sa way pupananghid nákù,</i><trans> You presumed to take a mango without bothering to ask my permission. </trans></eg>
<eg><i lang=""ceb"">Dì nà nímu maasiasing tawhána,</i><trans> He isn’t the sort of man you can take for granted (rush into doing anything you want him to do on the spur of the moment). </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AP; b5]</itype><trans> presume to do s.t. one cannot do. </trans>
<eg><i lang=""ceb"">Nag-asiasi (nagpaasiasi) ka mang mag-istrungkar íning makinilya. Na karun, iúlì,</i><trans> You presumed to take the typewriter apart. Now let’s see you put it back together. </trans></eg>
</sense></hom></entry>
<entry><form id=""manggiasiasihun_maasiasihun_asiasihun"" lang=""ceb"">manggiasiasihun, maasiasihun, asiasihun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>presumptuous</tr>, <tr>taking for granted</tr>.
</trans>
</sense></hom></entry></entry>");
