INSERT INTO `wced_entry` VALUES (1292, "asu", "61", "<entry page=""61"" id=""1292""><form id=""asu"" lang=""ceb"">asu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>smoke</tr>. </trans>
<eg><i lang=""ceb"">Way asu nga makumkum,</i><trans> You can’t hide smoke in your fist. (No secret can be kept for long.) </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>fumes</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A]</itype><trans> give off smoke, fumes. </trans>
<eg><i lang=""ceb"">Ngánung nag-asu man ang dapug?</i><trans> Why is the hearth giving off smoke? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b4]</itype><trans> be in path of smoke. </trans>
<eg><i lang=""ceb"">Ayawg dáub dihà kay maasuhan mi diri,</i><trans> Don’t build a fire there because we’re right in the path of the smoke. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B1246]</itype><trans> go up in smoke, be for naught. </trans>
<eg><i lang=""ceb"">Ang kwartang gigugul nímu naasu lang,</i><trans> The money you invested was for naught. </trans></eg>
</sense></hom>
<entry><form id=""paasu"" lang=""ceb""><abbr expan=""paasu"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> <tr>fumigate</tr>, apply smoke to plants to make them bear. </trans>
<eg><i lang=""ceb"">Paasuhi ang mangga arun mamúwak,</i><trans> Smoke the mango tree so it will bloom. </trans></eg>
</sense></hom></entry>
<entry><form id=""asuasu"" lang=""ceb"">asuasu</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A]</itype><trans> give off smoke continuously. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A3; b(1)]</itype><trans> come fast and thick, in rapid succession. </trans>
<eg><i lang=""ceb"">Miasuasu ang íyang kúmù,</i><trans> The blows from his fists came fast and furiously. </trans></eg>
</sense></hom></entry>
<entry><form id=""alasuxhan"" lang=""ceb"">alasúhan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> exposed to smoke. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>chimney</tr>.
</trans>
</sense></hom></entry></entry>");
