INSERT INTO `wced_entry` VALUES (1293, "asud", "61", "<entry page=""61"" id=""1293""><form id=""axsud"" lang=""ceb"">ásud</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2C; ac]</itype><trans> for two or more people to pound cereal in mortar together and in synchronization. </trans>
<eg><i lang=""ceb"">Asúra (iásud) ang mga lubuk,</i><trans> Do your pounding alternately—when one lifts, the other comes down. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13; b(1)]</itype><trans> come one after another in rapid succession, like several people pounding rice on one pestle. </trans>
<eg><i lang=""ceb"">Nag-ásud ang pangutána sa mga piryudista,</i><trans> The newspapermen’s questions came in rapid succession. </trans></eg>
<eg><i lang=""ceb"">Giasúran ug haluk ang bátà sa mga dalága,</i><trans> The girls smothered the baby with kisses. </trans></eg>
</sense></hom>
<entry><form id=""asud-asud"" lang=""ceb"">asud-asud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; b(1)]</itype><trans> = <xr lang=""ceb"" target=""#axsud""><sc>ásud</sc></xr>, <ix>2.</ix>
</trans>
</sense></hom></entry></entry>");
