INSERT INTO `wced_entry` VALUES (1330, "atak", "62", "<entry page=""62"" id=""1330""><form id=""axtak"" lang=""ceb"">átak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[APB3(1); a]</itype><trans> for s.t. which is of some weight and attached to s.t. to fall off. </trans>
<eg><i lang=""ceb"">Ug muátak (mupaátak) kug búnga, bantayig ása tugdun,</i><trans> If I knock one down, watch where it lands. </trans></eg>
<eg><i lang=""ceb"">Naátak sa kaínit ang mga tuytuy,</i><trans> The buds fell off the tree because of the heat. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B12; b8]</itype><trans> for the eyes to bulge out, a symptom of a fatal disease caused by sorcery. </trans>
<eg><i lang=""ceb"">Namatay siya. Naatákan man sa mata,</i><trans> He died because he got the bulging eye disease.
