INSERT INTO `wced_entry` VALUES (1332, "ataki", "62", "<entry page=""62"" id=""1332""><form id=""ataxki"" lang=""ceb"">atáki</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>attack</tr>, assault. </trans>
<eg><i lang=""ceb"">Atakíhun nátù ang Hapun,</i><trans> We will attack the Japanese. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12b2]</itype><trans> attack s.o. personally. </trans>
<eg><i lang=""ceb"">Ug manuburnu ka atakíhun ka sa mga piryudista,</i><trans> If you give bribes, the newspapers will attack you. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[a12]</itype><trans> be attacked by a sickness. </trans>
<eg><i lang=""ceb"">Giatáki sa kasingkásing si Pápa,</i><trans> Dad had a heart attack. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> attack, assault on s.t. </trans>
</sense>
<sense n=""2""><number>2</number><trans> attack of a disease. </trans>
</sense></hom>
<entry><form id=""ataxki_silibra4r"" lang=""ceb""><abbr expan=""atáki"" type=""lemma"">—</abbr> silibrǎr</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> cerebral thrombosis.
