INSERT INTO `wced_entry` VALUES (1334, "atang", "63", "<entry page=""63"" id=""1334""><form id=""atang"" lang=""ceb"">atang</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b(1)]</itype><trans> <tr>watch</tr>, but not carefully, keep an eye on. </trans>
<eg><i lang=""ceb"">Atngi (atangi) ang linung-ag arun dílì muáwas,</i><trans> Keep an eye on the rice so it won’t boil over. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b(1)]</itype><trans> watch for s.t. or s.o. to pass. </trans>
<eg><i lang=""ceb"">Ímu tang atngan ang trák arun makasakay ta,</i><trans> You should watch for the bus so that we can get on. </trans></eg>
</sense></hom>
<entry><form id=""axtang"" lang=""ceb""><abbr expan=""átang"" type=""lemma"">(←)</abbr><sub>1</sub></form>
<hom>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> <tr>ambush</tr>. </trans>
<eg><i lang=""ceb"">Ang mga girilya nag-átang sa mga Hapun,</i><trans> The guerillas are ambushing the Japanese. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2N]</itype><trans> meet one’s girl friend at her place of work or study to accompany her. </trans>
<eg><i lang=""ceb"">Túa siya nangátang sa íyang trátu,</i><trans> There he is, waiting for his girl friend to bring her home. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>ambush</tr>.
