INSERT INTO `wced_entry` VALUES (1342, "atay-atay", "63", "<entry page=""63"" id=""1342""><form id=""atay-axtay"" lang=""ceb"">atay-átay</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> pit of the stomach. </trans>
</sense>
<sense n=""2""><number>2</number><trans> the hollow or fleshy part of the palm and its analogue in the foot. </trans>
<eg><i lang=""ceb"">Natunuk siya sa atay-átay sa íyang tiil,</i><trans> He got a thorn in the arch of his sole. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> k.o. ornamental shrub with mottled red or green elliptic leaves and smooth margins: <bio>Graptophyllum pictum</bio>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3; a12]</itype><trans> be hit on the solar plexus or on the fleshy part of the palm or sole of the foot.†
</trans>
</sense></hom></entry>");
