INSERT INTO `wced_entry` VALUES (1345, "atbu", "63", "<entry page=""63"" id=""1345""><form id=""atbu"" lang=""ceb"">atbu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6P]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for emotions to surge up and burst forth. </trans>
<eg><i lang=""ceb"">Miatbu ang ákung kalípay,</i><trans> My heart leaped with happiness. </trans></eg>
<eg><i lang=""ceb"">Bantay. Hiatbuhan ka unyà sa ákung kasukù,</i><trans> Watch out. I’ll blow up in anger at you. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for very fine particles to fly up and be scattered in the air. </trans>
<eg><i lang=""ceb"">Nag-atbu ang duldul sa unlan,</i><trans> The kapok flew out of the pillow. </trans></eg>
<eg><i lang=""ceb"">Giatbúhan (gipaatbúhan) lang ku níya sa asu. Wà giyud mutubag,</i><trans> He just blew smoke in my face. He didn’t reply at all.
</trans></eg>
</sense></hom></entry>");
