<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> fly up in thick quantities. </trans>
<eg><i lang=""ceb"">Miatbug ang lángaw pag-itsa nákù sa basúra,</i><trans> The flies rose in a swarm when I threw out the garbage. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for emotions to burst forth.
</trans>
</sense></hom></entry>");
