INSERT INTO `wced_entry` VALUES (1349, "atik", "64", "<entry page=""64"" id=""1349""><form id=""axtik"" lang=""ceb"">átik</form>
<hom>
<sense n=""0""><trans> (from <ix>bulátik</ix>) </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> show-off, <tr>boastful</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AP; b6]</itype><trans> get s.t. from s.o. by flattery or other verbal chicanery. </trans>
<eg><i lang=""ceb"">Kahibáwu siyang muátik (mupaátik) ni Lúla,</i><trans> He’s good at getting things out of Grandma. </trans></eg>
<eg><i lang=""ceb"">Ayawg hátag kay giatíkan ka lang,</i><trans> Don’t give him any. He’s just putting you on to get s.t. from you. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. said to get s.t. from s.o. </trans>
</sense>
<sense n=""2""><number>2</number><trans> pocket money (slang). </trans>
</sense></hom>
<entry><form id=""atik-axtik"" lang=""ceb"">atik-átik</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#axtik""><sc>átik</sc></xr>, <ix>v</ix>. </trans>
</sense></hom></entry>
<entry><form id=""paaxtik"" lang=""ceb""><abbr expan=""paátik"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#axtik""><sc>átik</sc></xr>. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> show off. </trans>
<eg><i lang=""ceb"">Ipaátik níya ang bag-u níyang kutsi,</i><trans> He will show off his new car.
</trans></eg>
</sense></hom></entry></entry>");
