INSERT INTO `wced_entry` VALUES (1365, "atraka", "64", "<entry page=""64"" id=""1365""><form id=""atraxka"" lang=""ceb"">atráka</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>get close</tr> to s.t. not easy to approach. </trans>
<eg><i lang=""ceb"">Mu rag dílì muatráka sa kaláyu ang mga bumbíru,</i><trans> It looks as though the firemen will not get close to the fire. </trans></eg>
<eg><i lang=""ceb"">Dì ku kaatráka níya kay dátù,</i><trans> I feel ashamed to <tr>approach</tr> her because she is rich. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> attack a job with dispatch. </trans>
<eg><i lang=""ceb"">Ug dílì ka muatráka sa trabáhu, wà kay umintu,</i><trans> If you don’t do your work with dispatch, you won’t make progress. </trans></eg>
<eg><i lang=""ceb"">Atrakáha lang siya pagpaningil,</i><trans> Get in there and press her to pay you. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; a12]</itype><trans> hold one’s own in a conversation. </trans>
<eg><i lang=""ceb"">Burung. Dì kaatrákag kukabildu,</i><trans> She lacks social grace. She can’t keep a conversation going.
</trans></eg>
</sense></hom></entry>");
