INSERT INTO `wced_entry` VALUES (1368, "atras", "64", "<entry page=""64"" id=""1368""><form id=""atras"" lang=""ceb"">atras</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>rear wheel</tr>. </trans>
<eg><i lang=""ceb"">Nahyúsan mi sa atras,</i><trans> We had a flat tire in the rear. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>rear</tr> part of vehicles. </trans>
<eg><i lang=""ceb"">Adtu ikarga sa atras,</i><trans> Load it in the back. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>reverse gear</tr>. </trans>
<eg><i lang=""ceb"">Ang kambiyu dílì musulud sa atras,</i><trans> The gear won’t shift into reverse. </trans></eg>
</sense></hom>
<entry><form id=""atras_abanti"" lang=""ceb""><abbr expan=""atras"" type=""lemma"">—</abbr> abanti</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> sewing machine capable of forward and backward movement. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>back up</tr> a vehicle. </trans>
<eg><i lang=""ceb"">Iatras ang trák,</i><trans> Back the truck up. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>back out</tr> of an agreement. </trans>
<eg><i lang=""ceb"">Dì ku muatras sa átung sábut,</i><trans> I will not back out of our agreement. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>give way</tr>, back off from. </trans>
<eg><i lang=""ceb"">Dì ta ka atrásan,</i><trans> I won’t <pb n=""65""/>give ground to you.†
</trans></eg>
</sense></hom></entry></entry>");
