INSERT INTO `wced_entry` VALUES (1372, "atrasu", "65", "<entry page=""65"" id=""1372""><form id=""atraxsu"" lang=""ceb"">atrásu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AP; a12P]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#atrasar""><sc>atrasar</sc></xr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> cause s.t. to become delayed or get behindhand in fulfilling an obligation. </trans>
<eg><i lang=""ceb"">Ug maatrásu ta ug duha ka adlaw, dakù ang multa,</i><trans> There is a big fine if you are two days delinquent. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A12]</itype><trans> have done a wrong to s.o. which requires retribution. </trans>
<eg><i lang=""ceb"">Nakaatrásu ka nákù, panimaslan ta ka,</i><trans> You have done me a wrong. I’ll get revenge. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number><trans> have a debt which one has failed to pay. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1a""><number>1a</number><trans> <tr>delay</tr>. </trans>
<eg><i lang=""ceb"">Ang atrásu nakapaalkansi námug dakù,</i><trans> The delay caused us great loss. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> fine imposed for a delay. </trans>
</sense>
<sense n=""2""><number>2</number><trans> wrong done to s.o. </trans>
<eg><i lang=""ceb"">Unsay atrásu nákù nímu?</i><trans> What wrong have I done you?
</trans></eg>
</sense></hom></entry>");
