INSERT INTO `wced_entry` VALUES (1374, "atribir", "65", "<entry page=""65"" id=""1374""><form id=""atribir"" lang=""ceb"">atribir</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3]</itype><trans> do s.t. one has no business doing. </trans>
<eg><i lang=""ceb"">Kinsay nag-atribir ug arangka niíni?</i><trans> Who went and took this apart? </trans></eg>
</sense></hom>
<entry><form id=""pangatribir"" lang=""ceb""><abbr expan=""pangatribir"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""><trans> touch s.t. one has no business touching, mix into things not of one’s business. </trans>
<eg><i lang=""ceb"">Nangatribir ka pud sa ákung butang, ha?</i><trans> So you dared to touch my things, did you? </trans></eg>
</sense></hom></entry>
<entry><form id=""atribixdu"" lang=""ceb"">atribídu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> doing things one has no business doing. </trans>
<eg><i lang=""ceb"">Atribídu ka bisag dílì kamau,</i><trans> You take it on yourself even if you don’t know how. </trans></eg>
<eg><i lang=""ceb"">Atribídu ka sa mga áway bisag wà kay lábut,</i><trans> You mix into quarrels that are none of your business. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> get to be <ix>atribídu.</ix>
</trans>
</sense></hom></entry></entry>");
