INSERT INTO `wced_entry` VALUES (1383, "atsay1", "65", "<entry page=""65"" id=""1383""><form id=""atsay"" lang=""ceb"">atsay<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>kept woman</tr>, <tr>paramour</tr> (coarse). </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>maid of all work</tr>, <tr>servant</tr> (coarse). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A12B; a2]</itype><trans> become a mistress, manage to get a mistress. </trans>
<eg><i lang=""ceb"">Nakaatsay na kug mistísa, Dung,</i><trans> Let me tell you, son, I have already had a mistress of Spanish blood. </trans></eg>
<eg><i lang=""ceb"">Giatsayan ka lang nákù. Tinúud kung asáwa, arun ka masáyud,</i><trans> You think I’m your mistress? Well, in case you didn’t know, I’m your wife. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3; a2]</itype><trans> be paid female help. </trans>
<eg><i lang=""ceb"">Nakaatsay na ku sa tagasinyur istap,</i><trans> I’ve already tasted what it’s like to be a helper to the Senior Staff.
</trans></eg>
</sense></hom></entry>");
