INSERT INTO `wced_entry` VALUES (1392, "atub1", "65", "<entry page=""65"" id=""1392""><form id=""axtub"" lang=""ceb"">átub<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> stone prison cell. </trans>
</sense>
<sense n=""2""><number>2</number><trans> pile of stones put s.w. to attract fish and crabs and get them where they can be readily found. </trans>
</sense>
<sense n=""3""><number>3</number><trans> pit with a flimsy top for trapping animals. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A1; a]</itype><trans> construct an <ix>átub.</ix> </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A2N; a1]</itype><trans> trap in a pitfall. </trans>
<eg><i lang=""ceb"">Nakaátub (nakapangátub) mig bábuy ihálas,</i><trans> We trapped a wild pig in <pb n=""66""/>a pitfall.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (1392, "átub", "atub", "s", "nv");
INSERT INTO `wced_entry` VALUES (1393, "atub2", "66", "<entry page=""66"" id=""1393""><form id=""axtub2"" lang=""ceb"">átub<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b5]</itype><trans> <tr>soak</tr> maguey leaves in the sea to soften them. </trans>
<eg><i lang=""ceb"">Atúban (atúbun) ang magay unyà labhan,</i><trans> Maguey leaves are soaked and the flesh is washed off.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (1393, "átub", "atub", "s", "v");
