INSERT INTO `wced_entry` VALUES (1394, "atub3", "66", "<entry page=""66"" id=""1394""><form id=""axtub3"" lang=""ceb"">átub<sub>3</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3; b6]</itype><trans> fall in great quantities. </trans>
<eg><i lang=""ceb"">Miátub ang bumba sa syudad,</i><trans> Bombs rained on the city. </trans></eg>
<eg><i lang=""ceb"">Nag-átub ang ulan,</i><trans> The rain was pouring down. </trans></eg>
</sense></hom>
<entry><form id=""paaxtub"" lang=""ceb""><abbr expan=""paátub"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> expose oneself to a downpour. </trans>
</sense>
<sense n=""2""><number>2</number><trans> expose oneself to danger. </trans>
<eg><i lang=""ceb"">Hiilugan ka sa búlag magpaátub ka,</i><trans> They’ll get the ball away from you if you just stand there.
</trans></eg>
</sense></hom></entry></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (1394, "átub", "atub", "s", "v");
