INSERT INTO `wced_entry` VALUES (1396, "atud", "66", "<entry page=""66"" id=""1396""><form id=""axtud"" lang=""ceb"">átud</form>
<hom>
<sense n=""0""><trans> particle showing displeasure (euphemism for <ix>giátay</ix>). </trans>
