INSERT INTO `wced_entry` VALUES (1398, "atug-atug", "66", "<entry page=""66"" id=""1398""><form id=""atug-atug"" lang=""ceb"">atug-atug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AP; a]</itype><trans> presume to take responsibility or present oneself and one’s services unasked. </trans>
<eg><i lang=""ceb"">Nakaatug-atug (nakapaatug-atug) si Píli pagtábang sa táwu kay nalúuy siya,</i><trans> Fely forced her help on the man unasked because she pitied him.
</trans></eg>
</sense></hom></entry>");
