INSERT INTO `wced_entry` VALUES (1399, "atul", "66", "<entry page=""66"" id=""1399""><form id=""atul"" lang=""ceb"">atul</form>
<hom>
<sense n=""0""><trans> <tr>coincide</tr> in time. </trans>
<eg><i lang=""ceb"">Ang íyang adlaw atul sa bag-ung túig,</i><trans> His birthday coincides with New Year’s. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2C; c1]</itype><trans> do s.t. at the same time as s.t. else happens. </trans>
<eg><i lang=""ceb"">Dì ka muatul ug labang ug dúnay awtung muági,</i><trans> Do not cross at the same time that there’s a car coming. </trans></eg>
<eg><i lang=""ceb"">Nag-átul mig pamisíta sa ka Lusing,</i><trans> We happened to visit Lucing at the same time. </trans></eg>
<eg><i lang=""ceb"">Atulun (iatul) nílag pangáun ang pamisíta,</i><trans> They make their visits coincide with mealtime. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b2]</itype><trans> for s.t. to happen to one coincidentally with s.t. else. </trans>
<eg><i lang=""ceb"">Hiatlan mig ulan sa Magalyánis,</i><trans> We were caught in the rain downtown. </trans></eg>
<eg><i lang=""ceb"">Naatlan níya si Bin nga bugnaw ang úlu,</i><trans> This time, she chanced to come on Ben while he was cool-headed.
</trans></eg>
</sense></hom></entry>");
