INSERT INTO `wced_entry` VALUES (1412, "aw, aw", "67", "<entry page=""67"" id=""1412""><form id=""aw_aqw"" lang=""ceb"">aw, àw</form>
<hom>
<sense n=""1""><number>1</number><trans> particle preceding a statement made to correct oneself. </trans>
<eg><i lang=""ceb"">Tagdus písus, aw, dus singkwinta diay,</i><trans> It’s two, I mean, two-fifty. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> particle preceding an afterthought. </trans>
<eg><i lang=""ceb"">Aw kanà lang diay, ímu na nà,</i><trans> Oh that. You can have that. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> particle preceding a statement or question meaning ‘is that so?’ and shows surprise. </trans>
<eg><i lang=""ceb"">Aw, mau diay nà?</i><trans> Oh! Is that so! </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> pause word before starting to speak. </trans>
<eg><i lang=""ceb"">Aw, makahímù ba tag gáwì sa ímung tilipunu?</i><trans> Er, may I use your phone? </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> particle preceding a predetermined answer: ‘of course’. </trans>
<eg><i lang=""ceb"">Aw, ú. Mabalibáran ba gud nà nákù?</i><trans> Yes, of course. How could I refuse that!
</trans></eg>
</sense></hom></entry>");
