INSERT INTO `wced_entry` VALUES (1414, "awa2", "67", "<entry page=""67"" id=""1414""><form id=""axwaq2"" lang=""ceb"">áwà<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B126; b5c1]</itype><trans> <tr>envy</tr>, be jealous. </trans>
<eg><i lang=""ceb"">Ngánung maáwà ka man sa ímung igsúun?</i><trans> Why should you be jealous of your sister? </trans></eg>
<eg><i lang=""ceb"">Makaáwà man nang ímung kahimtang,</i><trans> Your circumstances inspire envy. </trans></eg>
<eg><i lang=""ceb"">Dílì man nà ángay awáun (awáan, iáwà),</i><trans> That is not worth envying. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1; b5c1]</itype><trans> <tr>be worried</tr>. </trans>
<eg><i lang=""ceb"">Mag-áwà man ka nga wà may nahinabù?</i><trans> Why are you worried when nothing terrible has happened?
