INSERT INTO `wced_entry` VALUES (1424, "away", "68", "<entry page=""68"" id=""1424""><form id=""axway"" lang=""ceb"">áway</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC; a12b3]</itype><trans> <tr>quarrel</tr>, <tr>fight</tr>. </trans>
<eg><i lang=""ceb"">Awáyun ta ka run,</i><trans> I will quarrel with you. </trans></eg>
<eg><i lang=""ceb"">Ug dì madalag sulti, átù ning awáyun,</i><trans> We’ll fight it out if we can’t talk it out. </trans></eg>
<eg><i lang=""ceb"">Unsa may inyung giawáyan?</i><trans> What are you two quarreling about? </trans></eg>
<eg><i lang=""ceb"">Ang pátag nga ílang gipanag-awáyan,</i><trans> The plains where they did battle. </trans></eg>
