<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>sing</tr>. </trans>
<eg><i lang=""ceb"">Unsa may íyang awítun?</i><trans> What will she sing? </trans></eg>
<eg><i lang=""ceb"">Awítan ta ka,</i><trans> I will sing you a song. </trans></eg>
