<sense n=""2""><number>2</number> <itype>[A2; b6]</itype><trans> <tr>sing</tr>, <tr>squeal</tr> (slang). </trans>
<eg><i lang=""ceb"">Hibaw-an na mung tanan kay nakaáwit na ang dinakpan,</i><trans> You are all known because the suspect has squealed. </trans></eg>
