INSERT INTO `wced_entry` VALUES (1455, "awug1", "68", "<entry page=""68"" id=""1455""><form id=""axwug"" lang=""ceb"">áwug<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3; c]</itype><trans> <tr>furnish</tr> s.t. for free or as a privilege. </trans>
<eg><i lang=""ceb"">Giawgan siyag dyip sa gubyirnu,</i><trans> The government furnishes him with a jeep. </trans></eg>
<eg><i lang=""ceb"">Walay buhis ang mga baligyang iáwug sa Amirika sa íyang mga sundálu,</i><trans> The goods <pb n=""69""/>that America furnishes her soldiers are tax-free.
</trans></eg>
</sense></hom></entry>");
