INSERT INTO `wced_entry` VALUES (1461, "awut1", "69", "<entry page=""69"" id=""1461""><form id=""axwut"" lang=""ceb"">áwut<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> be out in a ball game. </trans>
</sense>
<sense n=""2""><number>2</number><trans> be out of a place, out of stock, etc. </trans>
</sense></hom>
<entry><form id=""axwut_ab_bawuns_axwut_ab_lak_axwut_ab_istak_etc."" lang=""ceb""><abbr expan=""áwut"" type=""lemma"">—</abbr> ab bawuns, <abbr expan=""áwut ab lak"" type=""lemma"">lak</abbr>, <abbr expan=""áwut ab istak"" type=""lemma"">istak</abbr>, etc.</form>
<hom>
<sense n=""0""><trans> out of bounds, luck, stock, etc. </trans>
<eg><i lang=""ceb"">Awut ab <corr sic=""tápic"">tápik</corr> ka,</i><trans> You are out of order, off the subject. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3P; a2]</itype><trans> make s.o. or s.t. out in ball games. </trans>
<eg><i lang=""ceb"">Nakaáwut na ang pitsir ug duha,</i><trans> The pitcher has already struck two batters out. </trans></eg>
<eg><i lang=""ceb"">Hiawtan silag duha,</i><trans> They have had two outs. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B56]</itype><trans> get to be out of a place, out of luck, stock, etc. </trans>
<eg><i lang=""ceb"">Muáwut ku ugmà,</i><trans> I’ll get out of this place tomorrow. </trans></eg>
<eg><i lang=""ceb"">Maáwut ang búla,</i><trans> The ball will go out of bounds.
</trans></eg>
</sense></hom></entry></entry>");
