INSERT INTO `wced_entry` VALUES (1466, "ay1", "69", "<entry page=""69"" id=""1466""><form id=""ay"" lang=""ceb"">ay<sub>1</sub></form>
<hom>
<sense n=""1""><number>1</number><trans> expression dismissing what follows as unimportant. </trans>
<eg><i lang=""ceb"">Ay kanà, ihátag na lang nà,</i><trans> Oh that! Just give it away. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> particle showing exasperation or frustrated helplessness. </trans>
<eg><i lang=""ceb"">Ay, Inday. Wà pa giyud ka makat-un?</i><trans> Goodness, my dear. Can’t you ever learn? </trans></eg>
<eg><i lang=""ceb"">Ay, ulahi ka na, nahurut na ug kahálin,</i><trans> Oh you are too late. They’re all sold out. </trans></eg>
<eg><i lang=""ceb"">Ay, kapait ning kinabuhía,</i><trans> My, how difficult life is. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> particle preceding an exclamation of delight. </trans>
<eg><i lang=""ceb"">Ay, kanindut sa búlak!</i><trans> Oh, what a beautiful flower.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (1466, "ay", "ay", "s", "");
INSERT INTO `wced_entry` VALUES (1467, "ay2", "69", "<entry page=""69"" id=""1467""><form id=""ay2"" lang=""ceb"">ay<sub>2</sub></form>
<hom>
<sense n=""0""><trans> particle following s.t. which calls attention to s.t. </trans>
<eg><i lang=""ceb"">Si Pidru ay, Mam. Nanghíwì nákù,</i><trans> Teacher, Pedro was making faces at me. </trans></eg>
<eg><i lang=""ceb"">Pagkabuta nímu. Túa sa iskína ay,</i><trans> How blind you are! It’s right there at the corner! </trans></eg>
<eg><i lang=""ceb"">Kining bataána ay. Nagsígi lag dúlag lápuk,</i><trans> My, this child. He keeps playing in the mud. </trans></eg>
</sense></hom>
<entry><form id=""uxnu_dus_ay_tris"" lang=""ceb"">únu, dus, <abbr expan=""ay"" type=""lemma"">—</abbr>, tris</form>
<hom>
<sense n=""0""><trans> one, two, three, go!
</trans>
</sense></hom></entry></entry>");
