INSERT INTO `wced_entry` VALUES (1470, "-ay1", "69", "<entry page=""69"" id=""1470""><form id=""x-ay"" lang=""ceb"">-ay<sub>1</sub></form>
<hom>
<sense n=""0""><trans> affix forming verbs which refer </trans>
</sense>
<sense n=""1""><number>1</number><trans> to reciprocal actions. </trans>
<eg><i lang=""ceb"">Naglalisay sila,</i><trans> They argued back and forth. </trans></eg>
<eg><i lang=""ceb"">Nagtutukay sila,</i><trans> They stared at each other. </trans></eg>
<eg><i lang=""ceb"">Naghigugmáay sila,</i><trans> They were in love with one another. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> to intense actions. </trans>
<eg><i lang=""ceb"">Naghilákay sila,</i><trans> They cried and cried. </trans></eg>
<eg><i lang=""ceb"">Naghikayay sila kay pista ugmà,</i><trans> They were busy preparing because the fiesta was the following day.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (1470, "-ay", "-ay", "s", "");
INSERT INTO `wced_entry` VALUES (1471, "-ay2", "69", "<entry page=""69"" id=""1471""><form id=""x-ay2"" lang=""ceb"">-ay<sub>2</sub></form>
<hom>
<sense n=""0""><trans> affix added to verbs to form nouns referring to manner in which s.t. is done. </trans>
<eg><i lang=""ceb"">Maghúlin ta, bihagay,</i><trans> Let’s play marbles for keeps (in the manner of <ix>bíhag</ix> ‘capture’). </trans></eg>
<eg><i lang=""ceb"">Magtínis ta, sirbisahay,</i><trans> Let’s play tennis. The loser buys beer (lit. in the beer manner). </trans></eg>
<eg><i lang=""ceb"">Tagsingkwinta ang gatus, way piliay,</i><trans> They cost fifty a hundred, but no choosing.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (1471, "-ay", "-ay", "s", "");
