INSERT INTO `wced_entry` VALUES (1474, "ayaay", "69", "<entry page=""69"" id=""1474""><form id=""ayaxay"" lang=""ceb"">ayáay</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> time when water is slack at low tide before rising or at high tide before ebbing. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b4]</itype><trans> become <tr>slack tide</tr>. </trans>
<eg><i lang=""ceb"">Maáyung ipamúkut ug muayáay ang dágat,</i><trans> A good time to go net fishing is when the water is slack.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (1474, "ayáay", "ayaay", "m", "nv");
INSERT INTO `wced_translation` (entryid, translation) VALUES (1474, "slack tide");
INSERT INTO `wced_entry` VALUES (1475, "ayad1", "69", "<entry page=""69"" id=""1475""><form id=""ayad"" lang=""ceb"">ayad<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> refuse to go through with s.t., have second thoughts, esp. about buying. </trans>
<eg><i lang=""ceb"">Walay makaayad áning prisyung kubus,</i><trans> No one can have second thoughts about buying it at this low price. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>reject</tr> an offer. </trans>
<eg><i lang=""ceb"">Ikaw pa lay miayad sa ákung panábang,</i><trans> You’re the only one so far who has refused my aid. </trans></eg>
<eg><i lang=""ceb"">Pagkaaláut ning gugmang ímung giayran,</i><trans> Pity the one whose love you spurned. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>avoid</tr>, refrain contact with. </trans>
<eg><i lang=""ceb"">Nangayad siya sa mga pagkáun kay nanamkun,</i><trans> She couldn’t stand food because she was pregnant. </trans></eg>
<eg><i lang=""ceb"">Giayran siya sa mga táwu human siya mabangkarúta,</i><trans> People avoided him after he went bankrupt. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> particle expressing eagerness. </trans>
<eg><i lang=""ceb"">‘Mukáun kag mangga?’—‘Ayad!’</i><trans> ‘Do you want to eat mangoes?’—‘Sure thing. (Lit. Would I avoid them?)’ </trans></eg>
</sense></hom>
<entry><form id=""inayran"" lang=""ceb"">inayran</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. <tr>spurned</tr>, avoided. </trans>
<eg><i lang=""ceb"">Inayran sa katilingban,</i><trans> Spurned by society.
</trans></eg>
</sense></hom></entry></entry>");
