INSERT INTO `wced_entry` VALUES (1495, "ayri", "71", "<entry page=""71"" id=""1495""><form id=""ayri"" lang=""ceb"">ayri</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> air that gets into s.o.’s body causing disorder. </trans>
<eg><i lang=""ceb"">Kuyaw sa ayri nang paságad lag indiksiyun,</i><trans> If you’re careless in giving shots, there is danger of air getting into the body. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B246; b4]</itype><trans> for air to get into the body. </trans>
<eg><i lang=""ceb"">Ayawg pahangin humag kalígù kay ayrihan ka,</i><trans> Don’t expose yourself to the wind after you bathe, for air might get into you. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> admit air into a kerosene pressure lamp. </trans>
<eg><i lang=""ceb"">Ayríhag hínay arun dílì musiláub,</i><trans> Let air into it slowly so it won’t flare up. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; c]</itype><trans> get on a bicycle by stepping on the pedal which is in an up position, so that the wheel is propelled as one steps on the pedal. </trans>
<eg><i lang=""ceb"">Iayri ang bisiklíta inigsakay nímu,</i><trans> Pump the pedal as you get on the bike. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b6]</itype><trans> mount a woman (slang). </trans>
<eg><i lang=""ceb"">Nindut ayríhan nang bayhána,</i><trans> It’d be nice to have intercourse with that woman.
</trans></eg>
</sense></hom></entry>");
