INSERT INTO `wced_entry` VALUES (1502, "ayuda", "71", "<entry page=""71"" id=""1502""><form id=""ayuxda"" lang=""ceb"">ayúda</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>help</tr>. </trans>
<eg><i lang=""ceb"">Ayudáhi kug alsa ári,</i><trans> Help me lift this. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> give s.t. as a help. </trans>
<eg><i lang=""ceb"">Ang mga Láyuns nag-ayúda ug kinahun nga sardínas,</i><trans> The Lions gave boxes of sardines as <pb n=""72""/>aid. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>aid</tr>, <tr>help</tr> given. </trans>
</sense></hom>
<entry><form id=""ayuxda_dikampu"" lang=""ceb""><abbr expan=""ayúda"" type=""lemma"">—</abbr> dikampu</form>
<hom>
<sense n=""0""><trans> <tr>aide-de-camp</tr>. </trans>
</sense></hom></entry>
<entry><form id=""ayudanti"" lang=""ceb""><abbr expan=""ayudanti"" type=""lemma"">-nti</abbr></form>
