INSERT INTO `wced_entry` VALUES (1504, "ayum", "72", "<entry page=""72"" id=""1504""><form id=""axyum"" lang=""ceb"">áyum</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[APB3(1); a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for a wound to be healed or cured. </trans>
<eg><i lang=""ceb"">Dalì rang miáyum (naáyum) ang samad,</i><trans> It took only a short time for the wound to <tr>heal</tr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> free from troubles, grief, evil habits. </trans>
<eg><i lang=""ceb"">Ang panahun muáyum (mupaáyum) sa kaguul,</i><trans> Time will make us forget our sorrows. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> <tr>repair</tr>, <tr>mend</tr>, <tr>fix</tr>. </trans>
<eg><i lang=""ceb"">Muáyum siyag sapátus gubà,</i><trans> He repairs torn shoes. </trans></eg>
<eg><i lang=""ceb"">Ayúma ang ímung sinínà kay hugut da,</i><trans> Fix your dress because it’s too tight. </trans></eg>
</sense></hom>
<entry><form id=""ayum-axyum"" lang=""ceb"">ayum-áyum</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A1; c1]</itype><trans> <tr>fix</tr> s.t. up quickly in a makeshift way. </trans>
<eg><i lang=""ceb"">Nag-ayum-áyum siya sa kunut sa íyang sinínà,</i><trans> She hurriedly smoothed over her wrinkled dress. </trans></eg>
<eg><i lang=""ceb"">Kini makaayum-áyum sa ímung kagútum,</i><trans> This will alleviate your hunger temporarily. </trans></eg>
<eg><i lang=""ceb"">Ayum-ayúma (iayum-áyum) lang nang hiwì sa bukag,</i><trans> Just straighten out the crooked basket quickly. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AP; b6P]</itype><trans> make do with s.t. </trans>
<eg><i lang=""ceb"">Maáyu siyang muayum-áyum (mupaayum-áyum) sa tinábas sa pagtahì ug bistídu,</i><trans> She is good in making do with remnants in sewing her dresses. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AP; bP]</itype><trans> put up with s.t. temporarily. </trans>
<eg><i lang=""ceb"">Ayum-ayúmi (paayum-ayúmi) lang ang íyang kasábà, Tutal, ági man lang nà,</i><trans> Try to put up with her scolding. Anyway, it won’t last.
</trans></eg>
</sense></hom></entry></entry>");
